INSERT INTO `phpbb_posts` VALUES (3,3,5,58,1,'94.232.216.242',1649249242,0,1,1,1,1,'','Cykl Technology Features','<r>Cykl publikacji dotyczcych cech technologicznych wyrniajcych nasze scootery.<br/>\n<br/>\n<B><s>[b]</s>Post 1: Magnetic Propulsion<e>[/b]</e></B><br/>\n<br/>\nPublikacja: 04.04.2022<br/>\n<br/>\nFeatures that make the difference - Magnetic Propulsion. <br/>\nThe most unique element of Seacraft construction is its motor which operates directly in the water<EMOJI seq=\"1f30a\" tseq=\"1f30a\">&#127754;</EMOJI>. Specially designed and patented solutions <EMOJI seq=\"1f9f2\" tseq=\"1f9f2\">&#129522;</EMOJI> allow complete elimination of the drive shaft and the need for unreliable seals and gear transmissions used in other DPVs.<br/>\nThe motor <EMOJI seq=\"1f680\" tseq=\"1f680\">&#128640;</EMOJI> working in the water is much more durable and resistant to workload and also completely eliminates overheating inside the scooter. Innovative solutions enable the user to <EMOJI seq=\"1f93f\" tseq=\"1f93f\">&#129343;</EMOJI> work much deeper, longer  and with much greater motor power. Moreover, the motor runs almost silently, currently its the quietest scooter on the market.</r>','2d79f6b4d0851848a209b33decfb5494',0,'','9srv1',1,0,'',0,0,0,1,0,'',0),(4,4,5,58,7,'94.232.216.242',1649249545,0,1,1,1,1,'','Cykl Sprzedawcy','<t>Cykl publikacji dotyczcych naszych sprzedawcw. Na chwil obecn czekamy na odpowiedzi z Ankiet, jak na razie bez odpowiedzi. Wyglda na to, e aby cykl doszed do skutku sami bdziemy musieli ich opisa i zwrci si do nich o weryfikacj treci.<br/>\n<br/>\nNa chwil obecn posiadamy szablony grafik z mapkami.<br/>\n<br/>\nKogo powinny przedstawi pierwszego? Moje propozycje poniej.<br/>\n<br/>\n1. Upstream Niemcy<br/>\n2. DPV-Tech USA<br/>\n3. Snorkel and Dive Safari Australia</t>','24f86dc5d330af9debaddbfaac768643',0,'','1vxqmhd',1,0,'',0,0,0,1,0,'',0),(5,5,23,58,0,'94.232.216.242',1649250325,0,1,1,1,1,'','7-9.06.2022 [MIL] UDT Rotterdam, Holandia','<r>Temat powicony targom militarnym UDT 2022<br/>\n<br/>\nGdzie: Rotterdam, Holania<br/>\nKiedy: 7-9.06.2022<br/>\n<br/>\n<URL url=\"https://www.udt-global.com/\"><s>[url]</s>https://www.udt-global.com/<e>[/url]</e></URL><br/>\n<br/>\n<IMG src=\"https://cdn.asp.events/CLIENT_Clarion__96F66098_5056_B733_492B7F3A0E159DC7/sites/UDT-2020/media/Logos/UDT%202022_Logo_no%20back_margin.png\"><s>[img]</s><URL url=\"https://cdn.asp.events/CLIENT_Clarion__96F66098_5056_B733_492B7F3A0E159DC7/sites/UDT-2020/media/Logos/UDT%202022_Logo_no%20back_margin.png\"><LINK_TEXT text=\"https://cdn.asp.events/CLIENT_Clarion__ ... margin.png\">https://cdn.asp.events/CLIENT_Clarion__96F66098_5056_B733_492B7F3A0E159DC7/sites/UDT-2020/media/Logos/UDT%202022_Logo_no%20back_margin.png</LINK_TEXT></URL><e>[/img]</e></IMG></r>','ba8df19c9f9922c4d4c1dedaf5bac0ae',0,'','en35guo',1,0,'',0,0,0,1,0,'',0),(6,6,20,58,0,'94.232.216.242',1649250592,0,1,1,1,1,'','GO! - scenariusz filmu','<t>Temat powicony na pomysy dotyczce filmu promujcego GO!</t>','b118474eabd05a1388ac6413cfd49c81',0,'','9t3',1,0,'',0,0,0,1,0,'',0),(7,7,41,58,0,'94.232.216.242',1649250753,0,1,1,1,1,'','Sugestie, pomysy, zgoszenia','<t>Temat powicony na wszelkiego rodzaju sugestie, pomysy i przemylenia dotyczce usprawenienia i ogranizacji forum.</t>','65532f30f6ecdf9fd8b2674543f8c8db',0,'','11l',1,0,'',0,0,0,1,0,'',0),(8,8,5,58,7,'94.232.216.242',1649251068,0,1,1,1,1,'','Cykl Ambasadorzy','<t>Cykl publikacji dotyczcych naszych ambasadorw. Temat przyszociowy, ale mona rozway prowadzenie kilku cykli jedoczenie np na przemian ze sprzedawcami i technology features, eby urozmaici troche treci publikowanych materiaw? Co sdzicie?</t>','b4ec7ee235f365f23b9d49dc7096f63a',0,'','4c855x',1,0,'',0,0,0,1,0,'',0),(9,9,31,58,9,'192.162.175.145',1649267233,0,1,1,1,1,'','Czy potrzebujemy nowych kanaw SM?','<t>Rozwaania na temat potencjalnej obecnoci Seacraft na nowych kanaach social media.<br/>\n<br/>\nWychodzc naprzeciw dynamicznie rozwijajcych si kanaw social media, warto si zastanowi czy w naszej brany warto uruchomi ktry ze wspomnianych w ankiecie kanaw social media. Co w rodowisku nurkw jest na topie?</t>','bb4d5c05c31a28bfb6e2458c162bbf9d',0,'','33k0hd06',1,0,'',0,0,0,1,0,'',0),(12,12,31,58,0,'192.162.175.145',1649267808,0,1,1,1,1,'','Godne uwagi tematy','<t>Temat przeznaczony do wrzucania ciekawych tematw lub wydarze o ktrych warto wspomnie na naszym FB/Insta.<br/>\n<br/>\nJeeli macie jakie ciekawe tematy i info, dajcie prosz zna.</t>','50e163e3fb00e3b6f53382ae30d6fa4f',0,'','nmgpj',1,0,'',0,0,0,1,0,'',0),(13,13,9,58,0,'192.162.175.145',1649267890,0,1,1,1,1,'','Aktualizacja produktw','<t>Temat powicony na dyskusje sugestie i informacj jakie produkty powinnimy na stron doda/usun/aktualizowa.</t>','a53f8e961d3aab9b24152839d0cbc9f5',0,'','1q840lo',1,0,'',0,0,0,1,0,'',0),(14,14,9,58,0,'192.162.175.145',1649268020,0,1,1,1,1,'','Aktualizacja wydarze','<t>Temat powicony aktualizacji wydarze o ktrych powinnimy wspomnie na naszej stronie.</t>','27efbd2cd8c794cf76466f2a0e22aeb5',0,'','dinywqf',1,0,'',0,0,0,1,0,'',0),(16,16,9,58,0,'192.162.175.145',1649268751,0,1,1,1,1,'','Aktualizacja zakadki MIL','<t>Aktualizacja i uzupenienie zakadki MIL.<br/>\n<br/>\nCo musimy doda:<br/>\n- Rozdzieli/doa produkty na wzr REC<br/>\n- Informacje na temat koncesji<br/>\n- B+R</t>','0a0e8ae54304af99229c82f14b805cf5',0,'','ss1u5cg',1,0,'',0,0,0,1,0,'',0),(17,17,10,58,0,'192.162.175.145',1649268940,0,1,1,1,1,'','Zmiana moduu newsy','<t>Obecny modu i prezentacja newsw zdecydowanie odbiega od naszych oczekiwa w tym temacie przedyskutujemy kwestie jego wymiany, nowych propozycji.</t>','e6a180984084dd7e36c31aae2bba1206',0,'','2egof3',1,0,'',0,0,0,1,0,'',0),(18,18,15,58,0,'192.162.175.145',1649269260,0,1,1,1,1,'','Tematy na Business Update MIL','<t>Temat przeznaczony do wymiany pomysw o czym warto poinformowa partnerw militarnych w najbliszym Business Update.<br/>\n<br/>\nUpdate wysyamy nieregularnie, gdy chcemy o czym istotnym poinformowa naszych partnerw. Wylemy gdy uzbiera si kilka ciekawych tematw.<br/>\n<br/>\nPropozycja tematw:<br/>\n1. Informacja o naszej obecnoci na UTD Rotterdam Czerwiec 2022.<br/>\n2. Nowy katalog M&amp;S<br/>\n<br/>\n...</t>','465f00f9aab6d0ce00a1454078013489',0,'','26ifwn',1,0,'',0,0,0,1,0,'',0),(19,19,14,58,0,'192.162.175.145',1649269314,0,1,1,1,1,'','Tematy na Business Update REC','<t>Temat przeznaczony do wymiany pomysw o czym warto poinformowa partnerw REC w najbliszym Business Update.<br/>\n<br/>\nUpdate wysyamy nieregularnie, gdy chcemy o czym istotnym poinformowa naszych partnerw. Wylemy gdy uzbiera si kilka ciekawych tematw.</t>','401d4fb5a2a8d915e90a3e2e5157787d',0,'','168',1,0,'',0,0,0,1,0,'',0),(20,20,43,58,8,'192.162.175.145',1649269798,0,1,1,1,1,'','Kalendarz wydarze - co, gdzie i kiedy','<r>Informacje na temat kalendarza wszelkiego rodzaju wydarze nurkowych.<br/>\n<br/>\nAktualny kalendarz i rozpiska z informacjami, ktry z naszych partnerw gdzie si pojawi dostepny i aktualizowany na Synology pod ciek:<br/>\n<br/>\n<B><s>[b]</s>C:\\SynologyDrive\\MT\\MT_MARKETING\\SPRZEDAWCY\\TARGI_EVENTY_NURKOWE.xlsx<e>[/b]</e></B><br/>\n<br/>\nTemat ma suy wymianie informacji na temat wszelkiego rodzaju wydarze nurkowych.</r>','bacecb99e8b8d719cb4542d0599125f4',0,'','jiwswlb',1,0,'',0,0,0,1,0,'',0),(21,5,23,58,0,'94.232.216.242',1649314767,0,1,1,1,1,'','Re: [MIL] UDT Rotterdam, Holandia 7-9.06.2022','<r>W naszym planie pracy uwzgldnilimy, e targi odbywaj si w lipcu, z oficjalnej strony wynika, e s one w czerwcu. Nie wiem, czy nastpia zmian, czy omykowo wpisalimy tam lipiec, a nie czerwiec.<br/>\n<br/>\nZmianie musz ulec deadliny na karty katalogowe i katalog i inne materiay ktre musimy mie miesic wczeniej ni zakadalimy.<br/>\n<br/>\nRozmawiaem wczorja z przedstawicielk oficjalnego partnera targw Event Guide zajmujcego si promocj i reklam uczestnikw targw m.in. w oficjalnym przewodniku targw.<br/>\n<br/>\nLog z rozmowy i oferta reklamowa, ktr nam zaoferowali poniej, ceny kosmiczne ok 5k gbp za umieszczenie dobrych reklam i naszej obecno w ich publikacjach:<br/>\n\n<QUOTE><s>[quote]</s>Hi Damian, <br/>\n<br/>\nThank you for your time today, please find attached the information as discussed. 2 sponsorship options below: <br/>\n<br/>\nOption 1. Floorplan Sponsorship  Official Event Guide <br/>\n Full colour logo branding on the Floorplan and Exhibitor A-Z with the words sponsored by xxx<br/>\n A message saying Visit us at stand xx printed with your logo<br/>\n A directional trail marked from the entrance to your stand location on the Floorplan<br/>\n Your stand highlighted on the Floorplan<br/>\n Full page advertisement on the Inside Front Cover (Gatefold)<br/>\n Horizontal banner advertisement at the bottom of the same page as your Exhibitor Profile<br/>\n Logo/image upgrade with your Exhibitor Profile listing<br/>\n=4,995 <br/>\n<br/>\nExamples will follow below. <br/>\n<br/>\nOption 2. <br/>\nExhibitor Profile Sponsorship  Official Event Guide <br/>\n	Logo branding across the bottom of every editorial page of the Exhibitor Profiles Section<br/>\n	A message saying Visit us at stand xx printed with your logo<br/>\n	Full page advertisement opposite the opening page of the Exhibitor Profiles section<br/>\n	Company name and stand number highlighted in all lists<br/>\n	Logo/image upgrade with your Exhibitor Profile listing<br/>\n	Horizontal banner advertisement at the bottom of the same page as your Exhibitor Profile<br/>\n=4,995<br/>\n<br/>\nExamples below. <e>[/quote]</e></QUOTE>\n\nNie wiem, czy wczeenij kupowalimy tego typu reklamy na targach, interesuj nas tego typu opcje?</r>','5582b7f7f9c992453eede6cb185029f8',0,'','1bf5qhu',1,0,'',0,0,0,1,0,'',0),(22,21,43,60,0,'94.232.216.242',1649314934,0,1,1,1,1,'','CaveCamp Mexico 2022','<t>Cze,<br/>\nw dniach 10-24 wrzenia 2022 odbdzie si szsta edycja CaveCamp Mexico. <br/>\nSkontaktowaam si z Lannym i w zwizku z maym zainteresowaniem czerwcow akademi skupiaj si w 100% na wrzeniowym wydarzeniu. Poniej szczegy przekazane przez Lanny\'ego.<br/>\n<br/>\nKorzyci dla sponsorw:<br/>\n- promocja sponsora na stronie www CaveCamp z logo,<br/>\n- promocja w mediach spoecznociowych podczas eventu,<br/>\n- pakiet profesjonalnych zdj z eventu,<br/>\n- reklama w magazynie nurkowym CaveCamp (1 strona),<br/>\n- zamieszczenie logo sponsora na koszulce eventowej, banerze<br/>\n- impreza tematyczna \"Seacraft\" wycznie z naszymi logotypami, prezentacj produktw itp. <br/>\n<br/>\nWkad sponsora:<br/>\n- 1199$ na pokrycie t-shirtw, banerw, imprezy tematycznej i broszur,<br/>\n- 55 szt. przedmiotu tematycznego do toreb prezentowych dla uczestnikw,<br/>\n- nagroda gwna do losowania.<br/>\n<br/>\nProsz o nastpujce informacje:<br/>\n* czy na pewno zgadzamy si na wkad pieniny?<br/>\n* jakie produkty oferujemy do torby prezentowej w iloci 55 szt.?<br/>\n* jaki produkt gwny przekaemy?</t>','c012455ae8d96e03a205976b83868e0b',0,'','85373',1,0,'',0,0,0,1,0,'',0),(23,6,20,60,0,'94.232.216.242',1649315380,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>POST EDYTOWANY PO SPOTKANIU ONLINE<br/>\nRozmawiaam z Adamem Wasiakiem (FrogTV) i obiecaam odezwa si pocztkiem przyszego tygodnia z pomysami na scenariusz. Temat pilny, bo Adam moe dziaa do koca czerwca. Na ten moment lista pomysw zawiera:<br/>\n<br/>\nZaoenia do filmu promocyjnego:<br/>\n- na wstpie krtko chcemy pokaza, e produkcja skutera odbywa si u nas w Kronie, bez wikszych szczegw,<br/>\n- nastpnie skuter trafia do klienta,<br/>\n- przygotowanie skutera do podry,<br/>\n- zapakowanie skutera do torby podrnej, baterie osobno do podrcznego,<br/>\n- odprawa bagaowa i kontrola (x-ray baterii) ,<br/>\n- wejcie do samolotu ze skuterem, ewentualnie ujcie samolotu i innej osoby, ktra egna/macha w stron samolotu<br/>\n- uycie skutera w fajnym miejscu, moe egzotycznym,<br/>\n- uycie skutera przez kobiet - sprzt jest lekki<br/>\n<br/>\nWpisujcie swoje pomysy, bd uzupenia list.<br/>\n<br/>\n<B><s>[b]</s>Witku - zweryfikuj prosz moliwo nagrania wstawek do filmu w Poznaniu. <br/>\nDobrze byoby te ustali kto, gdzie i na kiedy moe nagra wstawki z nurkowania w adnych miejscach. <e>[/b]</e></B></r>','e3be1cefec033b00beb5280f6bc83748',0,'','1de5jlk',1,0,'',0,0,0,1,0,'',0),(24,21,43,63,0,'85.221.240.2',1649319750,0,1,1,1,1,'','Re: CaveCamp Mexico 2022','<t>Lanny prawdopodobnie byby rwnie chtny na barter skuterowy. To idealny event, oraz daty by wczy wydarzenie w kampani GO! i udostpni 3 skutery na miejscu.<br/>\n<br/>\nOstatnio uczestnicy dostali klucze w ksztacie skutera oraz nagroda gwna - ENC3.<br/>\n<br/>\nZawsze jest z nimi mega dobry kontakt, dziaaj w social mediach, maj te du etyk pracy i jakoci tego co robi. <br/>\n<br/>\nPoszedbym w kierunku prby barteru (dla nas zawsze taniej) + wplecenia w kalendarz premiery GO!.</t>','e1d25870634833a26e885d03be81c4c4',0,'','7ocfn',1,0,'',0,0,0,1,0,'',0),(25,22,18,58,0,'94.232.216.242',1649320975,0,1,1,1,1,'','Karty katalogowe','<t>Temat powicony przygotowaniu kart katalogowych. <br/>\n<br/>\nNa bazie katalogu MIL ktry Witek przygotowa wychodzi mi tak list kart katalogowych, ktre chc przygotowa:<br/>\n<br/>\n-Scooters, Dual scooters<br/>\n-Accessory and spart parts - DPV<br/>\n-Light system<br/>\n-Power converter<br/>\n-ENC<br/>\n-Accessory and spart parts - ENC<br/>\n- Normy i certyfikaty<br/>\n<br/>\nCzy co pominaem/powinnimy doda? Oczywiscie karty nowoci bdziemy mogli bezproblemowo tworzy i dodawa na bazie szablonu ktry tworz, wersja uproszona i wersja w stylu katalogu.</t>','a7d24dd5a410d29237dbe84664c332a4',0,'','tgbkrk4',1,0,'',0,0,0,1,0,'',0),(26,23,9,58,0,'94.232.216.242',1649322338,0,1,1,1,1,'','Jzyk koreaski','<t>Temat powicony wdroeniu jzyka koreaskiego na naszej strnie.</t>','db20ec8bb4fa3bbc85704f1ef70b791e',0,'','5h4u',1,0,'',0,0,0,1,0,'',0),(27,24,28,63,0,'85.221.240.2',1649323093,0,1,1,1,1,'','Zdjcia i materiay','<r>Hej<br/>\nMaj by gotowe 3 skutery GO! Do rozesania. Opcje:<br/>\n<br/>\n-Cavebase---&gt; kadry techniczne, urywki filmw z nurkami technicznymi --&gt; samodzielnie<br/>\n<br/>\n-Irena Stangierska- zdjcia z ciepych wd. Trzeba zorganizowa wyjazd, oraz zapewni modela.<br/>\n<br/>\n- <URL url=\"https://www.digitalmovie.it/\">https://www.digitalmovie.it/</URL>  --&gt; nasza opcja na zdjcia \'suche\', lifestyle\'owe. (Dziewczyny w bikini na play <E>;)</E>). Wanie prosi o skuter ze znik dla czonka zespou, mona poczy tematy. Doskonaa jako materiaw. Rwnie opcje na video - ta sama sesja.</r>','54e5b449b6ab12aae1b6b80833521735',0,'','4p2ma54v',1,0,'',0,0,0,1,0,'',0),(28,22,18,63,0,'85.221.240.2',1649329201,0,1,1,1,1,'','Re: Karty katalogowe','<r><URL url=\"https://www.equipnor.com/media/3003/2019_military_buyersguide.pdf\"><LINK_TEXT text=\"https://www.equipnor.com/media/3003/201 ... sguide.pdf\">https://www.equipnor.com/media/3003/2019_military_buyersguide.pdf</LINK_TEXT></URL></r>','56d4af9e38c9cde2d180ca2a1c7e9713',0,'','8rb6g',1,0,'',0,0,0,1,0,'',0),(29,5,23,61,0,'94.232.216.242',1649331759,0,1,1,1,1,'','Re: [MIL] UDT Rotterdam, Holandia 7-9.06.2022','<t>Kwestie tych targw naley w wikszoci ustala z Frankiem. To bardzo drogie targi std takie kosmiczne ceny. Reklamy nie bdziemy wykupywa.<br/>\n<br/>\nWitek, popro Franka o sporzdzenie listy sprztu na targi. Musimy wiedzie, e np. DPC ma by gotowe ...<br/>\nProsz o przygotowanie tego w formie zamwienia na sprzt targowy.<br/>\n<br/>\nJaka korespondencja, plany stoiska itp s na redmine podpite w formie plikw.</t>','8691aaa550547528367bdbd3c417b5b9',0,'','i5p',1,0,'',0,0,0,1,0,'',0),(30,21,43,60,0,'94.232.216.242',1649334661,0,1,1,1,1,'','Re: CaveCamp Mexico 2022','<t>Ustalenia po spotkaniu online: <br/>\nWitek skontaktuje si z Lannym, eby wypyta o moliwoci barteru w zamian za rezygnacj ze skadki sponsorskiej. <br/>\nEwentualna nagroda gwna jeli nie skuter to kartownik.</t>','a7f161fb56b42bfa8e5a6ed50f0c36e9',0,'','3v3ow',1,0,'',0,0,0,1,0,'',0),(31,25,10,58,0,'94.232.216.242',1649398683,0,1,1,1,1,'','Bdy, nie dziaajce linki','<r>Temat przeznaczony na zgaszanie bdw i nieprawidowoci na stronie www.<br/>\n<br/>\nPo przejciu opieki nad stron przez Marcina dowiadczylimy problemw z linkami w sekcji produkty.<br/>\nPo gbszej analizie strony zauwaylimy z Witkiem kilka innych nie dziaajcych komponentw:<br/>\n<br/>\nBd 1: <br/>\n\n<QUOTE><s>[quote]</s>Po wejciu w kady produkt - na dole, zakadki \"Support portal\" kieruje do <URL url=\"https://seacraft.eu/seacraft/support/support-portal/\">https://seacraft.eu/seacraft/support/support-portal/</URL>, a powinna do <URL url=\"https://support.seacraft.eu/\">https://support.seacraft.eu/</URL>, ten sam problem dotyczy nie dziaajcych linkw do cennika i innych komponentw prypisanych do dolnego menu produktw.<e>[/quote]</e></QUOTE>\n\nRozwizanie: <br/>\n\n<QUOTE><s>[quote]</s>W toku, Marcin zosta ju poinformowany, pracuj nad tym.<e>[/quote]</e></QUOTE>\n\n<B><s>[b]</s>Jeeli zauwaycie jeszcze jakie nie dziaajce linki czy inne bdy na stronie, prosz napiszcie w tym temacie, a ja bd to zgasza Marciowi aby bdy zostay szybko zdiagnozowane i usunite.<e>[/b]</e></B></r>','c8540767db5772484d230a976716d442',0,'','9fznr',1,0,'',0,0,0,1,0,'',0),(32,7,41,61,0,'185.153.39.80',1649407009,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<t>KARTOWNIK - do dodania nowy produkt.<br/>\n<br/>\nDetale zostan wyprodukowane do 22.04.2022.<br/>\nPo zoeniu mona zabra do zrobienia zdjcia produktowego.</t>','9f0a99dd89a8c15d4b7135daf27cbcfc',0,'','94tbbf8a',1,0,'',0,0,0,1,0,'',0),(33,26,44,58,0,'94.232.216.242',1649407938,0,1,1,1,1,'','Kartownik','<t>Wtek powicony Kartownikowi.<br/>\n<br/>\nDetale zostan wyprodukowane do 22.04.2022.<br/>\nPo zoeniu mona zabra do zrobienia zdjcia produktowego.</t>','99199e502648d1def5e1e60d1aee0b0e',0,'','c1zt',1,0,'',0,0,0,1,0,'',0),(34,7,41,58,0,'94.232.216.242',1649408009,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<r>Dodane <E>:)</E></r>','82d1ecdb6af36e2fc393a29f31cbe5ce',0,'','105drqr',1,0,'',0,0,0,1,0,'',0),(35,22,18,61,0,'185.153.39.80',1649409745,0,1,1,1,1,'','Re: Karty katalogowe','<r>Folder MARKETING ---&gt; MILITARY_KARTY KATALOGOWE<br/>\nWgraam to od czego zaczynalimy w tamtym roku. <br/>\nWgraam obowizujcy cennik militarny (wieutki <E>:)</E><br/>\n<br/>\nUkad musi by oczywicie pionowy - format A4 daje w sumie duo miejsca na tre. <br/>\nTeraz jest czas na szablon a potem pjdziemy dalej.</r>','9490d6fd86e3a8dbfe19c61ebb59165d',0,'','9utuk',1,0,'',0,0,0,1,0,'',0),(36,22,18,58,0,'94.232.216.242',1649409938,0,1,1,1,1,'','Re: Karty katalogowe','<t>wietnie, bior si za przygotowanie szablonu.</t>','f7d19c836acf0d5c884cb768b1f667ae',0,'','3qmc7g',1,0,'',0,0,0,1,0,'',0),(37,25,10,60,0,'91.196.8.186',1649417786,0,1,1,1,1,'','Re: Bdy, nie dziaajce linki','<r>Tak jak zgaszaam Damianowi, nie dziaaj linki <URL url=\"https://seacraft.eu/seacraft/technology/features/\">https://seacraft.eu/seacraft/technology/features/</URL> pod kad zakadk \"learn more\".</r>','4756d48dfe1f7c53f8022491a14d4163',0,'','198xz7v',1,0,'',0,0,0,1,0,'',0),(38,25,10,58,0,'94.232.216.242',1649418619,0,1,1,1,1,'','Re: Bdy, nie dziaajce linki','<r>Jak si okazuj, problem bardziej rozlegy..<br/>\n<br/>\nNie dziaaj:<br/>\n<br/>\n<URL url=\"https://seacraft.eu/seacraft/technology/features/\">https://seacraft.eu/seacraft/technology/features/</URL><br/>\n<URL url=\"https://seacraft.eu/go-deeper/ambassador/\">https://seacraft.eu/go-deeper/ambassador/</URL><br/>\n<URL url=\"https://seacraft.eu/go-deeper/environment/\">https://seacraft.eu/go-deeper/environment/</URL><br/>\n<URL url=\"https://seacraft.eu/go-deeper/world-records/\">https://seacraft.eu/go-deeper/world-records/</URL><br/>\n<URL url=\"https://seacraft.eu/go-deeper/exploration/\">https://seacraft.eu/go-deeper/exploration/</URL><br/>\n<br/>\nPrzy prbie wejsci w kad z podstron gwnego dziau wyrzuca bd 404.<br/>\n<br/>\nLinki  na stronie nie dziaaj wg schematu:<br/>\n<br/>\nMenu gowne -&gt; Dzia nadrzdy OK. -&gt; Kategoria OK. -&gt; Dzia OK. -&gt; podddzia USZKODZONE linki.<br/>\n<br/>\n<B><s>[b]</s>Zgoszone Marcinowi.<e>[/b]</e></B></r>','3341dae5923ec57cc7f7afa0edbccd5c',0,'','8xwbs',1,0,'',0,0,0,1,0,'',0),(39,25,10,63,0,'85.221.240.2',1649420639,0,1,1,1,1,'','Re: Bdy, nie dziaajce linki','<t>Nie chc \'kopa lecego\' - ale wersja DE ley po caoci. Marcin pisa e j postawi (wic teoretycznie ma wiadomo e nie dziaa).<br/>\n<br/>\nBoj si e modyfikuj linki manualnie, zamiast poprawi ca funkcjonalno wtyczki ktra zarzdza linkami w wersjach wielojzycznych.</t>','29e7a822f427e8f3c5b7137cdcd05b15',0,'','2n2ffp',1,0,'',0,0,0,1,0,'',0),(40,25,10,61,0,'185.153.39.80',1649423134,0,1,1,1,1,'','Re: Bdy, nie dziaajce linki','<t>Czy dajemy im czas do poniedziaku? <br/>\nCzy trzeba w trybie natychmiastowym da to komu innemu do reanimacji?<br/>\n<br/>\nDamianie, <br/>\nprosz o Twoje zdanie na ten temat.</t>','a9fa33504b842cc14b0d0f3e9da3c919',0,'','mj9ctve',1,0,'',0,0,0,1,0,'',0),(41,25,10,58,0,'79.187.195.66',1649442295,0,1,1,1,1,'','Re: Bdy, nie dziaajce linki','<t>Na chwil obecn wikszo linkw zostaa naprawiona. Wersja niemiecka te, potestuje w wolnej chwili czy problem zosta rozwizany. Wydaj si, e poar ugaszony.<br/>\n<br/>\nMarcin musi si dostosowa do naszego systemu pracy i komunikacji, oraz naszych warunkw, to na pewno.</t>','573f932d625322b678f6a8fd325608f1',0,'','4xnpmur3',1,0,'',0,0,0,1,0,'',0),(43,27,23,63,0,'85.221.240.2',1649660113,0,1,1,1,1,'','21.04.2022 [MIL] Event Gearpoint','<r>Hej<br/>\nNiej cytaty wiadomoci w tym temacie :\n<QUOTE><s>[quote]</s>Wanie zdzwoniem si z Rubenem. Przetarg dla si specjalnych jest ju rozpisany i bd tam osobne (wchodzce w skad oceny sprztu) testy w wodzie, natomiast tak czy siak bd osoby decyzyjne na evencie. Bd te zainteresowane skuterami jednostki policyjne, moliwe ze te Belgia. Flamur- go z 5h pywania na Sieniawie, te bdzie.<br/>\n<br/>\nEvent jest zamknity, tylko na zaproszenia - nie promowany. Odbywa si u nich na miejscu : <URL url=\"https://www.facebook.com/GearPoint/\">https://www.facebook.com/GearPoint/</URL><br/>\n<br/>\nKoordynowaem moliwo testw w wodzie poczonych z jednym przejazdem, ale w tej chwili  (przed wyjciem przetargu), zapraszanie si specjalnych na spotkanie bezporednio z producentem moe by podstaw prawn do wykluczenia - opcja odpada. (od 3 tygodnie prbowali to tak zorganizowa)<br/>\n<br/>\nGeograficznie z Poznania do Amersfoort jest 850km. Chyba najlepsz opcj sprztow jest wysyka.<br/>\n<br/>\n-Iga, potrzebowabym informacji czy skutery :<br/>\n<br/>\nmaj zamontowane przetwornice. W jakim s stanie wizualnym? Wypalone wywietlacze, zainstalowany soft itd.?<br/>\n<br/>\n<br/>\nCzy skutery MIL z magazynu maj przetwornice? Bdzie to dziaanie \'nie w wodzie\', na targi w lipcu rwnie potrzebujemy sprzg \'targowy\':<br/>\n<br/>\nCzy te sprzgi s z nowymi uchwytami i platformami?<br/>\n<br/>\n<br/>\nBd te wdziczny za informacje o opcjach na:<br/>\n<br/>\n-targowy maszt<br/>\n<br/>\n-SUM do pokazania Flamourowi<br/>\n<br/>\n-ENC3M skoordynuj z Albinem.<br/>\n<br/>\n<br/>\nS dostpne na miejscach stoy wystawowe - jeden standard dla wszystkich, wic prawdopodobnie optymalne s stojaki na skutery.<br/>\n<br/>\n<br/>\nJeli s gotowe jakie dodatkowe ciekawostki jakie warto pokaza, dajcie zna.<br/>\n<br/>\nWysyka- druga poowa przyszego tygodnia, przynajmniej jak chodzi o najwaniejsze elementy.<e>[/quote]</e></QUOTE>\n\nLista pakowania(wysyane z Krosna):<QUOTE><s>[quote]</s>Katalog MIL - pozostae				15<br/>\nUlotka MIL 				60<br/>\nTAC2000 ns211 (z przetwonic)				1<br/>\nTAC2000 ns165 (z przetwonic)				1<br/>\nSkutery TAC2000- bdzie na nich zbudowany sprzg dual TAC2000 z szerok platform				x<br/>\nSzeroka platforma sprzgajca z nowym systemem, cznie 4 uchwyty 208 do sprzgania (komplet)				1<br/>\nStojak 208mm				2<br/>\nKabel z wyjciem E/O wkrcany w gniazdo adowania				1<br/>\nLatarki SLS2				1<br/>\nTAC1000 (ns 279) (z przetwornic)				1<br/>\nStojak 160mm				1<br/>\nMaszt GPS mocowany do 2 uchwytw 				1<br/>\nPlatforma ENC3M - komplet, z bojk GPS typ B (nie musi by w walizce)				1<br/>\nFlaga MIL (koordynuje Paulina)				2<br/>\nMilitary&amp;Special Seacraft Black cotton tshirt (print in front) - rozmiary L, XL, XXL				po 3 szt z rozmiaru<br/>\nMiliary&amp;Special Seacraft M&amp;S 3 cotton hat  unisex				10<br/>\nMilitary&amp;Special Seacraft M&amp;S 3 cap  unisex				10<br/>\nSeacraft universal key (klucz w ksztacie skutera				5<br/>\nadowarka 400W do hermetycznego zcza adowania				1<br/>\nUSB charging outlet (2 x 5V)  from scooter\'s hermetic charging port				1<br/>\nTrigger lock				2<br/>\nPonisze- opcjonalne (pyta Piotra)				x<br/>\nZwalniacz (jeli dostpny)				1<br/>\nSUM (bdzie odesany na koniec kwietnia)				1<br/>\nniewielkie drobiazgi do pokazania - jeli co jest (nowe mocowanie do ENC?)				x\n<e>[/quote]</e></QUOTE></r>','fdd75aad6212b66fd0aa0003f026b8ab',0,'','1mgihdz',1,0,'',0,0,0,1,0,'',0),(44,27,23,63,0,'85.221.240.2',1649660493,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>Stan na chwil obecn.<br/>\n<br/>\n-Maj na miejscu zorganizowa ekran/telewizor (pokazywanie filmw w akcji, szczeglnie DPC)<br/>\n<br/>\n-do dyspozycji na miejscu s stoy - zwyke - 180x80cm, niskie. W razie czego, lepiej mie obrusy/ tkanin na gr eby jako to wygldao.<br/>\nChc zamwi co w stylu: <URL url=\"https://allegro.pl/oferta/obrus-diamond-plamoodporny-140x200-gruby-kolory-11748459474\"><LINK_TEXT text=\"https://allegro.pl/oferta/obrus-diamond ... 1748459474\">https://allegro.pl/oferta/obrus-diamond-plamoodporny-140x200-gruby-kolory-11748459474</LINK_TEXT></URL> - grafit albo granat. Na czarnym zlewaj si skutery. Jeli stoy bd estetyczne- mona pomin, ale nie zaszkodzi mie. (maj wysa mi zdjcie stou)<br/>\n<B><s>[b]</s>Dajcie zna ktry kolor waszym zdaniem najlepszy.<e>[/b]</e></B><br/>\n<br/>\n-troch rzeczy mam na miejscu - teczki, worki, kilka czapek.</r>','4deda3045dedd7371690287564ac53a6',0,'','pl3jcl',1,0,'',0,0,0,1,0,'',0),(45,27,23,60,0,'91.196.8.186',1649661914,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>Hej, co do obrusw - rednio widzi mi si ten wiszcy obrus. Wyglda troch obiadowo, mimo adnego koloru. <br/>\nChyba lepiej zakupi pokrowc