pewno si przyda i na przyszo, pod wszelakie prezentacje, taki st wygodnie si wozi: <URL url=\"https://allegro.pl/oferta/stol-ogrodowy-cateringowy-skladany-180x75cm-rattan-11925489030?bi_s=ads&amp;bi_m=listing%3Adesktop%3Aquery&amp;bi_c=OThkZDZhYzAtMDIyZC00ODY0LTk0NTgtNjFhZmVmYWJhM2EwAA&amp;bi_t=ape&amp;referrer=proxy&amp;emission_unit_id=ac097212-1e52-4e36-88c5-fcee55c62415\"><LINK_TEXT text=\"https://allegro.pl/oferta/stol-ogrodowy ... ee55c62415\">https://allegro.pl/oferta/stol-ogrodowy-cateringowy-skladany-180x75cm-rattan-11925489030?bi_s=ads&amp;bi_m=listing%3Adesktop%3Aquery&amp;bi_c=OThkZDZhYzAtMDIyZC00ODY0LTk0NTgtNjFhZmVmYWJhM2EwAA&amp;bi_t=ape&amp;referrer=proxy&amp;emission_unit_id=ac097212-1e52-4e36-88c5-fcee55c62415</LINK_TEXT></URL></r>','1d6139c26afc9549a2386a20c4b7b1e2',0,'','3fysp',1,0,'',0,0,0,1,0,'',0),(53,29,26,58,0,'94.232.216.242',1649743251,0,1,1,1,1,'','14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<t>11 edycja NURKOWE DEMO DAYS 2022<br/>\nMiejsce: Jaworzno, Koparki<br/>\nKiedy: 14-15.05.2022<br/>\n<br/>\nCzy w tym roku, Deep Adventure take bdzie nas tam reprezentowa? Mamy ju jakie info od Marcina Bramsona.<br/>\n<br/>\nWiem, e Marcin Paweczyk bdzie tam obecny, mogby pewnie dla nas zrobi jakie fajne zdjcia do wykorzystania w SM.</t>','ca2b7bd4a98bc094bc45b435e543a845',0,'','73s6k',1,0,'',0,0,0,1,0,'',0),(54,30,45,58,0,'94.232.216.242',1649745136,0,1,1,1,1,'','Uchwyt na kamer','<t>Wtek powicony Uchwytowi na kamer.</t>','73061d72ec2a0a42a263443f8b4e6417',0,'','chjpnnr',1,0,'',0,0,0,1,0,'',0),(55,29,26,61,0,'94.232.216.242',1649746743,0,1,1,1,1,'','Re: Nurkowe Demo Days Jaworzno, Koparki 14-15.05.22','<t>Napisz do niego maila w tej sprawie.</t>','5c4c928207de772beaf49e2c4fb4ea4f',0,'','eq199vr',1,0,'',0,0,0,1,0,'',0),(56,31,46,58,0,'94.232.216.242',1649749208,0,1,1,1,1,'','Obcienie elektroniczne','<t>Wtek powicony nowemu produktowi Obcienie elektroniczne - Electronic load, for battery capacity testing</t>','f5f91546611c815e74b78d45254d0c5b',0,'','bnrcm9m',1,0,'',0,0,0,1,0,'',0),(57,32,21,63,0,'85.221.240.2',1649754914,0,1,1,1,1,'','Zdjcia produktowe- paczka, materiay marketingowe','<t>Jest mocna potrzeba uporzdkowania i skatalogowania zdj produktowych - zarwno cywilnych jak i militarnych- w aktualne paczki, z kodami produktowymi i nazwami produktowymi. Materiay powinny wisie na chmurze cloud.seacraft i mie moliwo atwego udostpniania klientom.<br/>\n<br/>\nPodobnie wyglda temat paczki materiaw reklamowych. Mamy staraw, z logtypami, zdjciami w akcji, i podobnymi materiaami. Generalnie sdz e materiay powinny by \'na twardo\' hostowane na cloud.seacraft, ale... przewodnik? Spis treci? Poradnik? z odnonikami do nich - umieszczony na support.seacraft.eu w strefie dla resellerw.</t>','ddc7454f616c923d24bfedcc2b7126cd',0,'','4wktr',1,0,'',0,0,0,1,0,'',0),(59,30,45,63,0,'85.221.240.2',1649755375,0,1,1,1,1,'','Re: Uchwyt na kamer','<t>Mamy testerw z duymi kamerami - choby ekipa z Malty - ktra moe i chtnie przetestuje w akcji uchwyt. Jeli dostan alokacj 1-2szt do wysyek, skoordynuj temat.</t>','c32b1e5924ee015630ce27c1163dfc68',0,'','mx8c5xu',1,0,'',0,0,0,1,0,'',0),(62,22,18,58,0,'94.232.216.242',1649757959,0,1,1,1,1,'','Re: Karty katalogowe','<r>Prosze rzucie okiem na:<br/>\n<br/>\nC:\\SynologyDrive\\MT\\MT_MARKETING\\MILITARY_KARTY KATALOGOWE\\<B><s>[b]</s>Karty.pdf<e>[/b]</e></B><br/>\n<br/>\nJest tam wzr propozycji kart katalogowych do naszego segregatora (nad okadk popracuje Karwowski).<br/>\nStaraem si zachowa spjno z  naszymkatalogiem MIL (kolorystyka, czcionki, to, styl etc.) i i z cennikiem.<br/>\n<br/>\nWzr na przykadzie scooterw. W myl schematu:<br/>\n<br/>\nPierwsza strona to taka przekadka kategorii, aby zachowa organizacj, <br/>\n<br/>\nWstpnie przykadowe kategorie podziau:<br/>\n<br/>\n- Diving Propultion Vehicle<br/>\n- Accessory and spart parts - DPV<br/>\n- Light system (osobno to uj, czy podpianamy pod akcesoria?)<br/>\n- Power converter (osobno to uj, czy podpianamy pod akcesoria?)<br/>\n- ENC<br/>\n- Accessory and spart parts - ENC<br/>\n- Standards and certificates<br/>\n<br/>\nStrony 2-5 to ju waciwe karty katalogowe, kolejno Scooter TAC1000 i TAC2000<br/>\n<br/>\n<B><s>[b]</s>Na przykadzie TAC1000:<e>[/b]</e></B><br/>\n<br/>\nU gry nazwa nadrzdna kategorii (Diving Propultion Vehicle), poniej nr katalogowy i nazwa scootera.<br/>\nPo prawej logo.<br/>\nNiej zdjcie produktu (tam s na razie wersje robocze tych renderw na szybko usunite logo, zostao tam jeszcze logo na ENC, ale to si ju si podmieni na waciwe).<br/>\n<br/>\nKolejno tabelki z informacjami technicznymi:<br/>\n<br/>\n- Specyfikacja (motor, battery, dimensions)<br/>\n- Co zawiera zestaw (set includes) z nr katalogowymi poszczeglnych elementw.<br/>\n- Powizane elementy (linked with) z czym moemy czyc scooter, jak coupling platform set, wersje z nawigacj, zestaw czesci zamiennych, wszystko z przypisanymi nr katalogowymi. (akcesoria dla dpv  bd ujte w kartach osobno, w kategorii (Accessory and spart parts - DPV)  jest ich sporo.<br/>\n- Co jeszcze powinnimy uja w danej karcie produktu? Myslalem o normach i certyfikatach, ale to jako osobne karty.<br/>\n<br/>\nI wg tego schematu TAC2000, ENC, dla aksesorii wlasna kategoria i tam karty, z bateriami, ladowarkami i innymi elementami. <br/>\n<br/>\nTak bym to wstpnie widzia. <br/>\n<br/>\nOprocz tej wersji, mozna tez utworzy wersje \"ekonomiczn/robocz\" bez ta na biaym tle, gdzie kady moze wydrukowa na zwyklej drukarce.<br/>\n<br/>\nNapiszcie prosz co sdzicie, no i czekam na pomysy, opinie sugestie <E>:)</E></r>','7bd6d98008c787a2b3239aa75228c71f',0,'','lw6t',1,0,'',0,0,0,1,0,'',0),(63,12,31,58,0,'94.232.216.242',1649758241,0,1,1,1,1,'','Re: Godne uwagi tematy','<r><URL url=\"https://seacraft.eu/products/accessories-and-spares/dedicated-tube-engraving/\"><s>[url]</s><LINK_TEXT text=\"https://seacraft.eu/products/accessorie ... engraving/\">https://seacraft.eu/products/accessories-and-spares/dedicated-tube-engraving/</LINK_TEXT><e>[/url]</e></URL><br/>\n<br/>\nInformowalimy kiedy o tej opcji personalizacji scootera na social mediach czy te newsletterze?<br/>\n<br/>\nBardzo fajny temat do publikacji.</r>','ed8f852e7d421c1c011436e87afde289',0,'','1vckvwr',1,0,'',0,0,0,1,0,'',0),(64,12,31,61,0,'94.232.216.242',1649760323,0,1,1,1,1,'','Re: Godne uwagi tematy','<t>Ja nie kojarz.<br/>\nNawet jeeli byo to mona powtrzy.<br/>\n<br/>\nNa pewno mamy duo surwki zdjciowej od Adama i mona by wykorzysta wycinki materiaw do pokazania procesw technologicznych.<br/>\nNiektre byy naprawd ciekawe, ale zostay wycite i na maxa przypieszone.</t>','002aef5ecec9436421cfa1bcc1cb2481',0,'','14jd8a',1,0,'',0,0,0,1,0,'',0),(65,22,18,58,0,'94.232.216.242',1649762744,0,1,1,1,1,'','Re: Karty katalogowe','<t>Ukad sekcji i ich zawarto zostaa dzi ustalona z p. Beat. <br/>\n<br/>\nPo wprowadzeniu zmian wg wytycznych, przedyskutujemy.</t>','ab80dd8815994ec881aa5a1c344aa4a5',0,'','3or44',1,0,'',0,0,0,1,0,'',0),(66,22,18,60,0,'91.196.8.186',1649765816,0,1,1,1,1,'','Re: Karty katalogowe','<t>Wg mnie czytelne i wizualnie zwizane z polityk wizerunkow marki - fajnie.</t>','a6af7e0a38f5091d95898ea15c8f40b8',0,'','6a3fh',1,0,'',0,0,0,1,0,'',0),(67,12,31,60,0,'91.196.8.186',1649765950,0,1,1,1,1,'','Re: Godne uwagi tematy','<t>Chyba wspominalimy o tym, ale bardzo dawno temu, powinnimy powtrzy. Rzeczywicie moe wykorzystujc co z materiaw od Adama. Ewentualnie moemy te zrobi co w formie kolau zdj naszych zaprzyjanionych nurkw, ktrzy maj grawer.</t>','15a1fbe9d7658055723d15b5129c7238',0,'','1db',1,0,'',0,0,0,1,0,'',0),(68,30,45,61,0,'94.232.216.242',1649766183,0,1,1,1,1,'','Re: Uchwyt na kamer','<r>Obecnie testuj:<br/>\nPaweczyk i Pako<br/>\n<E>;)</E><br/>\n<br/>\nNaley ich poprosi o zdjcia - co konkretnie potrzebujemy? <br/>\nW Kronie ani jednego nie ma.  Typuj dostpno na czerwiec/lipiec  - zanim si co z tego wykluje seryjnego.<br/>\n<br/>\nJak zwrc Polacy mona i naley wysa gdzie dalej...</r>','6479735163d821aa5dd13a42936af59e',0,'','16kyz4',1,0,'',0,0,0,1,0,'',0),(69,29,26,61,0,'185.153.39.80',1649785819,0,1,1,1,1,'','Re: Nurkowe Demo Days Jaworzno, Koparki 14-15.05.22','<r>Damianie, dodaj kolejne wydarzenia.<br/>\n<br/>\nmail od Marcina Bramsona:<br/>\n<br/>\n\"Imprezy w Polsce, w ktrych mam ju uczestnictwo potwierdzone:<br/>\n<br/>\n1. Nurkowe Demo Days Koparki Jaworzno: 14-15.05<br/>\n2. Piknik Bananowy, Hacza Banana Divers: 13-15.08<br/>\n<br/>\nW zaawansowanych planach mam:<br/>\n<br/>\n1. Seacraft Event na DeepSpot - ustalam dat ale bdzie to maj lub pocztek czerwca<br/>\n2. Seacraft Event na Honoratka - to chciabym powiza z otwarciem tam centrum testowego Seacraft. Narazie ustalam warunki wsppracy z nimi.<br/>\n3. Seacraft Event na Batyku - plan na drug poow roku, jesie<br/>\n<br/>\nI jeszcze Chorwacja, VIS 18.06-03.07. Tu robi dwutygodniowy event wrakowy poczony z testowaniem Seacraft i NAVI.<br/>\n<br/>\nCo do wsparcie to teoretycznie wszystko mam. Ale zawsze dodatkowe skutery i navi si przydadz. No i przede wszystkim czekam na GO <E>:)</E>\"</r>','ed3cc374633f255e13694ea7ec20db4f',0,'','du4i',1,0,'',0,0,0,1,0,'',0),(71,5,23,61,0,'185.153.39.80',1649790532,0,1,1,1,1,'','Re: [MIL] UDT Rotterdam, Holandia 7-9.06.2022','<t>Osoby uczestniczce z naszej strony:<br/>\nFrank i Witold - cae targi<br/>\nPiotr i Oskar - chc jecha na 2 dni z jednym noclegiem w celach zwiadowczych.<br/>\n<br/>\nTrzeba sprawdzi jakie s poczenia i zarezerwowa hotel. Witek - popro Ig by to ogarna w miar szybko.</t>','6afc33a02fa97d3641b3d222d133c001',0,'','u1tkqpt',1,0,'',0,0,0,1,0,'',0),(72,31,46,61,0,'185.153.39.80',1649833042,0,1,1,1,1,'','Re: Obcienie elektroniczne','<t>Nadano nazw angielsk produktu:<br/>\nElectronic load, for battery capacity testing<br/>\n<br/>\noraz wyceniono na 730 euro<br/>\n<br/>\nOskar przygotowuje instrukcj i zdjcie (tylko do e-sklepu).<br/>\nProdukt bdzie dodany do cennika serwisowego. Nie wymaga zdjcia profesjonalnego.<br/>\n<br/>\nCao bdzie gotowa do wysyki po witach.</t>','b8cab9fc98dad2564d38456b11e90db1',0,'','1ghh',1,0,'',0,0,0,1,0,'',0),(73,33,40,61,0,'185.153.39.80',1649833325,0,1,1,1,1,'','Cennik - 12.04.2022','<r>Wkrad si indyjski chochlik  <E>:D</E> <br/>\n<br/>\nW czciach zamiennych do duali pominam rub napdow ((wyszo jak zaczam robi polsk wersj)<br/>\nPoprawiam obydwie wersje (Witku, zamie zacznik do umowy) oraz dodaam do folderu marketing ---&gt; MIL_KARTY KATALOGOWE.<br/>\nDaty zatwierdzenia ju nie zmieniam.</r>','aa6e4230f454048a6d61639322ff66ed',0,'','32mfd6',1,0,'',0,0,0,1,0,'',0),(74,34,9,58,0,'94.232.216.242',1649834081,0,1,1,1,1,'','Aktualizacja newsw','<r>Temat powicony aktualizacji Newsw o ktrych powinnimy wspomnie na naszej stronie.<br/>\n<br/>\nTemat newsa do wrzucenia (gdy ju przetestujemy i sprawdzimy finalnie stron): <br/>\n<br/>\n<B><s>[b]</s>Dziaano B+R<e>[/b]</e></B><br/>\n<br/>\nChcemy, aby co konkretnego byo zawarte w tym newsie, czy krtka informacja o powstaniu takiego dziau w naszym przedsibiorstwie?</r>','52056f3de57d19d0768fe2c26d79f5cb',0,'','10ssqdx',1,0,'',0,0,0,1,0,'',0),(75,22,18,61,0,'185.153.39.80',1649834203,0,1,1,1,1,'','Re: Karty katalogowe','<t>Przygotuj w excelu zestawienia do kart militarnych w oparciu o cennik - by uatwi nieco prac Damianowi.<br/>\n<br/>\nPo przygotowaniu wzoru pjdzie nam wtedy szybciej.</t>','31acdb1e88a24796c7a0e053a3bac29f',0,'','19fjc2b',1,0,'',0,0,0,1,0,'',0),(76,32,21,61,0,'185.153.39.80',1649835097,0,1,1,1,1,'','Re: Zdjcia produktowe- paczka, materiay marketingowe','<t>Najpierw trzeba ustali potrzeby i zrobi struktur.<br/>\n<br/>\nPotrzeba:<br/>\nzdjcia kadego produktu do uytku dla nas oraz dla dystrybutorw na www<br/>\nZdjcia musz by atwo identyfikowalne z cennikiem. W jednym katalogu, spjne z tym co mamy u siebie.<br/>\n<br/>\nproponuje 2 katalogi:<br/>\nRec<br/>\nMilitary<br/>\n<br/>\nMoe w kadym katalogu cennik i hipercze do zdjcia?<br/>\n<br/>\nNumerowanie zdj - liczba porzdkowa_nr katalogowy<br/>\nLiczba porzdkowa: naley nada numery w cenniku (i tu pojawi si problem, bo jak dodamy jak pozycj w rodku cennika liczby porzdkowe bd pomieszane. <br/>\nJakie inne propozycje?<br/>\n<br/>\nJest rwnie potrzeba kolejnego katalogu ze zdjciami i rewizji cennika serwisowego<br/>\nCzy jeszcze jaki katalog?</t>','deff93f0eae996db010afaba7e09dca2',0,'','10jytul',1,0,'',0,0,0,1,0,'',0),(77,34,9,61,0,'185.153.39.80',1649835752,0,1,1,1,1,'','Re: Aktualizacja newsw','<r>Waciwie MT od zawsze prowadzio badania  i rozwj i moe niekoniecznie wyglda dobrze informacja, ze taki dzia dopiero utworzylimy dopiero  <E>:)</E> .<br/>\nMoe lepiej jaka wzmianka o poszerzeniu zepou badawczo rozwojowego? Doszo 2 specjalistw od elektroniki oraz kolega z UA. Moe info, e nad czym pracujemy obecnie?<br/>\nWitek, moe co Ci do gowy przyjdzie ...</r>','6200146601609a1104155e6fe79bf157',0,'','2ktul7bj',1,0,'',0,0,0,1,0,'',0),(78,35,42,58,0,'94.232.216.242',1649838746,0,1,1,1,1,'','Brandbook MIL ENG','<t>Zakadam wtek, eby sprawa nam nie ucieka.<br/>\n<br/>\nPosiadamy obecnie brandbook MIL w wersji PL, potrzebujemy te ENG (z opisami kolorw), ktra nie bya zlecana u Jarka Karwowskiego.<br/>\n<br/>\nPoprosz go o pliki rdowe brandbooka MIL, jeeli sami tego nie bdziemy w stanie ogarn lub nam tego nie przel, bdziemy musieli to zleci u niego.</t>','3189060273b210675f06a950b0671af4',0,'','f4u0q4d',1,0,'',0,0,0,1,0,'',0),(79,22,18,61,0,'185.153.39.80',1649841012,0,1,1,1,1,'','Re: Karty katalogowe','<r>Umieciam w folderze kart katalogowych zestawienie do TAC1000 - uzgodnione z Witkiem.<br/>\n<br/>\nPrzy tworzeniu zwrcilimy uwag na pomieszane kategorie w cenniku.<br/>\n<br/>\nZatem najpierw uporzdkujemy karty a potem cennik zgodnie z nimi. <br/>\n<br/>\nW karcie trzeba doda rwnie krtki opis produktu - czyli co to w ogle jest <E>:)</E><br/>\n<br/>\nBy moe trzeba nieco zmniejszy render a obok umieci pole tekstowe na opis.</r>','c2a987e58597b66cec4d494129966529',0,'','f0',1,0,'',0,0,0,1,0,'',0),(80,22,18,58,0,'94.232.216.242',1649841165,0,1,1,1,1,'','Re: Karty katalogowe','<t>Dzikuj, mega przydatne i pomocne. Postaram si jeszcze dzis kart TAC1000 przygotowa w oparciu o ustalone zmiany.</t>','47abf34161c6332ce07b1ad2c4077ed0',0,'','1vlsybk',1,0,'',0,0,0,1,0,'',0),(81,36,28,63,0,'85.221.240.2',1649850248,0,1,1,1,1,'','Premiera - Korea','<t>Informacje od Mares Korea o proponowanym timelinie/ tematy jakich oni potrzebuj:<br/>\n<br/>\n<br/>\nThanks for the information.<br/>\n<br/>\nYes, we\'d like to take the batteries for GO with the actual sample.<br/>\n<br/>\nAlso, it\'s great to hear you\'ll have a premiere for \"GO\". <br/>\nCould you provide us more specific plans of your event? (The place, how it\'d be done, and more details) <br/>\n<br/>\nFYI, the plan for Seacraft is as below.<br/>\n<br/>\nOverall plan <br/>\n<br/>\nEnd of APR - KC Radio certification for Future 1000 &amp; Ghost 2000 <br/>\n<br/>\nMAY - Work on creating DPV Manuals (Student &amp; Instructor), plan to complete it in June<br/>\n  * More Images for the manual may be required. (We\'ll check the images from your MEGA link at first) <br/>\n<br/>\nJUN/AUG - DPV specialty Insructor course by Mr. Witold Hoffmann in Korea or Italy (Total 2-3 participants)<br/>\n<br/>\nPlan for \"GO\" <br/>\n<br/>\nA month before official launch - KC cert for Batteries and Radio cert for GO<br/>\n                                                       - Preparation of Flyer/Leaflet/ Mini brochure dedicated for \"GO\" (Since they\'re not on our catalog)<br/>\n                                                       - 40-50pcs of souvenir (T-shirts? or other small items) <br/>\nAfter we get 50 units in Korea - Product presentation &amp; Level 1 training for 2 days (40-50 participants expected), Appointment of Gold(?) Reseller<br/>\n                                                      - DPV course in Pool for few military agents (Mr. Sung and those who are related to military delivery) <br/>\n<br/>\nHope this helps, and some of our events may require your visit to Korea. <br/>\nI\'d appreciate it if you could share your idea on this plan.<br/>\n<br/>\nThanks and best regards,<br/>\nHONG, Joe<br/>\nMares SSI Korea</t>','679e5c7b05f2c171135bd4c2d86786ff',0,'','hrxji',1,0,'',0,0,0,1,0,'',0),(82,34,9,63,0,'85.221.240.2',1649850556,0,1,1,1,1,'','Re: Aktualizacja newsw','<r>Temat 1 - dogranie ukadu newsw (grafiki w tle), opcja linkowania bezporedniego do podstron (na przykadzie platformy sprzgajcej - nie ma sensu pisa newsa o platformie powielajc tre z zakadki produktowej, lepiej podlinkowa newsa od razu do odpowiedniej podstrony). Temat by w toku u Tinssena, ale zosta przerwany.<br/>\n<br/>\nTemat 2 - dzia R&amp;D pasuje doda pod jedn z tych 2 kategorii gwnych, oraz opisa. Do newsw mona jedynie doda informacj o dojciu nowych osb do dziau badawczo rozwojowego. \n<ATTACHMENT filename=\"Screenshot 2022-04-13 134657.png\" index=\"0\"><s>[attachment=0]</s>Screenshot 2022-04-13 134657.png<e>[/attachment]</e></ATTACHMENT>\n\nMamy troszk opisane pod: <URL url=\"https://seacraft.eu/seacraft/company/about-seacraft/\">https://seacraft.eu/seacraft/company/about-seacraft/</URL><br/>\nMona to poszerzy.</r>','26d45b79ff58612dfff0411da33218f2',1,'','4won0c6',1,0,'',0,0,0,1,0,'',0),(83,33,40,63,0,'85.221.240.2',1649850999,0,1,1,1,1,'','Re: Cennik - 12.04.2022','<r>Hej<br/>\nWanie odkryem e byo kolejne wamanie i zmienili ilo na tylko jedn rub- dawniej byy dwie: <ATTACHMENT filename=\"Screenshot 2022-04-13 135622.png\" index=\"0\"><s>[attachment=0]</s>Screenshot 2022-04-13 135622.png<e>[/attachment]</e></ATTACHMENT></r>','3500ad159a96c47185c9ecaaf1f20b5d',1,'','13u8hnm',1,0,'',0,0,0,1,0,'',0),(84,33,40,61,0,'185.153.39.80',1649851431,0,1,1,1,1,'','Re: Cennik - 12.04.2022','<t>Poprawione w obydwu wersjach - usunam rwnie od razu rotor.</t>','b28863f8778e6232267b821101998cdf',0,'','etc2m',1,0,'',0,0,0,1,0,'',0),(85,34,9,58,0,'94.232.216.242',1649851726,0,1,1,1,1,'','Re: Aktualizacja newsw','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"82\" time=\"1649850556\" user_id=\"63\"><s>[quote=\"Witold Hoffmann\" post_id=82 time=1649850556 user_id=63]</s>\nTemat 1 - dogranie ukadu newsw (grafiki w tle), opcja linkowania bezporedniego do podstron (na przykadzie platformy sprzgajcej - nie ma sensu pisa newsa o platformie powielajc tre z zakadki produktowej, lepiej podlinkowa newsa od razu do odpowiedniej podstrony). Temat by w toku u Tinssena, ale zosta przerwany.\n<e>[/quote]</e></QUOTE>\n\nTak, modu z newsami jest do zmiany, obecny nie jest ani atrakcyjny, ani funkcjonalny. <br/>\n<br/>\nJak ju Marcin ogarnie stron..., bdziemy szuka tam innego moduu.</r>','e7fb50628b142b748796f741a67e5fe5',0,'','x58b13',1,0,'',0,0,0,1,0,'',0),(86,22,18,58,0,'94.232.216.242',1649852050,0,1,1,1,1,'','Re: Karty katalogowe','<t>W wolnej chwili rzucie okiem na wzr kart TAC1000:<br/>\n<br/>\nC:\\SynologyDrive\\MT\\MT_MARKETING\\MILITARY_KARTY KATALOGOWE\\Karta TAC1000.pdf</t>','402bb99382be0a0d84cfb7f78a74915e',0,'','1efl',1,0,'',0,0,0,1,0,'',0),(87,22,18,61,0,'185.153.39.80',1649855015,0,1,1,1,1,'','Re: Karty katalogowe','<r>Jak dla mnie graficznie jest super!<br/>\nBrawo  <E>:D</E> <br/>\n<br/>\nMyl, e ze specyfikacji trzeba usun cz nieistotnych parametrw a s takowe - dziki czemu bdzie wicej przestrzeni.<br/>\nCao tekstu wypado zbyt blisko dolnego marginesu. Idealnie gdyby tre koczya  si tutaj gdzie obecnie koczy si tabelka. <br/>\nNa dole pod kresk kod produktu jest mao czytelny - moe jaki odstp? Moe nieco wiksza czcionka?<br/>\n<br/>\nWitek si na pewno wypowie o co mona tekst \"odchudzi\".</r>','b5ea23c3ca63bfbb1ef5259db1778c4c',0,'','3zevfv',1,0,'',0,0,0,1,0,'',0),(88,5,23,63,0,'85.221.240.2',1649856741,0,1,1,1,1,'','Re: [MIL] UDT Rotterdam, Holandia 7-9.06.2022','<r>Lista sprztu z Krosna jest w miar okrelona wczeniej. (DPC, DUAL-TAC2000, TAC1000). Wicej nie upchamy.<br/>\nProjekt stoiska jest przygotowany, jedyne co to temat wydruku. Odwie Jarkowi.<br/>\n<br/>\nshow:<br/>\n<br/>\nRotterdam Ahoy<br/>\n<br/>\nAhoyweg 10<br/>\n<br/>\n3084 BA Rotterdam<br/>\n<br/>\n<br/>\nloty przykadowe:<br/>\n<br/>\n<URL url=\"https://www.skyscanner.pl/transport/flights/rze/eind/220607/220609/?adultsv2=1&amp;cabinclass=economy&amp;childrenv2=&amp;inboundaltsenabled=false&amp;outboundaltsenabled=false&amp;preferdirects=false&amp;rtn=1\"><LINK_TEXT text=\"https://www.skyscanner.pl/transport/fli ... alse&amp;rtn=1\">https://www.skyscanner.pl/transport/flights/rze/eind/220607/220609/?adultsv2=1&amp;cabinclass=economy&amp;childrenv2=&amp;inboundaltsenabled=false&amp;outboundaltsenabled=false&amp;preferdirects=false&amp;rtn=1</LINK_TEXT></URL><br/>\n<br/>\n<URL url=\"https://www.skyscanner.pl/transport/loty/rze/amst/220607/220609/?adultsv2=1&amp;cabinclass=economy&amp;childrenv2=&amp;inboundaltsenabled=false&amp;outboundaltsenabled=false&amp;preferdirects=false&amp;priceSourceId=&amp;priceTrace=&amp;qp_prevCurrency=PLN&amp;qp_prevPrice=ReturnNoPrices&amp;qp_prevProvider=ins_month&amp;rtn=1\"><LINK_TEXT text=\"https://www.skyscanner.pl/transport/lot ... onth&amp;rtn=1\">https://www.skyscanner.pl/transport/loty/rze/amst/220607/220609/?adultsv2=1&amp;cabinclass=economy&amp;childrenv2=&amp;inboundaltsenabled=false&amp;outboundaltsenabled=false&amp;preferdirects=false&amp;priceSourceId=&amp;priceTrace=&amp;qp_prevCurrency=PLN&amp;qp_prevPrice=ReturnNoPrices&amp;qp_prevProvider=ins_month&amp;rtn=1</LINK_TEXT></URL><br/>\n<br/>\n<br/>\nBezp. do rotterdamu cikawo. Prawdopodobnie i tak trzeba samochd na miejscu jaki wynaj, albo tak zgra czasowo e przylot jest przed/ po targach (podjad np.)</r>','08be26f0787dbe231e5d2f77b28742aa',0,'','atuflry0',1,0,'',0,0,0,1,0,'',0),(89,12,31,63,0,'85.221.240.2',1649859711,0,1,1,1,1,'','Re: Godne uwagi tematy','<r>Dobre fotki - eby skubany by przyjemniejszy we wsppracy... <E>;)</E><br/>\n<URL url=\"https://www.facebook.com/photo/?fbid=5603066939738070&amp;set=pcb.7733543126657657\"><LINK_TEXT text=\"https://www.facebook.com/photo/?fbid=56 ... 3126657657\">https://www.facebook.com/photo/?fbid=5603066939738070&amp;set=pcb.7733543126657657</LINK_TEXT></URL></r>','bc1008929d82bfaf74a0af20fb49e30a',0,'','4vlte',1,0,'',0,0,0,1,0,'',0),(90,6,20,61,0,'185.153.39.80',1649859770,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Rozmawiaam dzi z Adamem. Ustaliam budet filmu. Jest zdecydowanie wikszy ni na film z produkcji, wic moemy wymaga wicej <E>:)</E><br/>\n<br/>\nPrzy okazji ma przygotowa z surwki jakie krtkie filmiki na social media. Musimy si zastanowi jakie potrzebujemy.<br/>\nIntensywnie tematem zajmie si po witach. Wtedy ustalimy jakie sceny bd do nakrcenia przez naszych zagranicznych przyjaci.<br/>\nAdam prbuje ogarn jakie lotnisko. Bdzie potrzebowa skuter, bo trudno krci cokolwiek bez niego... On nawet nie wie jak ten skuter wyglda.<br/>\n<br/>\nBy moe wystarczy wysa skuter w 2 miejsca a 3 do Adama.</r>','e9c102f18b495e92f52f17f776ca442b',0,'','796mg',1,0,'',0,0,0,1,0,'',0),(91,6,20,63,0,'85.221.240.2',1649861227,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<t>cigaem lotnisko w Poznaniu. Nie udaje si dodzwoni, kontakt mailowy - bez efektw. Chyba najoptymalniej by Adam cign u siebie lokalnie, skoro bdzie krci.</t>','e914184d991fb963b294964906c47a0e',0,'','p49gfd',1,0,'',0,0,0,1,0,'',0),(92,12,31,58,0,'192.162.175.145',1649861322,0,1,1,1,1,'','Re: Godne uwagi tematy','<r>Witku, co link nie dziaa ;/ <br/>\n<br/>\nCzyby to fotki Kowalczuka z ostatnich dni,ktre publikuje? Czaimy si z Paulin na nie , jak tylko kwestia umowy z nim si wyjani i wyrazi zgod, fajny repost i fotki na insta.<br/>\n\n<ATTACHMENT filename=\"jk.jpg\" index=\"0\"><s>[attachment=0]</s>jk.jpg<e>[/attachment]</e></ATTACHMENT></r>','4309815f938ea66b63bc4cc744659c59',1,'','ff7y',1,0,'',0,0,0,1,0,'',0),(93,12,31,63,0,'85.221.240.2',1649862984,0,1,1,1,1,'','Re: Godne uwagi tematy','<r>Sprbuj doczy do grupy TECHNICAL DIVING TRAINING - jest ustawienie prywatnoci tylko dla odbiorcw. Nieco inna fotka, ale podobna partia materiau <E>;)</E><br/>\n<URL url=\"https://www.facebook.com/groups/1206941425984559\">https://www.facebook.com/groups/1206941425984559</URL><br/>\n<URL url=\"https://www.facebook.com/photo/?fbid=5603066939738070\">https://www.facebook.com/photo/?fbid=5603066939738070</URL></r>','5786e6b749ce1490a6d401c80b53786c',0,'','x6r',1,0,'',0,0,0,1,0,'',0),(94,25,10,61,0,'185.153.39.80',1649916421,0,1,1,1,1,'','Re: Bdy, nie dziaajce linki','<t>Rezygnujemy z usug Marcina.<br/>\nZa chwil Piotr zadzwoni do Witka w celu ustalenia szczegw jak to zrobi, bo strasznie namieszali, cznie z przejciem konta Tinssena.</t>','29356c0a4443c843f61a840e7fba21c8',0,'','5d48so2i',1,0,'',0,0,0,1,0,'',0),(95,22,18,58,0,'94.232.216.242',1649919617,0,1,1,1,1,'','Re: Karty katalogowe','<r>Wersja po poprawkach i korektach: C:\\SynologyDrive\\MT\\MT_MARKETING\\MILITARY_KARTY KATALOGOWE\\<B><s>[b]</s>Karta TAC1000_v2<e>[/b]</e></B>.pdf<br/>\n<br/>\nUdao si odchudzi i przesuna nieco tabelke specyfikacji od dolnego marginesu.<br/>\n<br/>\nZe specyfikacji z dwch pozycji Weight without i weight with transport box scaliem do jednej <B><s>[b]</s>Weight without/with transport box<e>[/b]</e></B>, dzieki czemu zyskalimy troch przestrzeni, dodatkowo przesunaem niecy wyej tabelk specyfikacji zgodnie z sugesti, wyglda lepiej wg mnie <E>:)</E><br/>\n<br/>\nW prawym dolnym rogu zwikszym wielkosc czcionki z nr katalogwym.</r>','342e865ed498cc33bebc5b1c39cfde03',0,'','82sbadr',1,0,'',0,0,0,1,0,'',0),(96,37,19,58,0,'94.232.216.242',1649921941,0,1,1,1,1,'','Ulotka/flyer ENC3','<t>Temat powicony ulotce ENC3.<br/>\n<br/>\nNie posiadamy, ulotki/flyer ENC3, Jarek Karwowski nam robi update tej z ENC2, czy sami ogarniamy? Jeeli s pliki rdowe temat do zrobienia.</t>','0002559b1ef636c34965ddd55883acb5',0,'','ms2ibbj',1,0,'',0,0,0,1,0,'',0),(97,37,19,61,0,'185.153.39.80',1649924770,0,1,1,1,1,'','Re: Ulotka/flyer ENC3','<t>Nie mamy plikw rdowych, to byo robione z 4 lata temu...<br/>\nMona go zapyta o to, mona mu to zleci, ale boj si, e czasowo nie wyrobi.</t>','1f874ffdc5abd794dc6e94d540540324',0,'','b83y9ydk',1,0,'',0,0,0,1,0,'',0),(98,22,18,61,0,'185.153.39.80',1649926502,0,1,1,1,1,'','Re: Karty katalogowe','<t>Wyglda idealnie. <br/>\nWydrukujemy w kolorze i sprawdzimy czytelno. Nie wiem czy nr katalogowy na dole jest wystarczajco czytelny. Czcionka jest do gruba i moe si zlewa.<br/>\nWymiary skrzy podamy w milimetrach, dobrze jest zachowa spjno jednostek miar.<br/>\n<br/>\nZawarto merytoryczna -  dobrze eby Witek sprawdzi czy s czytelne i jasne. <br/>\n<br/>\n<br/>\nCo do pozostaych kart - jestem w trakcie tworzenia. Wbrew pozorom nie schodzi z tym tak szybko jak bym chciaa...<br/>\nWitek docelowo musi sprawdzi poprawno danych na pliku, ktry robi. Pewne rzeczy musimy uzgodni dzi wsplnie.<br/>\nPlik umieszczam w folderze  z kartami. Na razie wgrywam tyle co mam pogldowo.</t>','2a61a63ead324671cb0cb96a51ee824f',0,'','1uxjnew',1,0,'',0,0,0,1,0,'',0),(99,38,23,63,0,'85.221.240.2',1649937371,0,1,1,1,1,'','Japonia','<r>Poniej lista i opis terminw preferowanych przez naszego lokalnego partnera- Nippon Kaiyo:<br/>\n<br/>\n----<br/>\n<br/>\n Equipment exhibition organized by the Army (2 days between September 5 and 9)<br/>\n <br/>\nIt is held annually at an army base (deep in the mountains) at the foot of Mt.Fuji. Many army suppliers display their latest equipment. We expect the most from the Army as a sales destination for your DPVs. However, since the event is held inside an army base, foreigners need to apply in advance and get permission to enter due to security issues (although NATO members should have no problem).<br/>\n <br/>\nSEECAT (Security Exhibition) (October 5-7 in Tokyo)<br/>\n<URL url=\"https://www.seecat.biz/2021/english/guideline/\">https://www.seecat.biz/2021/english/guideline/</URL><br/>\n <br/>\nThis is an exhibition for security and defense equipment in Japan. Every year, several domestic distributors of foreign manufacturers exhibit their underwater equipment (for DPVs, Rotinor (this is our company), Patriot3 Jetboots, SUEX, etc. have been exhibited so far).<br/>\n <br/>\nDSEI JAPAN (Defense Exhibition) (March 15-17, 2023 in Chiba, a prefecture next to Tokyo)<br/>\n<URL url=\"https://www.dsei-japan.com/\">https://www.dsei-japan.com/</URL><br/>\n <br/>\nThis is the Japanese version of DSEI as you know it. As an international exhibition for Asia, many foreign manufacturers directly exhibit at this event. Usually held once every two years, it has been postponed to next year due to Corona.</r>','bf46736994242c399f308f81acb13877',0,'','1275ckz',1,0,'',0,0,0,1,0,'',0),(100,39,23,63,0,'85.221.240.2',1649938312,0,1,1,1,1,'','Nowa Zelandia','<r>Najwaniejsza impreza nurkowa rejonu: <URL url=\"https://diveoztek.com.au/\">https://diveoztek.com.au/</URL><br/>\n<br/>\nNasz partner REC w AU :<URL url=\"https://www.snorkeldivemelbourne.com.au/\">https://www.snorkeldivemelbourne.com.au/</URL><br/>\nZnaj rejon, NZ rwnie. Majc preferowane daty z dobrym, duym wyprzedzeniem moemy koordynowa nurkowania i spotkania.<br/>\n<br/>\nKluczowe byoby okrelenie osb plus przynajmniej miesica wyjazdu i na tej bazie dogranie caoci.</r>','344de19424d51d7219efe83f2edb79cf',0,'','8yfx',1,0,'',0,0,0,1,0,'',0),(101,25,10,63,0,'85.221.240.2',1649940342,0,1,1,1,1,'','Re: Bdy, nie dziaajce linki','<t>Uzgodnilimy e cao odbdzie si w sposb skoordynowany i porzdny po witach - wcznie z przenosinami na szybszy serwer.</t>','429d6ec7b2b3891d1b2c2f55a1e7810f',0,'','1x8csz',1,0,'',0,0,0,1,0,'',0),(102,22,18,61,0,'185.153.39.80',1649966018,0,1,1,1,1,'','Re: Karty katalogowe','<t>Wgrana nowa wersja kart (bez nawigacji na razie).<br/>\nWitek zerknij jeszcze na to. Jak ok to mona dziaa dalej.</t>','eb51ffc0b84fe89bfa4bdf0b97657d45',0,'','wx6r66',1,0,'',0,0,0,1,0,'',0),(103,40,31,58,0,'94.232.216.242',1650001440,0,1,1,1,1,'','Najlepszy czas na publiakcj w SM','<r>Przypinam temat, ciekawe zestawienia, moe si przyda <E>;)</E> <br/>\n<br/>\nNa bazie bada i danych statystycznych z poprzedniego roku stworzono zestawienie globalnego zaangaowania uytkonikw na kanaach social media i okrelono kiedy teoretycznie najlepiej publikowa treci, aby miay najwikszy zasig:<br/>\n<br/>\n<B><s>[b]</s>Facebook<e>[/b]</e></B>\n<QUOTE><s>[quote]</s>Jako najlepszy czas na publikacj na Facebooku podaje si godziny od 10 do 11, a take wieczory, po godzinie 19. Jeli chodzi o dni tygodnia  wpisy, na ktrych popularnoci szczeglnie nam zaley warto wstawia w poniedziaki, rody oraz pitki. Pamitajmy, e rwnie w przypadku Facebooka dziaa algorytm odpowiedzialny za ranking wywietlania postw na tablicy uytkownika. Zadbajmy wic o organiczny zasig postw poprzez wstawianie atrakcyjnego contentu rwnie w dni mniejszej aktywnoci internautw, a take prowadzenie relacji na ywo. Dziki temu zwikszymy prawdopodobiestwo, e posty dotr do uytkownikw w czasie ich najwikszej aktywnoci w sieci.<e>[/quote]</e></QUOTE>\n\n\n<ATTACHMENT filename=\"kiedy-publikowac-na-facebooku.jpg\" index=\"1\"><s>[attachment=1]</s>kiedy-publikowac-na-facebooku.jpg<e>[/attachment]</e></ATTACHMENT>\n\nGlobalne zaangaowanie na Facebook, rdo: <URL url=\"https://sproutsocial.com/insights/best-times-to-post-on-social-media/\"><LINK_TEXT text=\"https://sproutsocial.com/insights/best- ... ial-media/\">https://sproutsocial.com/insights/best-times-to-post-on-social-media/</LINK_TEXT></URL><br/>\n<br/>\n<B><s>[b]</s>Instagram<e>[/b]</e></B>\n<QUOTE><s>[quote]</s>Jednym z najpopularniejszych kanaw spoecznociowych jest Instagram, sucy przede wszystkim do wstawiania zdj oraz krtkich relacji. Przez dugi czas na tablicy uytkownikw pojawiay si posty w kolejnoci chronologicznej, dziki czemu wkrtce po publikacji materia trafia na sam gr listy. Jak to wyglda obecnie i kiedy publikowa na IG, eby uzyska duo reakcji? W pewnym momencie Instagram odszed od takiego sposobu wywietlania treci, wprowadzajc algorytm. Trzymanie si okrelonych, idealnych ram czasowych wci jednak ma znaczenie. Najnowsza aktualizacja algorytmu uwzgldnia czas publikacji i wspiera posty wstawione w niedalekiej przeszoci.<br/>\n<br/>\nKiedy publikowa zdjcia na Instagramie?<br/>\nPoudnie  pomidzy 11.00 a 13.00<br/>\nWieczorem  pomidzy 19.00 a 21.00<br/>\nNajlepsze dni na publikacj treci to rody i czwartki<br/>\nNajmniejsze szanse na dotarcie do odbiorcw maj z kolei posty publikowane w weekendy, a take te wstawiane tu po standardowym czasie pracy wikszoci Polakw. Po godzinie 17 zajmuj si oni raczej obowizkami domowymi i dopiero po ich wypenieniu maj chwil, by zajrze w telefon czy usi przy komputerze.<e>[/quote]</e></QUOTE>\n\n<ATTACHMENT filename=\"kiedy-publikowac-na-instagramie.jpg\" index=\"0\"><s>[attachment=0]</s>kiedy-publikowac-na-instagramie.jpg<e>[/attachment]</e></ATTACHMENT>\n\nGlobalne zaangaowanie na Instagramie, rdo: <URL url=\"https://sproutsocial.com/insights/best-times-to-post-on-social-media/\"><LINK_TEXT text=\"https://sproutsocial.com/insights/best- ... ial-media/\">https://sproutsocial.com/insights/best-times-to-post-on-social-media/</LINK_TEXT></URL><br/>\n<br/>\nTak wyglda w teorii, w praktyce bywa rnie, szczeglnie, e klientw mamy na caym wiecie, wiec z tym czasem jest rnie, ale warto zwrci uwag na te wykresy przy publikacji.</r>','32e06cffe3932261a83df76e9625780e',1,'','3reuyj3v',1,0,'',0,0,0,1,0,'',0),(104,41,50,58,0,'94.232.216.242',1650002649,0,1,1,1,1,'','Podrbki, kopie, plagiaty naszego sprztu itp','<r>Temat powstay na bazie biecych potrzeb i wydarze, pojawiaj si kopie naszego sprztu, w tym temacie moemy zgasza tego typu akcje konkurencji.<br/>\n\n<ATTACHMENT filename=\"skuter uchwyt transportowy.jpg\" index=\"0\"><s>[attachment=0]</s>skuter uchwyt transportowy.jpg<e>[/attachment]</e></ATTACHMENT>\n\n<QUOTE><s>[quote]</s>Zrzynka pikna. Pucie na fb e ju nas wszyscy kopiuj, co znaczy, e wprowadzamy standardy<br/>\nNie bdziemy si goni z kokami, ale mamy chyba uchwyt zaoony na skuterze, ktry jest chroniony jako wzr (uytkowy albo przemysowy, nie pamitam)<br/>\nTrzeba to chyba jako przeku na jak korzy dla nas i takie rzeczy sygnalizowa. <br/>\n<br/>\nPutin by sobie z tym doskonale poradzi, a co zrobi nasz dzia marketingu? \n<e>[/quote]</e></QUOTE>\n\n<br/>\nPost na oficjalnym kanale fb to chyba za mocne, eby si z kim kopa (?) i sabo wizerunkowo. Nie s oni dla nas adn konkurencj <E>:)</E> <br/>\n<br/>\nPomysy? <E>:)</E><br/>\n<br/>\nMona bardziej roznie to w grupach nurkowych, gdzie przemyci w komentarzach, ale nie przez nasz oficjalny profil, bez wikszej zaplanowanej akcji..<br/>\n<br/>\nedit:<br/>\n<br/>\nPomys Witka wydaj si by idealnym:<br/>\n\n<QUOTE><s>[quote]</s>Najlepsz opcj \'zauwaenia\' jest podniesienie tematu przez niezaley/niepowizany z mark portal. Jolly divers, Divers24 - idealna opcja na krtkiego posta o kopiowaniu rozwiza z Polski.<e>[/quote]</e></QUOTE></r>','8c22c71b12184117275bda6239062767',1,'','34pmp',1,0,'',0,0,0,1,0,'',0),(105,40,31,60,0,'91.196.8.186',1650011819,0,1,1,1,1,'','Re: Najlepszy czas na publiakcj w SM','<t>Na pocztku mocno si sugerowaam tymi godzinami, bo znalazam podobne opracowanie, ale.. jak publikuj w godzinach 11-13 i 19-21 to odzew potrafi by mega marny, a czasem dodam co zupenie rano lub w godzinach popoudniowych i mamy rekordy polubie i wywietle.. Ciko z tym trafi, bo u nas odbiorcy to tylko w maym uamku Polska.</t>','4feb977109348705bf892eb7423cdf46',0,'','jr3mf9y',1,0,'',0,0,0,1,0,'',0),(106,39,23,60,0,'91.196.8.186',1650011926,0,1,1,1,1,'','Re: Nowa Zelandia','<t>Harmonogram projektowy zakada realizacj dwch wydarze w Nowej Zelandii w terminach: <br/>\n01/07/2022-30/04/2023<br/>\n01/01/2023 31/10/2023</t>','b12c05a142e5a11496f1acf6818376b4',0,'','9ktoy',1,0,'',0,0,0,1,0,'',0),(107,38,23,60,0,'91.196.8.186',1650011948,0,1,1,1,1,'','Re: Japonia','<t>Harmonogram projektowy zakada realizacj dwch wydarze w Japonii w terminach:<br/>\n01/07/2022-30/04/2023<br/>\n01/01/2023 31/10/2023</t>','4e77e547f2f5dada64248a87844990e7',0,'','b6wl',1,0,'',0,0,0,1,0,'',0),(108,42,21,58,0,'94.232.216.242',1650013542,0,1,1,1,1,'','Banner Tarnobrzeg','<r>Temat bannera na Tarnobrzeg o ktry prosi Jarek,<br/>\n<br/>\nObecny/poprzedni banner w Tarnobrzegu:<br/>\n\n<ATTACHMENT filename=\"stary banner.jpg\" index=\"0\"><s>[attachment=0]</s>stary banner.jpg<e>[/attachment]</e></ATTACHMENT>\n\nJarek do precyzyjnie okreli jakie powinny by rendery skuterw, ktre przygotowa Pawe Wooszyn:<br/>\n\n<QUOTE><s>[quote]</s>- ale na jednym z obrazw skuter Ghost (ten grubszy) nie ma uchwytu na dziobie (przodzie) skutera,<br/>\n- na skuterach musz by wrysowane nasze lampy owietleniowe, [na przednim uchwycie transportowym],<br/>\n- ponadto brakuje logu, rwnie na przednim uchwycie transportowym,<br/>\n- trzeba dorysowa przewd czcy konsol ENC z logiem,<br/>\n- trzeba dorysowa przewd czcy owietlenie (lampki) z gniazdem zasilania<br/>\n<br/>\nMoe nie na wszystkich skuterach wszystko, ale na jednym komplet ENC (czyli z logiem), na innym lampy i przewd od gniazda zasilania. A na maym GO pewnie nic (taki jak jest) ,\n<e>[/quote]</e></QUOTE>\n\nStworzenie nowych renderw zapewne zajmi troch czasu Marcinowi, Pawe Wooszyn, po otrzymaniu tych wytycznych ju nic nam nie przesa  <E>:oops:</E> <br/>\nPytanie, czy a tak bardzo technicznie musz by przedstawione rendery skuterw na tym banerze na Tarnobrzeg, czy moemy co zrobi bardziej spjnego z nasz identyfikacj wizualn, a jak ju bdziemy mie takie rendery jak chcia Jarek, to si podmieni?<br/>\n<br/>\nPropozycja bannera:<br/>\n\n<ATTACHMENT filename=\"nowy banner.jpg\" index=\"1\"><s>[attachment=1]</s>nowy banner.jpg<e>[/attachment]</e></ATTACHMENT></r>','0ddb0ea37a15d79f2904fefe0789cfff',1,'','3i472j',1,0,'',0,0,0,1,0,'',0),(109,40,31,58,0,'94.232.216.242',1650014137,0,1,1,1,1,'','Re: Najlepszy czas na publiakcj w SM','<r>Jasne, pena zgoda, wrzuciem tutaj, eby byo pod rk i mona byo szybko i atwo porwna, przeanalizowa <E>;)</E><br/>\n\n<QUOTE author=\"Paulina &#x15A;l&#x119;zak\" post_id=\"105\" time=\"1650011819\" user_id=\"60\"><s>[quote=\"Paulina lzak\" post_id=105 time=1650011819 user_id=60]</s>\n Ciko z tym trafi, bo u nas odbiorcy to tylko w maym uamku Polska.\n<e>[/quote]</e></QUOTE>\n\nTak, tak, w tych zestawieniach chodzi o czas lokalny w danej strefie czasowej, czyli jak co wrzucamy u nas np o 11 am, to np w Koreii jest wtedy 18.</r>','a7f39cc85df2da514e98c09644d9b471',0,'','3bp17',1,0,'',0,0,0,1,0,'',0),(110,27,23,58,0,'94.232.216.242',1650014752,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>Bardzo adnie te pokrowce si prezentuj <E>:)</E><br/>\n<br/>\nA gdyby tak, na te pokrowce drukowa nasze logo z jeden strony i wprowadzi obok bannerw i flagi jako materiay reklamowe dla naszych partnerw? <br/>\n<br/>\nAlbo wyposay kadego z naszych partnerw w taki porkowiec na stolik, to przestali by nareszcie uywa pogitych bannerw na stolikach.</r>','cb49535f1232377ff0104e6e355d112d',0,'','pw4zdim',1,0,'',0,0,0,1,0,'',0),(111,42,21,61,0,'185.153.39.80',1650015605,0,1,1,1,1,'','Re: Banner Tarnobrzeg','<r>Moim zdaniem jest ok.<br/>\nWylij prosz do Jarka i Piotra do zatwierdzenia.<br/>\nZ adnotacj, i projekt jest zgodny z nasz identyfikacj wizualn ale na uwagi jestemy oczywicie otwarci  <E>;)</E></r>','b294cc358df445b699f34e181b610847',0,'','30e1md',1,0,'',0,0,0,1,0,'',0),(112,27,23,61,0,'185.153.39.80',1650017216,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<t>Dobry pomys, proponuj jeszcze wprowadzi ten skadany st - pasuje wymiarowo.</t>','6f50c59864e090858e06e73e92793bbd',0,'','3640e5',1,0,'',0,0,0,1,0,'',0),(113,27,23,63,0,'85.221.240.2',1650022555,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<t>Przetestuj w dziaaniu- pokrowiec ju dotar i bardzo sensownie wyglda, ale nie nakadaem jeszcze na st.<br/>\nGeneralnie pomys z pokrowcem ologowanym Seacraftem jest dobry - natomiast, skutery zdecydowanie lepiej si prezentuj na stojakach wystawowych na 1 skuter. <br/>\n<br/>\nNiestety, bariera cenowa jest na tyle dua e nie s one zbyt rozpowszechnione. Rwnie problematyczna- z uwagi na wag- jest prezentacja na nich Ghostw. Koszt wykonania jest wysoki.<br/>\n<br/>\nRaczej \'marzyoby mi si\' zwikszenie dostpnoci adnych stojakw - albo, przez zwikszenie rabatowania, albo - dodanie prostszego, taszego modelu.<br/>\nDodatkowo, opcja by zamontowa na stojaku rwnie Ghosta/ wikszy nacisk na uytkowanie stojakw na 3 skutery na wydarzeniach targowych.<br/>\n<br/>\nPrawdopodobnie rozwizaniem jakie zadziaa, jest przesanie na dugoterminow umow testowania odpowiednich stojakw wszystkim partnerom ktrzy si wystawiaj. (na koszt MT). Partnerzy pac za stoiska.<br/>\n<br/>\nOd razu do rozwaenia temat GO! - idealnie si cao komponuje na stojak na 3 sztuki : Ghost, Future, GO! na jednym stojaku.</t>','ca0f7ccce7c6f0b4eb54b57b4d57f98d',0,'','2q3qal',1,0,'',0,0,0,1,0,'',0),(114,42,21,58,0,'94.232.216.242',1650024083,0,1,1,1,1,'','Re: Banner Tarnobrzeg','<t>Jest akceptacja, zmieni si tylko slogan, na \"innowacyjny sprzt podwodny\", przygotuj pliki do druku.<br/>\n<br/>\nPaulina, ogarniesz nam wydruk, czy mam tu na miejscu w Kronie to ogarn?</t>','e8cbabdd0c26c26fd85faf53cb0f8995',0,'','9ag',1,0,'',0,0,0,1,0,'',0),(115,27,23,61,0,'185.153.39.80',1650024429,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>My na stojakach nie zarabiamy a do ostatniego modelu obawiam si, e dopacamy, bo nie dodalimy nowego do cennika a wysalimy chyba do Australii jako zamwiony z kodem starego stojaka (ju ich nie produkujemy).<br/>\n<br/>\nOstatni model by prb zrobienia taniego stojaka - niestety nie jest to moliwe. Materiay s w horrendalnych cenach, a robilimy jeszcze przed podwykami... A to kup elaztwa jednak. W dodatku skadanego co rwnie podraa koszt.<br/>\nNawet nie wiem jakie ostatecznie wyszy koszty - po witach sprawdzimy.<br/>\n<br/>\nJeeli masz pomys na tani stojak to zapewne Wooszyn chtnie posucha  <E>;)</E> <br/>\n<br/>\nOczywicie, e dobrze si komponuj 3 sztuki - zostay tak zaprojektowane wanie by kady z modeli wszed - maj dobry rozstaw hakw pod kady model (niezalenie ktry gdzie pooysz) Tomek zby na tym zjada... my zreszt te.</r>','eba4a556903a6c9f4fdf16ae36df907b',0,'','8o9p0',1,0,'',0,0,0,1,0,'',0),(116,42,21,60,0,'91.196.8.186',1650349968,0,1,1,1,1,'','Re: Banner Tarnobrzeg','<t>Nie ma sprawy. Podelij gotowy plik z informacj na jakim materiale i z jakim mocowaniem powinien by wykonany baner. <br/>\nCzy ma mie dziury do nacignicia? Grubo materiau podobna jak w poprzednich?</t>','3ab6bb1c2352ecd1837bb2157519d564',0,'','1bdab8',1,0,'',0,0,0,1,0,'',0),(117,27,23,60,0,'91.196.8.186',1650350177,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<t>Jeli zdecydujecie si na wprowadzenie pokrowcw i stow do oferty, to dajcie zna. <br/>\nO ile ze stoami oczywicie nie bdzie problemu, o tyle pokrowce s w okrelonych kolorach i bdzie trzeba poszuka pewnie wrd producentw takiego, ktry zafarbuje nam pokrowce. Myl, e moe si to wiza z koniecznoci zamwienia wikszej liczby pokrowcw.</t>','2f102ca5d6d93255512b3f5408678f9e',0,'','2qni8p',1,0,'',0,0,0,1,0,'',0),(118,42,21,58,0,'94.232.216.242',1650350369,0,1,1,1,1,'','Re: Banner Tarnobrzeg','<r>Tak, materia tak jak ostanio, przypuszczam, e to byo tak: materia frontlight mat 510g,Wykoczenie: zgrzewanie, oczkowanie co 50cm. Wymiar 290x140 cm.<br/>\n<br/>\nLink do plikw do druku wysany na maila <E>;)</E></r>','00746b646c13e3268d33d7bb7426546d',0,'','62ng4m3d',1,0,'',0,0,0,1,0,'',0),(119,7,41,61,0,'94.232.216.242',1650353459,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<t>Do dodania nowy produkt:<br/>\n<br/>\nPlatforma ENC3M gen.II<br/>\n<br/>\nObecnie w produkcji prototyp.</t>','a815fde540dff7677572260d9035e6a6',0,'','lqwbkm8',1,0,'',0,0,0,1,0,'',0),(120,43,51,58,0,'94.232.216.242',1650354229,0,1,1,1,1,'','Platforma ENC3M gen.II','<t>Temat dotyczcy Platforma ENC3M gen.II</t>','81c2a9b0c221606ad4f8605fccc497f2',0,'','1lfsn',1,0,'',0,0,0,1,0,'',0),(121,31,46,63,0,'85.221.240.2',1650356408,0,1,1,1,1,'','Re: Obcienie elektroniczne','<r>Manual w wersji online:  <URL url=\"https://support.seacraft.eu/index.php/knowledge-base/battery-capacity-testing/\"><LINK_TEXT text=\"https://support.seacraft.eu/index.php/k ... y-testing/\">https://support.seacraft.eu/index.php/knowledge-base/battery-capacity-testing/</LINK_TEXT></URL><br/>\nManual w wersji pdf generowanej z wersji online: (co gwarantuje aktualnoc treci): <URL url=\"h