s<br/>\nWeb<br/>\nRenders<br/>\nHigh Res<br/>\nWeb<br/>\n<br/>\n ENC<br/>\nENC3<br/>\nPhotos<br/>\nHigh Res<br/>\nWeb<br/>\nRenders<br/>\nHigh Res<br/>\nWeb<br/>\nAccessories<br/>\nPhotos<br/>\nHigh Res<br/>\nWeb<br/>\nRenders<br/>\nHigh Res<br/>\nWeb<br/>\nSample Routes<br/>\n<br/>\n ENCM<br/>\nENC3M<br/>\nPhotos<br/>\nHigh Res<br/>\nWeb<br/>\nRenders<br/>\nHigh Res<br/>\nWeb<br/>\nAccessories<br/>\nPhotos<br/>\nHigh Res<br/>\nWeb<br/>\nRenders<br/>\nHigh Res<br/>\nWeb<br/>\n<br/>\nBrochures and Flyers<br/>\n<br/>\nSocial Media<br/>\nAds (open format)<br/>\nArticles (open format)<br/>\nMovies (adapted size)<br/>\n<br/>\nSuggested documents<br/>\n Testing agreement (sample)<br/>\n Rental agreement (sample)<br/>\n<br/>\nCooperation Conditions (latest version)</t>','53733a0dfacdd9d4e6a55e66f77d2d13',0,'','d3apb0h2',1,0,'',0,0,0,1,0,'',0),(123,7,41,61,0,'94.232.216.242',1650357047,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<t>Nowy produkt:<br/>\n<br/>\nStojak do DPC <br/>\n<br/>\nObecnie w fazie projektowej. Powinien by gotowy na: UDT Rotterdam, Holandia 7-9.06.2022</t>','f5ca9ecf6b2c3ce1aaaf53a3920d9760',0,'','1yx483',1,0,'',0,0,0,1,0,'',0),(124,44,21,63,0,'85.221.240.2',1650357167,0,1,1,1,1,'','Re: Foldery do udostpnienia - struktura','<t>Hej<br/>\nCo do propozycji Franka - jest to jedna z opcji, cho nie widzi mi si w 100%.<br/>\n<br/>\n-Wydzielibym jako \'Master\' kategorie gwne : MIL i REC. (tak bdzie to udostpniane odpowiednio partnerom)<br/>\n-Nie wizabym Akcesoriw z poszczeglnymi modelami, tylko jako caociow grup. Wydzielibym rwnie spjnie z cennikiem adowarki, baterie, owietlenie, itd. (moliwe e przepierajc teraz karty produktowe MIL ustalimy lepiej nadajcy za naszym rozwojem podzia na kategorie produktowe)<br/>\n<br/>\n-Brandbook, logotypy, czcionki to tak na prawd jedna paczka/ jeden folder. Mona doda te szablony prezentacji. Dodaje folder \'Wytyczne wystawiania si\' - rwnie przygotujemy na bazie zdj i wrzucimy. Rwnie, powinno by to podzielone na REC i MIL.<br/>\n<br/>\n<br/>\nNie jestem pewien e Albin moe tu duo pomc - ew.  kwestie techniczne. Moemy cao dopra pon-r jak bd na miejscu w Kronie (?)</t>','36055abf00526f986cc3ff2d0de42369',0,'','adhhw4d7',1,0,'',0,0,0,1,0,'',0),(125,45,21,63,0,'85.221.240.2',1650357298,0,1,1,1,1,'','Wytyczne wystawiania si na targach - przewodnik, poradnik','<t>Materia powinien wskazywa w jaki sposb chcemy by nasz sprzt byl wystawiany - co jest dopuszczalne (przykady stoisk), co jest niedopuszczalne.<br/>\nDo tego, zalecane iloci ulotek/ katalogw na np. dzie targw, oraz wskazwki praktyczne - jak ciereczka z microfibry do wycierania paluchw ze skuterw, oraz smar do silnika, by silniki nawet uywanych maszyn bardzo pynnie chodziy na sucho.</t>','11ecc75f380d7d1b54ea2e1a13a009e9',0,'','16kq',1,0,'',0,0,0,1,0,'',0),(126,7,41,63,0,'85.221.240.2',1650357603,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<r>&lt;3 (to o stojaku <E>;)</E> )<br/>\n<br/>\nPytanie. Czy chcemy dodawa Franka do forum? Moe to usprawni komunikacj (a on powinien da rad z nakadk tumaczc na chrome\'a)</r>','f123b8ffc0f7e08d2e427a04e7a63632',0,'','23ikq',1,0,'',0,0,0,1,0,'',0),(127,7,41,58,0,'94.232.216.242',1650357924,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"126\" time=\"1650357603\" user_id=\"63\"><s>[quote=\"Witold Hoffmann\" post_id=126 time=1650357603 user_id=63]</s>\n&lt;3 (to o stojaku <E>;)</E> )<br/>\n<br/>\nPytanie. Czy chcemy dodawa Franka do forum? Moe to usprawni komunikacj (a on powinien da rad z nakadk tumaczc na chrome\'a)\n<e>[/quote]</e></QUOTE>\n\nFrank ma dostp, ale tylko do dziau Targie Eventy, oczywicie jak chcemy, moemy mu udzieli dostpu takiego jak @Marketing.</r>','f4583321e961fe8dbd88fb66889d7f65',0,'','1d92zhv',1,0,'',0,0,0,1,0,'',0),(128,46,52,58,0,'94.232.216.242',1650358117,0,1,1,1,1,'','Stojak do DPC','<t>Temat powicony: Stojak do DPC</t>','3c6a057e41c489024f8910cdf966486d',0,'','1ekxqot',1,0,'',0,0,0,1,0,'',0),(129,31,46,61,0,'94.232.216.242',1650359288,0,1,1,1,1,'','Re: Obcienie elektroniczne','<t>Czy wydrukowa w kolorze do wysyek?<br/>\nCzy zostaje tylko wersja do cignicia?</t>','2fa8b58d2afd76a48332e9af740702d5',0,'','26',1,0,'',0,0,0,1,0,'',0),(130,44,21,61,0,'94.232.216.242',1650359770,0,1,1,1,1,'','Re: Foldery do udostpnienia - struktura','<t>Owszem, moe i musi nawet.<br/>\nMy si dopasujemy do oglnej struktury nazewnictwa, by katalogi i pliki si nie powtarzay.<br/>\nWtedy znikaj przy wgrywaniu!</t>','0b485f6603f05f82d6c00f460386c8b4',0,'','2srnx',1,0,'',0,0,0,1,0,'',0),(131,44,21,61,0,'94.232.216.242',1650362104,0,1,1,1,1,'','Re: Foldery do udostpnienia - struktura','<t>Owszem, moe i musi nawet.<br/>\nMy si dopasujemy do oglnej struktury nazewnictwa, by katalogi i pliki si nie powtarzay.<br/>\nInaczej znikaj przy wgrywaniu!</t>','b04d52afd563920c52a1c0639acbf4cc',0,'','5oltwyi',1,0,'',0,0,0,1,0,'',0),(132,47,28,61,0,'94.232.216.242',1650368085,0,1,1,1,1,'','Opakowanie skutera','<t>Pasowaoby mie do filmu...<br/>\nPlanowana data odbioru prbek opakowania najwczeniej miedzy 11.05 a 30.05.2022.</t>','b252812bba32adbafa3d0b0eb7a2448f',0,'','u3e2x55',1,0,'',0,0,0,1,0,'',0),(133,48,25,63,0,'85.221.240.2',1650369530,0,1,1,1,1,'','25-26.06.2022 [REC] Handover event Cavebase','<t>Hej<br/>\n<br/>\nProponowany termin eventu przekazania sprztu/ szkolenia produktowego dla Cavebase to 25-26.06. Tylko ta data pasuje wszystkim czonkom.<br/>\n<br/>\nWstpnie zabookowaem go w swoim kalendarzu, Frank- masz chci rwnie si zaangaowa? Jak z terminem?</t>','09b6b786f187c0eadc2384ff95792dfb',0,'','gvti',1,0,'',0,0,0,1,0,'',0),(134,31,46,63,0,'85.221.240.2',1650369636,0,1,1,1,1,'','Re: Obcienie elektroniczne','<r>Sugeruj wysyanie wycznie z opakowaniu fabrycznym (tak jak kupujemy), manuale serwisowe - dostpne online, bd do samodzielnego wydrukowania.<br/>\nJestemy ekologiczni i oszczdzamy na papierze... <E>;)</E></r>','3b78fd4945e7a1302cad526036528cca',0,'','3iduzi7q',1,0,'',0,0,0,1,0,'',0),(135,44,21,63,0,'85.221.240.2',1650369694,0,1,1,1,1,'','Re: Foldery do udostpnienia - struktura','<t>Czekam w takim razie na decyzje --&gt; jak bdzie zatwierdzona struktura, uporzdkuj w niej zdjcia produktowe.</t>','4615cf4c7efd5bc9b8b5a55a8b800736',0,'','1e2mdna',1,0,'',0,0,0,1,0,'',0),(136,24,28,63,0,'85.221.240.2',1650370101,0,1,1,1,1,'','Re: Zdjcia i materiay','<r>Potrzebuj informacji o moliwej dacie wysyki maszyn.<br/>\n<br/>\na) Cavebase:\n<QUOTE><s>[quote]</s>I received a globkurier-Message a couple of hours ago. I am wondering what will come next <EMOJI seq=\"1f609\" tseq=\"1f609\">&#128521;</EMOJI> Lights? New DPV? SpeedSensor? Looks like an Easter-Present <EMOJI seq=\"1f603\" tseq=\"1f603\">&#128515;</EMOJI><br/>\n<br/>\nI already discussed with our team. You can send the new DPV to me:<br/>\n<br/>\n <br/>\n<br/>\nSteffen Burger<br/>\n<br/>\nBirkengraben 37<br/>\n<br/>\n96052 Bamberg<br/>\n<br/>\n <br/>\n<br/>\nBut I need it until next week, as I would like to take it to our guys in the north on 22.4. Afterwards I will visit our team in the south.<br/>\n<br/>\nI am looking forward to present nice pictures from Hemmoor and german caves!<br/>\n<br/>\nCan you tell me about your plans how long we can use it? Maybe till handover-meeting?<br/>\n<br/>\n <br/>\n<br/>\nWhat about 25.  26.6., would it fit for a handover-meeting?<br/>\n<br/>\nThats the date which would fit best for us.<br/>\n\n <e>[/quote]</e></QUOTE>\n\nb) Andrea:<br/>\n\n<QUOTE><s>[quote]</s>Hi Witold, <br/>\n<br/>\nThank you for bringing up these talking points.  <br/>\nIm familiar with planning (and executing) different kind of video and photo shoots. As you well know this is exactly what we do here at DigitalMovie. We regularly produce digital media to explain products features and convey them into product presentations through video and still photography. We operate comfortably underwater but we also work on terrestrial productions either outdoors as well as in our studio facility. <br/>\n<br/>\nBeing this project currently in the form of ideas, I ask you a few questions below in order to figure out what options we may have and what works best.<br/>\nI think it would be great exchanging products (by Seacraft) and services (by digital movie) with mutual benefit and reciprocal discount agreements.<br/>\nUpdating my unit is a tempting idea, if this can maximise our mutual support, Ill be happy to do it. <br/>\n<br/>\nOne of the easiest way to move forward with the idea of producing some media about the new product, is sending a unit here at my studio. We can start creating some still life images first (assuming the unit being flawless not beta or battle tested) and taking it underwater for in-action contents right after (unless you have a second unit dedicated to  action/test (this one may have a few signs of use). <br/>\nOf course we can line up production style to your indications/requirements like showing recreational divers, different users including women, different water entrance and situations. Now, here there are a few questions for you: would it be ok also showing a teenager user or is there any legal/safety issues about user age?<br/>\nIs the unit also suitable for cave diving or is it better to keep it in open waters only?<br/>\nHow about T-reb users (I might have a friend to ask to...)? Would it be better on different CCRs or it doesnt matter?<br/>\nThis kind of production is what we call a \'media package. The main goal of a media package is to create a variety of media contents for mixed usage (from catalogs and borchures to social media and web).  Essentially its a digital media collection, including both stills and videos, delivered in different formats (like 16:9 / 4:5 / 9:16) to be used for product launch, digital presentations, on line and off line product promotion.<br/>\nIf the project timeline is not too compressed, this approach is particularly cost-effective since I am free to seek for good opportunities to shoot maximising production efficiency. When would you ideally need some media to be ready? <br/>\n<br/>\nAs a different option, (not sure if you meant this in your email) we can design, plan and execute a product video from start to finish going for a shoot on a specific location. This is ideal if you want to be part of it in person, attending the shoot and supervising operations on set for the whole production. Please feel free to share your ideas if you have already defined something specific, I am willing to line up and see if we can find a good match with your plan.<br/>\n<br/>\nPlease let me know how about and well set things up at best. <br/>\nAs we move forward in defining some options, I can start working on initial calculations to quote our services and make an offer. <br/>\nI think the best way to make a happy and durable collaboration is to set an exclusive mutual discount that makes reciprocal advantage working together. <br/>\nIm sure both of us can get some really good perspectives out of this. <br/>\n<br/>\nLooking forward to hearing from you again, feel free to catch up on a call at any time. <e>[/quote]</e></QUOTE></r>','f63fd2a7ed8173a1f0e0142348de50fd',0,'','txvf4n4',1,0,'',0,0,0,1,0,'',0),(137,24,28,61,0,'185.153.39.80',1650389280,0,1,1,1,1,'','Re: Zdjcia i materiay','<t>Mam nadziej, e uda si zoy 2 egzemplarze do przetestowania w niedziel.<br/>\n<br/>\nPo przetestowaniu mona wysya.<br/>\nBd dwa na razie, poniewa tyle grawerw zrobili. Chyba dzisiaj wysali do Krosna. Trzecia sztuka bdzie montowana jak przyjdzie wygrawerowany trzeci komplet. Nie wiem kiedy, mam nadziej, e szybko.<br/>\n<br/>\nZatem data 22.04 jest nierealna, ale o tym ju pisaam.<br/>\nMusz poda inny termin o ile jest to moliwe.</t>','1c0f73811bdfc879d8d3290124a584e1',0,'','2fg08x',1,0,'',0,0,0,1,0,'',0),(138,49,11,58,0,'94.232.216.242',1650432246,0,1,1,1,1,'','Wizytwka firmowa w Google','<r>Nasz wizytwk w Google trzeba bdzie zaktualizowa, z pilnych zmieni zdjcie w tle, bo nie jest ustawione domyle i skrypt wybiera ostatnio dodane (w tym wypadku zdjcie z opinii/komentarza).<br/>\n\n<ATTACHMENT filename=\"obraz_2022-04-20_071948541.png\" index=\"0\"><s>[attachment=0]</s>obraz_2022-04-20_071948541.png<e>[/attachment]</e></ATTACHMENT>\n\nKto ma dostp do administracji nadany?</r>','656507538971ae83f66e58bd6033f7c1',1,'','mv3',1,0,'',0,0,0,1,0,'',0),(139,49,11,61,0,'185.153.39.80',1650433854,0,1,1,1,1,'','Re: Wizytwka firmowa w Google','<t>Andrzej si tym zawsze zajmowa.</t>','2787a40b8eee79afaf3349635f20aad0',0,'','j2iug',1,0,'',0,0,0,1,0,'',0),(140,49,11,58,0,'94.232.216.242',1650433969,0,1,1,1,1,'','Re: Wizytwka firmowa w Google','<t>Ok, napisz do niego.</t>','28f95adcb8c286670e20f87812e6d753',0,'','61',1,0,'',0,0,0,1,0,'',0),(141,24,28,58,0,'94.232.216.242',1650434220,0,1,1,1,1,'','Re: Zdjcia i materiay','<r><QUOTE author=\"Beata So&#x142;tys\" post_id=\"137\" time=\"1650389280\" user_id=\"61\"><s>[quote=\"Beata Sotys\" post_id=137 time=1650389280 user_id=61]</s>\n<br/>\nBd dwa na razie, poniewa tyle grawerw zrobili. Chyba dzisiaj wysali do Krosna. Trzecia sztuka bdzie montowana jak przyjdzie wygrawerowany trzeci komplet. Nie wiem kiedy, mam nadziej, e szybko.<br/>\n\n<e>[/quote]</e></QUOTE>\n\nWczoraj wysali dzi powinno by u nas. 3 komplet maj grawerowa jak nie bdziemy mie zastrzee co do tych dwch.<br/>\n\n<QUOTE><s>[quote]</s>Dzie dobry,<br/>\n<br/>\ndobrze, dzisiaj nadamy, jutro, max do czwartku powinny by u Panstwa.<br/>\nMamy wyznakowane dwa, nie chcielimy marnowa wicej sztuk gdyby byy uwagi do jakoci graweru (mielibysmy material do poznakowania nowymi parametrami).<e>[/quote]</e></QUOTE></r>','218b7fa64b97709b0b046c3892b5fdcc',0,'','lr03ma9',1,0,'',0,0,0,1,0,'',0),(142,42,21,60,0,'91.196.8.186',1650436115,0,1,1,1,1,'','Re: Banner Tarnobrzeg','<r>Zamwienie puszczone do druku. <E>:)</E></r>','b4fbbe998213266ed8b5129ae62bc963',0,'','9lozf',1,0,'',0,0,0,1,0,'',0),(143,50,39,61,0,'185.153.39.80',1650450852,0,1,1,1,1,'','stojak wystawowy','<t>Koszt produkcji stojaka bez narzutu:<br/>\nStojak na 3 skutery: 2 374,62 z <br/>\n<br/>\njego cena po uwzgldnieniu zniki 25% dla sprzedwcw wynosi obecnie: <br/>\n  495  = 2277 z<br/>\nNie moe ju by nisza, ale jednak nie dokadamy do tematu (dlatego, e wycofalimy ciank z pleksy projektu Karwowskiego)<br/>\nProponuj jednak wprowadzi now pozycj stojaka do cennika z opisem, e jest na 3 modele naszych skuterw - moe  przy okazji jak wprowadzimy skuter GO do cennika, wtedy planowane s te grubsze zmiany.<br/>\n<br/>\n<br/>\nw cenniku jest obecnie stary stojak, ktry jest wycofany, nie by skadany i ciki w transporcie.<br/>\nU1086	Exhibition stand for FUTURE and GHOST scooters (for 3 scooters)	  660 <br/>\ndo Australii poszed ju nowy - zamwiony jako U1086</t>','677bef3b11803adc925b2a71f716d2a0',0,'','skm',1,0,'',0,0,0,1,0,'',0),(144,51,16,58,0,'94.232.216.242',1650519372,0,1,1,1,1,'','Seacraft Newsletter 05.2022','<t>Temat powicony propozycjom tematw do kolejnego newslettera:<br/>\n<br/>\nPlanowana wysyka: 10-15.05.2022<br/>\n<br/>\n___<br/>\n<br/>\nTematy: <br/>\n1. Nurkowe Demo Days, Jaworzno, 14-15.05, mamy tam naszego partnera Deep Adventure, warto o tym poinformowa.<br/>\n2. Personalizowany grawer na DPV</t>','0cdaabcaeef8926b22cb032152fbd7ab',0,'','iymh',1,0,'',0,0,0,1,0,'',0),(145,51,16,60,0,'91.196.8.186',1650525035,0,1,1,1,1,'','Re: Seacraft Newsletter 05.2022','<t>Troch poza tematem: moe wrzuc informacj na IG/plakat zwizany z Demo days na koparkach?</t>','5d3f0e943de02b0ae445de64b9391d67',0,'','dg6h',1,0,'',0,0,0,1,0,'',0),(146,51,16,58,0,'94.232.216.242',1650526574,0,1,1,1,1,'','Re: Seacraft Newsletter 05.2022','<t>Mysl, e jak najbardziej tak, ale to bliej terminu 4 maj moe? Przygotuj jak grafik, eby to adnie i zgodnie z naszymi kolorami wspgrao.</t>','ddd6905e7fb5757785f6199e8d2be127',0,'','34oeb',1,0,'',0,0,0,1,0,'',0),(147,52,9,60,0,'91.196.8.186',1650536676,0,1,1,1,1,'','Produkty Special','<t>Hej, temat bdzie dotyczy wrzucenia produktw z linii Special na stron internetow.</t>','87aadf32d0f56e4afd6f92d55001c04d',0,'','33h',1,0,'',0,0,0,1,0,'',0),(148,33,40,60,0,'91.196.8.186',1650545618,0,1,1,1,1,'','Re: Cennik - 12.04.2022','<t>Hej, przy okazji nastpnych zmian usucie kody: KM157M, KM167M. <br/>\nTo koszulki fullprint militarne, dla ktrych przyporzdkowane zostay po 1 kodzie wicej. Tak jakby dla rozmiaru XXXXL, ktrego nie byo w tym modelu.</t>','21d02597a9dd969db73b776ad1493dd1',0,'','4q4x893b',1,0,'',0,0,0,1,0,'',0),(149,50,39,61,0,'185.153.39.80',1650612288,0,1,1,1,1,'','Re: stojak wystawowy','<t>stojak okrgy:<br/>\n<br/>\ninfo od Izy na temat kosztw:<br/>\n...............<br/>\nCena stojaka z okrg podstaw  1882,13 z netto + malowanie proszkowe na czarno (nie wiem w tej chwili ile moe to kosztowa, bo jeszcze nigdy tego nie zlecaam, a nie mam gotowych stojakw jeszcze, eby zawie i prosi o wycen).</t>','0aa962f0f0ac2412ad1a8f9115eec25d',0,'','sv79mv',1,0,'',0,0,0,1,0,'',0),(150,53,39,61,0,'185.153.39.80',1650621742,0,1,1,1,1,'','Zmiany w kolejnej wersji cennika rec','<r>info od Pauliny - przeniosam do dziau REC:<br/>\n\n<QUOTE><s>[quote]</s>Hej, przy okazji nastpnych zmian usucie kody: KM157M, KM167M.<br/>\nTo koszulki fullprint militarne, dla ktrych przyporzdkowane zostay po 1 kodzie wicej. Tak jakby dla rozmiaru XXXXL, ktrego nie byo w tym model<e>[/quote]</e></QUOTE>\n\ni moje<br/>\nCennik naley skategoryzowa tak jak militarny, ujednolicenie cennika pozwoli na tak sam struktur folderw do udostpniania na zewntrz plikw (mil i rec).</r>','c4c084105ec596e8f884eaeb179cbd50',0,'','1qw97cs',1,0,'',0,0,0,1,0,'',0),(151,54,40,61,0,'185.153.39.80',1650622058,0,1,1,1,1,'','Niezbdne zmiany w cenniku special','<r>Naniosam zmiany w cenniku  kategoriach - niezbdne zarwno do kart militarnych jak i oglnie do uporzdkowania struktury.<br/>\n<br/>\nZmiany w arkuszu kart militarnych \"cennik\" - plik v2<br/>\nWitek musi przejrze i zatwierdzi.<SIZE size=\"150\"><s>[size=150]</s><e>[/size]</e></SIZE></r>','316b0a5da3f37e0c277783bebf3a3fd0',0,'','48ina9',1,0,'',0,0,0,1,0,'',0),(152,55,49,61,0,'185.153.39.80',1650622255,0,1,1,1,1,'','serwis suex','<r>Info od Bramsona<br/>\n\n<QUOTE><s>[quote]</s>Katalogu nie mam, ale mam kilka najwieszych info prosto z siedziby Suex <E>;)</E> A dotycz serwisu i gwarancji.<br/>\n<br/>\nSerwis - maj 3 poziomy serwisu: 1 poziom dostpny praktycznie dla kadego uytkownika i dotyczy przegldu, smarowania i wymiany gwnych o-ring, 2 poziom jest troszk bardziej zaawansowany, a 3 poziom to rozbieranie caego skutera na czci (wcznie z silnikiem) i po tym serwisie gwarancja zostaje przeduona na kolejny rok. <br/>\n<br/>\nW zeszym tygodniu na szkoleniu do 3 poziomu byy dwie osoby z Polski.\n<e>[/quote]</e></QUOTE></r>','64fb74ea10b62dfcbfa95c975003e9b0',0,'','kf7',1,0,'',0,0,0,1,0,'',0),(153,27,23,61,0,'185.153.39.80',1650622763,0,1,1,1,1,'','Re: Event Gearpoint 21.04','<r>info od Witka:<br/>\n\n<QUOTE><s>[quote]</s>1. NL<br/>\n<br/>\nBy Flamur (z Sieniawy <E>;)</E>). Bardzo si ucieszy z wyjcia na ogrzewanie, nie widzia go w akcji jak by u nas z wizyt. Przetarg na pojedyncze skutery ma by rozpisany na koniec tego roku, z prawdopodobmi testami w wodzie (parametry, specyfikacje, a nawet chc mierzy porwnawczo akustyk w wodzie). Mam mu wysa nasz metodologi bada.<br/>\n<br/>\nZ nowinek, SUM wzbudzi zainteresowanie, ENC3M rwnie, ale wida e ma ju wybrany i zakupiony system nawigacji - nie planuje zmienia. Zwalniacz mocno zaciekawi, mam podesa manual po ENG. (mam polski, przetumaczymy...).<br/>\n<br/>\nDosta wina, prosi eby pozdrowi i mio wspomina wizyt szczeglnie na Buczynach <E>;)</E><br/>\n<br/>\nNurkowie policyjni bd chcieli podczy si pod testy w wodzie robione na przetarg. Pogadalimy, o rnych maszynach, dostali koszulki, klucze, a nawet miaem woreczki seacrafta coby nie zapomnieli marki...<br/>\n<br/>\nBy nawet go ktry si ali e holenderske organizacje ekologiczne nie pozwala na wyszkolenie fok do poszukiwania zwok pod wod. (uywaj do tego psw - wyczuwaj nad wod \'aromat\'...), ale foki byby jeszcze skuteczniejsze... <E>;)</E><br/>\n<br/>\nTyle z waniejszych, poza tym pani z dziau przetargw i pan z dziau logistyki...<br/>\n<br/>\nPoza tym, do przetargu na pewno bdzie klauzula o udowodnienie duej dostawy (Ruben mwi o dostawie na 500 k EUR) i moliwo kontaktu z takim klientem o referencje. Ma da zna dokadnie o jak kwot ma chodzi...<br/>\n<br/>\n2. SIEL<br/>\n<br/>\nSiel dziaa od lat 60 - na pocztku robili tylko reby dla marynarki, w tej chwili maj znacznie szersze spektrum dziaalnoci. Troch do nich z dystansem podszedem (w kocu dziaaj z Suexem), ale okazuje sie e cay system nawigacji, komunikacji pod wod, komunikacji z bateri i elektonik robi dla Suexa oni - od S jest tylko rura i silnik jask si Peter Boules wyrazi... Niezy go. Swoj drog, podobno aktualna bojka GPS Suexa komunikuje si bezprzewodowo z nawigacj - i moe by puszczana na sznurku. Oj, rozwizaoby to troch tematw... (linka 1mm dyneema i koowrotek).<br/>\n<br/>\nGeneralnie s otwarci, chyba maj trosz przesyt wspprac z Suexem. O Clemenzie wyraa si jako \'debil\'. Poogldaem ich nowe filmy promocyjne- bardzo wysoki poziom, mwi e kupe kasy na to poszo... Rwnie sterowanie autonomiczne odziami motorowymi (partolowymi) jakie robili dla izraela (z systemem unikania przeszkd i tolerancj na rozkoys, fale, wiatr...)<br/>\n<br/>\nPoyjemy zobaczymy, bardzo chwalili nasz rozwj do tej pory. (cho byli w dwjk- Peter, dyrektor rynk eksportowych i drugi woch - emerytowany nurek Comsubinu). Wkurzali si e im Malezj wygralimy (te si szykowali).<br/>\n<br/>\nInne ciekawostki:<br/>\n<br/>\n-Dostawa dla Chiczykw faktycznie si odbya (rebw). Dostarczyli te skutery Suexa, ale pod nazw SIEL - Suex si ba<br/>\n<br/>\n-Byli 2 tygodnie temu u naszych czechw z rebami- te si wkurza e nawet nie byo sensu wypowiada sowa \'Skutery\' bo byli ju zdecydowani na Seacrafty<br/>\n<br/>\n-Specjalizuj si w cznoci podwodnej i komunikacji podwodnej. Maj patenty jakie s wykorzystywane w rozwzaniach dla Suexa. Nawigacja jest ich robty, tylko branduj dla S. Widziaem nowiutki (wida moe na foto) rczny log do wpinania \'konsolki\' i nawigowania przez pywajcego z petwy nurka<br/>\n<br/>\n-Wstpnie pogadalimy o ew. wsppracy na rynku cywilnym, w Egipcie. Ma tam bardzo dobrych ludzi i dostali po znajomoci wyczenie z bana na permit importy skuterw do kraju. Raczej wtpi e chc wysondowa tematy dla Suexa, raczej wysondowa czy nie warto zmieni partnera skuterowego.... Suexa by to utopio drastycznie.<br/>\n<br/>\n-80% dostaw skuterw zaatwi Suexowi Peter. Suex sam dotar tylko d kilku krajw (gwnie pnocna europa). Cay bliski wschd, azja itd. nagrywa Siel.<br/>\n<br/>\n3. Inne<br/>\n<br/>\nPoza tym by vice dyrektor z Waterproofa, rozwijajce dywizj militarn. (skafanry MIL). Mona poczy siy filmowo/ zdjciowo - maj adne skafandry, mam te namiary na warte odwiedzenia targi wojskowe.<br/>\n<br/>\nMwi e w Rotinorze nastpiy roszady pracownikw i z 2 dobrych goci jest 1 kiepski. (dzia eksportowy). Podobno pare lat temu jedzili wszdzie (ci dobrzy) jak wciekli i generalnie byli wszdzie gdzie tylko si dao<e>[/quote]</e></QUOTE>\n\nMoe warto gdzie takie informacje zbiera tematycznie, bo w tym miejscu raczej nikt ich nie znajdzie jak bdzie szuka  <E>:)</E></r>','608889624928d29d1c99e6a52116413e',0,'','1u01d5',1,0,'',0,0,0,1,0,'',0),(154,26,44,61,0,'185.153.39.80',1650623800,0,1,1,1,1,'','Re: Kartownik','<r>od Izy<br/>\n\n<QUOTE><s>[quote]</s>Piotrek mwi, e musz go jeszcze poskada to tak na poow przyszego tygodnia ma by gotowy  <E>:D</E> <br/>\n\n <e>[/quote]</e></QUOTE></r>','4f550cf4999b1372453c0c1955e17787',0,'','1ag76q',1,0,'',0,0,0,1,0,'',0),(155,56,29,61,0,'185.153.39.80',1650624080,0,1,1,1,1,'','Cena','<r>Gdzie w otchani utona mi  informacja o cenie zakupu.<br/>\nKto wie?  <E>;)</E></r>','e1b71c68b724b2c4dfcf90e3a6a8acdd',0,'','5m04pl4b',1,0,'',0,0,0,1,0,'',0),(156,49,11,58,0,'94.232.216.242',1650625261,0,1,1,1,1,'','Re: Wizytwka firmowa w Google','<r>Zdjcie firmy w tle ju poprawione i ustawione jako domylne.<br/>\n\n<ATTACHMENT filename=\"obraz_2022-04-22_125850771.png\" index=\"0\"><s>[attachment=0]</s>obraz_2022-04-22_125850771.png<e>[/attachment]</e></ATTACHMENT>\n\nW wolnej chwili przegldn, co tam mona jeszcze aktualizowa i wzbogaci, do pusta ta wizytwka.</r>','7048dfb16994375e659b1f539e835516',1,'','aok0y3',1,0,'',0,0,0,1,0,'',0),(157,56,29,58,0,'94.232.216.242',1650625557,0,1,1,1,1,'','Re: Cena','<r>Ten zasobnik jest chyba od tego producenta: <URL url=\"https://military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3\"><LINK_TEXT text=\"https://military-suits.com/offer/tactic ... pment-zas3\">https://military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3</LINK_TEXT></URL><br/>\n<br/>\nMog napisa o cennik, chyba, e mamy jakie specjalne ceny u nich.</r>','3934c2d801ca110e4e82883d3df330bc',0,'','1lure',1,0,'',0,0,0,1,0,'',0),(158,29,26,58,0,'94.232.216.242',1650626105,0,1,1,1,1,'','Re: Nurkowe Demo Days Jaworzno, Koparki 14-15.05.22','<r>Na swoim profilu FB, organizatory eventu publikuj informacj o markach i wystawcach. Post taki jest tam darmowy, moemy przygotowa wasny opis i grafik, aby pomc Marcinowi.<br/>\n<br/>\nOdpowied od Marcina:\n<QUOTE><s>[quote]</s> Posty s w ramach \"wstawiania si\", czyli nie s dodatkowo patne. Bdzie te o Seacraft, ale wszystko w swojej kolejnoci. Jak chcecie pomc to prosz przygotujcie materiay i tekst na taki post. <e>[/quote]</e></QUOTE></r>','59308d9a605affaa4d1ccee5344b8fc2',0,'','11862d',1,0,'',0,0,0,1,0,'',0),(159,5,23,60,0,'91.196.8.186',1650626526,0,1,1,1,1,'','Re: 7-9.06.2022 [MIL] UDT Rotterdam, Holandia','<r>Rozmawiaam z Frankiem o materiaach tekstylnych na promocj. Chce zabra ze sob czapki zimowe z polarem i bez polaru, czapki z daszkiem i koszulki militarne. Pewnie baweniane, bo fullprintw jest mao, rozmiarwka nie jest na ten moment uzupeniona, a poza tym po podwyce cen rozdawanie ich to BARDZO zy pomys <E>:oops:</E> <br/>\nWstpnie poprosiam Ig o odoenie dla Franka: <br/>\n- 10 szt czapek zimowych z polarem<br/>\n- 10 szt czapek zimowych bez polaru<br/>\n- 10 szt czapek z daszkiem<br/>\n- po 2-3 szt. (5 w rozmiarze L, XL) t-shirtw bawenianych MIL.<br/>\n<br/>\nDajcie zna jeli te iloci powinny by wiksze/mniejsze, to przeka Idze.</r>','df38ab9298f4f444c8d6915c96949713',0,'','s183t',1,0,'',0,0,0,1,0,'',0),(160,56,29,61,0,'185.153.39.80',1650631349,0,1,1,1,1,'','Re: Cena','<t>Zapytam Piotra,<br/>\non z nimi ustala, ale jest due prawdopodobiestwo, e te wpado w otcha tematw...<br/>\nna pewno kontakt przez niego, sami tego nie bdziemy zaatwia.</t>','33b5c0b244b9b6613b1917b6c31c183f',0,'','c39d1ers',1,0,'',0,0,0,1,0,'',0),(161,56,29,61,0,'185.153.39.80',1650632649,0,1,1,1,1,'','Re: Cena','<r>Do Pakistanu (MIL) kiedy wycenialimy tak: cena bya na pewno podwyszona o 20% upust dla dystrybutora.<br/>\n<br/>\nModel: Dry-bag for sniper rifle - model: \"UNRUG\"  Reference number : M-DB/SR/01.	  1 450,00 	<br/>\n<URL url=\"https://www.military-suits.com/offer/tactical-dry-bags/56-dry-bag-for-sniper-rifle\"><LINK_TEXT text=\"https://www.military-suits.com/offer/ta ... iper-rifle\">https://www.military-suits.com/offer/tactical-dry-bags/56-dry-bag-for-sniper-rifle</LINK_TEXT></URL><br/>\nModel: Dry-bag for military equipment \"UNRUG\"  Reference number : M-DB/01 w wersji 40 l 	  790,00 	<br/>\n<URL url=\"https://www.military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3\"><LINK_TEXT text=\"https://www.military-suits.com/offer/ta ... pment-zas3\">https://www.military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3</LINK_TEXT></URL><br/>\nModel: Dry-bag for military equipment \"UNRUG\"  Reference number : M-DB/01 w wersji 60 l.	  890,00 	<br/>\n<URL url=\"https://www.military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3\"><LINK_TEXT text=\"https://www.military-suits.com/offer/ta ... pment-zas3\">https://www.military-suits.com/offer/tactical-dry-bags/58-day-bag-for-equipment-zas3</LINK_TEXT></URL></r>','a2dfdb50018240815616b407702403f4',0,'','in5w',1,0,'',0,0,0,1,0,'',0),(162,6,20,60,0,'91.196.8.186',1650868829,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Kontaktowaam si z Adamem. Dobra wiadomo jest taka, e <B><s>[b]</s>Adam zaatwi moliwo nagra w Pyrzowicach<e>[/b]</e></B>.<br/>\nPytania od Adama: <br/>\n- w jakich miejscach bdziemy krci? <br/>\n- jaka jest grupa docelowa dla produktu? Adam pyta konkretnie \"mczyni, kobiety, w jakim wieku, single czy rodziny z dziemi,  zwariowane pary, potrzebuje cechy odbiorcy, ktry wedug Was najchtniej to kupi\"<br/>\n- cechy produktu w punktach - informacje podstawowe o produkcie ( waga, dugo szeroko, osigi, jakie dane konstrukcyjne, ktre chcecie  podkreli)<br/>\n- wyjtkowe cechy produktu, ktre czyni go nadzwyczajnym. W punktach opisowo<br/>\n- proba o przesanie zdj produktu<br/>\n- co z naszego punktu widzenia jest wane aby to podkreli?<br/>\n- gdzie film bdzie pokazywany? (jego przeznaczenie i uyteczno)<br/>\n<br/>\nBd przygotowywa odpowiedzi w oparciu o wnioski itp., ale dajcie te zna co sdzicie.</r>','7b361e88a936599130d470c7f5ccb434',0,'','2zh4f0',1,0,'',0,0,0,1,0,'',0),(163,6,20,60,0,'91.196.8.186',1650868908,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<t>I druga kwestia, eby dugo poprzedniego postu Was nie zrazia. <br/>\nPropozycje Adama: <br/>\nMoje pomysy i propozycje:<br/>\n<br/>\n1.	Film bezporedni o produkcie gdzie bohater to produkty, sucha narracja wsparta lektorem i infografikami, ewentualnie tekst na dole. ( Rola takiego filmu jest czysto informacyjna, dla klientw, ktrzy podjli decyzje o zakupie produktu w tym segmencie teraz tylko musz wybra najlepsz ofert)<br/>\n2.	Film o dobrych emocjach, do ktrych kluczem jest Nowy Seacraft. ( Film dla osb szukajcych, by moe nowych klientw, ktrzy szukaj szczcia i radoci, a w ich znalezieniu pomoe im pikna kobieta, super auto czy najlepszy skuter na wiecie. To nie jest film stricte o produkcie a raczej o jego niezastpionej roli  w drodze do szczcia  .<br/>\n3.	Film prezentacyjny,  w ktrym bohater wciela si w role testera i ze swojego punktu widzenia przedstawia produkt. ( To film dla cwaniakw, ktrzy wiedz e najlepiej uczy si na bdach innych ludzi, ale nie tylko, gdy wielu ludzi nie potrafi podj decyzji i dokona wyboru, bo w ich wiecie wie si to z ogromnym bliej niesprecyzowanym ryzykiem. Dlatego kupuj przypadkowo  co bdzie to bdzie, najtaniej aby zminimalizowa straty, lub nie kupuj wcale aby si nie naraa i nie mie wyrzutw sumienia, e znowu dali si oszuka. Dobre dowiadczenie drugiego czowieka, ktry kupi produkt i  teraz opowiada i pokazuje jak bardzo dobry by to wybr, sprawia e wahania i wtpliwoci znikaj, a jeli nawet okae si e zakup by z decyzj  to nie sam kupujcy  jest za ni odpowiedzialny wic ma czyste sumienie. Tacy ludzie wanie potrzebuj takich filmw.<br/>\n4.	A moe macie zupenie inny pomys?</t>','76784e3e0cb34d46ae4eebf383b8dcd6',0,'','d42zg0',1,0,'',0,0,0,1,0,'',0),(164,56,29,58,0,'94.232.216.242',1650954392,0,1,1,1,1,'','Re: Cena','<r>Dry Bag Equipment ten 40/60l mamy zarwno opis (jeszcze do sprawdzenia i korekty) + zdjcia produktowe, zapowied w Newsletterze ju posza.<br/>\n<br/>\nBrakuje:<br/>\n<br/>\n- wycena, dodanie do cennika<br/>\n- dodanie na stron (jak ju wrci do naszej penej kotroli  <E>:roll:</E> )<br/>\n- karta katalogowa<br/>\n- poinformowanie partnerw <br/>\n<br/>\nDry Bag Equipment dodajemy jako produkt REC/MIL, a co robimy z tym na bro dodajemy w pniejszym czasie jako kolejna nowo w ofercie tylko jako produkt pod MIL ?</r>','b7cfd5fe0902553e0d98c17d49bc209a',0,'','27g',1,0,'',0,0,0,1,0,'',0),(165,6,20,58,0,'94.232.216.242',1650954647,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>wietna wiadomo odnonie lotniska. <br/>\n<br/>\nCo do scenariusza, to do odwany pomys Adama, troch odbiega od naszego wstpnego pomysu i pokazania produktu jako dostpnego dla kadego nie tylko dla cwaniakw jak to okreli <E>:D</E> ...ale pomys ma ciekawy z tym ukazaniem z pozycji testera, jeszcze to na spokojnie przemyle i uzupeni komentarz.</r>','7dc2229ded669e4001084c5f3999c0d3',0,'','9c4l',1,0,'',0,0,0,1,0,'',0),(166,29,26,58,0,'94.232.216.242',1650956342,0,1,1,1,1,'','Re: Nurkowe Demo Days Jaworzno, Koparki 14-15.05.22','<r>Kopiuj tutaj, eby by lad i nie utoneo w mejlach. Momey sami stworzy tre i grafik do postw na stronie Eventu.<br/>\n\n<QUOTE><s>[quote]</s>Oglnie mylaem tak:<br/>\n<br/>\nosobny post ktry ukarze si u nas taki czysto informacyjny opisany ze wanie wietna okazja do testowania naszego sprztu na evencie w koparkach ,kiedy i gdzie itd.<br/>\n<br/>\nOraz post z perspektywy ich profilu opisujcy wanie nasz mark i produkt.<br/>\n<br/>\nHarmonogram:<br/>\n<br/>\n-Ten tydzie post u nich (my go sami opisze i wzbogacimy grafik)<br/>\n-Kilka dni przed wydarzeniem post u nas. (zgrane z newsletterem)<br/>\n<br/>\nEwentualnie z dodatkowym sharowaniem z obu stron i podbiciem zasigw:<br/>\n<br/>\nTen tydzie post u nich (my go sharujemy tez u nas) <br/>\nKilka dni przed wydarzeniem post u nas (oni shareuja nasz post u nich)<br/>\n<br/>\nCo o tym sdzicie?\n<e>[/quote]</e></QUOTE></r>','23b4936665aa57c385de8e787f30c5a0',0,'','2wmxx',1,0,'',0,0,0,1,0,'',0),(167,57,31,60,0,'91.196.8.186',1650958464,0,1,1,1,1,'','Wsppraca z Cavebase','<r>Hej, temat wsppracy z Cavebase. <br/>\nWiem, e termin przekazania oficjalnego sprztu si zblia, a Cavebase powoli zaczyna udostpnia filmiki/zbitki relacji/zdj z zapowiedzi tajemniczych nowych sprztw itp. <br/>\nNiemniej jednak, od rozpoczcia z nimi rozmw (kilka miesicy) co rusz (czsto kilka razy w tygodniu) oznaczaj nas na swoich zdjciach. I super, tylko nas na tych zdjciach nie ma <E>:)</E><br/>\nW efekcie mamy np. zdjcie twarzy jednego z czonkw ekipy, na zdjciu oznaczonych jest kilkadziesit osb, w tym nasz profil. Jest to problem, bo na siatce oznacze mamy mnstwo zdj, na ktrych nie ma naszego sprztu, a na tym nam nie zaley. <br/>\nWraz z rozpoczciem z nimi oficjalnej wsppracy pewnie dobrze byoby o tym wspomnie i moe wysa im mae \"wytyczne\", bo oni nas zalej zdjciami swoich twarzy z oznaczeniem \"seacraft\".</r>','676ff9c00114428ef14cac09bab20685',0,'','2qu8w',1,0,'',0,0,0,1,0,'',0),(168,57,31,60,0,'91.196.8.186',1650958781,0,1,1,1,1,'','Re: Wsppraca z Cavebase','<r>Siatka oznacze: <URL url=\"https://www.instagram.com/seacraftdpv/tagged/\">https://www.instagram.com/seacraftdpv/tagged/</URL><br/>\n<br/>\nPrzykady zdj, o ktrych pisaam: <br/>\n<URL url=\"https://www.instagram.com/p/CczkD8oqYmG/\">https://www.instagram.com/p/CczkD8oqYmG/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CbZqjznADk4/\">https://www.instagram.com/p/CbZqjznADk4/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CZzMT8Zqn5j/\">https://www.instagram.com/p/CZzMT8Zqn5j/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CZWYQTOqlTD/\">https://www.instagram.com/p/CZWYQTOqlTD/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CZCgt_oKmhR/\">https://www.instagram.com/p/CZCgt_oKmhR/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CYgcoSsKFGH/\">https://www.instagram.com/p/CYgcoSsKFGH/</URL><br/>\n<br/>\nPewnie uznaj tak form promocji, e naleymy do ich \"ekipy\" wic wszdzie nas oznaczaj. No ale my mamy potem na profilu zdjcia portretowe jaki goci i fotki kolesi przedzierajcych si przez lasy <E>:)</E></r>','3acd31dc2ba63164dece833a0f9d3207',0,'','1yxbx',1,0,'',0,0,0,1,0,'',0),(169,57,31,58,0,'94.232.216.242',1650959325,0,1,1,1,1,'','Re: Wsppraca z Cavebase','<r>W ramach uzupeniania wrzucam screenshot posta, o ktrym mwi Paulina i jak to wyglda  <E>:oops:</E> <br/>\n\n<ATTACHMENT filename=\"279011389_5058072887574185_2561308068651019394_n.jpg\" index=\"0\"><s>[attachment=0]</s>279011389_5058072887574185_2561308068651019394_n.jpg<e>[/attachment]</e></ATTACHMENT>\n\nPomys z wytycznymi oznaczania nas jest wg mnie bardzo dobry. Oznaczenia tak, ale nie w takiej formie gdzie na zjciu nawet nie ma naszego produktu, a caa siatka oznacze.<br/>\n<br/>\nPS. Co do siatki oznacze na naszym profilu, to (o ile si nie myl) mona wej w dane zdjcie gdzie nas otagowali -&gt; opcje oznacze -&gt; usu mnie z oznaczenia, w ten sposb moemy decydowa czy chcemy by oznaczeni na zdjciach, ktre pniej widniej w naszej siatce. Trzeba by to sprawdzi, czy dziaa <E>:)</E></r>','33415ec2c3c4bd12181c292063677101',1,'','i321',1,0,'',0,0,0,1,0,'',0),(170,57,31,60,0,'91.196.8.186',1650959824,0,1,1,1,1,'','Re: Wsppraca z Cavebase','<r>Dziaa, dziaa. Usuwam, niemniej i tak wydaje mi si, e trzeba da im zna, eby oznaczali nas tam gdzie sprzt <E>:D</E></r>','3a9a1707bf2585c1fd8ddaacbde9d1f8',0,'','csnt8yjt',1,0,'',0,0,0,1,0,'',0),(171,56,29,61,0,'94.232.216.242',1650959863,0,1,1,1,1,'','Re: Cena','<r>Maj rne:<br/>\n<URL url=\"https://military-suits.com/offer/tactical-dry-bags\">https://military-suits.com/offer/tactical-dry-bags</URL><br/>\n<br/>\nRaczej kupimy wszystkie po sztuce i porobimy zdjcia.<br/>\nNa targi pasuje mie wszystkie.</r>','75f121a2af9386d381e32e1f4bbed351',0,'','69ah0a',1,0,'',0,0,0,1,0,'',0),(172,58,21,58,0,'94.232.216.242',1650960294,0,1,1,1,1,'','Projekty video o Jaskiniach Sowacja, Chorwacja, Hiszpania - propozycja wsparcia','<r>Martin Strimka videographer/photographer/editor publikujcy swoje artykuy i materiay w magayznie Tauchen pracuje nad kilkoma ciekawymi projektami: dokument o jaskiniach na Sowacji, niedugo potem duy projekt w Chorwacji (rdo Cetina), a nastpnie kolejny projekt w Fuentona de Muriel.<br/>\n<br/>\n<URL url=\"https://www.youtube.com/watch?v=up_MCv29Smc\"><s>[url]</s>https://www.youtube.com/watch?v=up_MCv29Smc<e>[/url]</e></URL><br/>\n<br/>\n<URL url=\"https://www.youtube.com/watch?v=HKlfxRXy8co\"><s>[url]</s>https://www.youtube.com/watch?v=HKlfxRXy8co<e>[/url]</e></URL><br/>\n<br/>\nW skrcie, <br/>\n<br/>\nMartin jest zadowolony z naszego sprztu ale bd potrzebowali jeszcze min 2 skutery i system montowania kamer co jak Muzeum Malta i to byyby jego oczekiwania co do naszego wsparcia w tym projekcie.<br/>\n<br/>\nCo nam oferuj, ekspozycje naszego sprztu, dostp i moliwo wykorzystania materiaw przez nas. Kolejny argument Maritna, ktry ma nas zachci do wsppracy to jego status redaktora/fotografa w magazynie TAUCHEN gdzie rwnie moe nas umieci na materiaach o ktrych bdzie pisa.<br/>\n<br/>\nInteresuj nas wsparcie takich projektw? <br/>\nMoemy im zaoferowa, podobn form wsparcia jak Museum w Malcie? (tu nie znam jakie tam byy szczegy ?)<br/>\n<br/>\nKupno skuterw z rabatem ? W zamian za materiay i ekspozycja naszych produktw na nich?<br/>\n<br/>\nCo sdzicie?<br/>\n<br/>\nponiej oryginalna tre wiadomoci od Martina:<br/>\n\n<QUOTE><s>[quote]</s>\n<br/>\nHi Damian,<br/>\n <br/>\nI will skip introducing myself as I believe that visual material always tells more than words.<br/>\n<br/>\nIm a big fan of your dpvs. (They are highly benefitial for tec divers) but judging from videographer\'s perspective they can add absolutely unique feature to my sequences.<br/>\nHonestly, Im confident to say that using them I can produce footage nobody has seen before. <br/>\n<br/>\nCurrently we are working on a cave documentary in Slovakia, but shortly after that we will shoot a big project in Croatia (Cetina spring) followed by another project in Fuentona de Muriel.<br/>\n<URL url=\"https://www.youtube.com/watch?v=up_MCv29Smc\">https://www.youtube.com/watch?v=up_MCv29Smc</URL><br/>\n<br/>\nThese happen to be organized by UTD headquarters with big names in cave diving world. <br/>\n<br/>\nFor me and my model, we need dpvs. These will be clearly seen in majority of sequences and will represent great exposure for your products.<br/>\nThe sequences will also be available for you to use according to your needs.<br/>\n<br/>\n<URL url=\"https://www.youtube.com/watch?v=HKlfxRXy8co\">https://www.youtube.com/watch?v=HKlfxRXy8co</URL><br/>\n<br/>\nMy current status in TAUCHEN magazine as house photographer/editor allows me to deliver resonable exposure through articles I write, which can also be highly benefitial to Seacraft.<br/>\n<br/>\nWould you like to support us?<br/>\n<br/>\n---------<br/>\n<br/>\nI\'m glad that our projects sparked your interest and so I\'m happy to describe in detail.<br/>\n<br/>\nMy goal is simple - capturing highest quality visual material - photo and video. Therefor I focus on procedures and technologies that are able to push my capabilties further. With using Seacraft dpv I\'am able to add smoothness and dynamics to video sequences that wouldn\'t be possible otherwise. The other dpv needs to be on the photos and videos, hence we would always need 2 pieces. This way I would be able to feature the product and deliver matching material for you to use on your ad channels.<br/>\n<br/>\nAs for the project dates, we are quite active all the time, but the Cetina spring will take place in June. For the spanish project we do not have exact dates yet.<br/>\n<br/>\nWreck of Haven (Arenzano) and Maris (Vis) are the next events we are going to document this year. <br/>\n<br/>\nWhat I offer: Like I said, as an exchange for your support I offer not only exposure in all materials I produce and publish, but also offer sequences for your marketing and other use.<br/>\n<br/>\nWhat do I need: 2 Dpv and possibly a camera mounting console. <br/>\n<br/>\nHave a nice day,<br/>\nMartin\n<e>[/quote]</e></QUOTE></r>','c0324a378c32718949f45c720c20882b',0,'','101mh7s',1,0,'',0,0,0,1,0,'',0),(173,57,31,60,0,'91.196.8.186',1650960307,0,1,1,1,1,'','Re: Wsppraca z Cavebase','<r>Ok, koniecznie trzeba im powiedzie. Cavebase to kilkunastu (?) nurkw i wikszo z nich tak oznacza. Teraz ju wiem skd ten spam. <br/>\n<URL url=\"https://www.instagram.com/p/CZZowbcqG99/\">https://www.instagram.com/p/CZZowbcqG99/</URL><br/>\n<URL url=\"https://www.instagram.com/p/CYwvL6SqDMe/\">https://www.instagram.com/p/CYwvL6SqDMe/</URL><br/>\nZ Damianem zastanawiamy si czy takie \"spamowe\" oznaczenia wielu profili na jednym zdjciu nie wpywaj na obnienie zasigw tych profili.</r>','9198157a75c15f7d47d4b420779e00d9',0,'','15',1,0,'',0,0,0,1,0,'',0),(174,59,25,61,0,'94.232.216.242',1650968229,0,1,1,1,1,'','09.2022 [MIL] Prezentacja sprztu dla wszystkich 3 (lub 4) jednostek specjalnych w Gdyni.','<r>Z maila od Piotra:\n<QUOTE><s>[quote]</s>We wrzeniu mam ustalone z DKWS i AMW prezentacj naszego sprztu dla wszystkich 3 (lub 4) jednostek specjalnych w Gdyni. <br/>\nZe wzgldu na aktualn sytuacj dokadny termin DKWS moe ustali dokadnie dopiero w sierpniu.  <e>[/quote]</e></QUOTE></r>','c28801cb6e53affa345969af4a175687',0,'','jsn',1,0,'',0,0,0,1,0,'',0),(175,60,5,63,0,'85.221.240.2',1650971297,0,1,1,1,1,'','Cykl Patenty','<t>Hej<br/>\n<br/>\nZgodnie z prob od Pauliny, propozycje postw o patentach Seacrafta:<br/>\n<br/>\n1. Silnik pracujcy w wodzie - zastrzeony przez nas<br/>\n2. Patent na przyciski piezo <br/>\n3. Patent na system zatrzaskw (jak bdzie przyznany - do weryfikacji)<br/>\n<br/>\nW tej chwili jest kilka cyklu w toku, jak bdziemy potrzebowa tekstw - napiszemy. Kiedy chcielibycie to ew. puci?</t>','e2e52c20a3e8ba27ca1f0bfc3a987874',0,'','1babd',1,0,'',0,0,0,1,0,'',0),(176,57,31,63,0,'85.221.240.2',1650971418,0,1,1,1,1,'','Re: Wsppraca z Cavebase','<r>Jak najbardziej - jeli tryb oznaczania na IG nam nie odpowiada, piszcie do nich. Mail kontaktowy do koordynatora promocji: <EMAIL email=\"steffen.burger@cavebase.de\">steffen.burger@cavebase.de</EMAIL><br/>\n<br/>\nMoecie mnie dorzuci DW.<br/>\n<br/>\nSzkicowo, event przekazania- \'oficjalnie\' inaugurujcy wspprac, to 25-26.06</r>','30ee191eff62178ce72eff6a4699b5a0',0,'','k3hwvl0',1,0,'',0,0,0,1,0,'',0),(177,18,15,63,0,'85.221.240.2',1650971508,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<t>Ustalmy dat kiedy wysyamy - targi UDT s ju niedugo, trzeba moim zdaniem puci go w przyszym tygodniu.</t>','8b53c1393ac823fa721b3326667a5740',0,'','2o33f20l',1,0,'',0,0,0,1,0,'',0),(178,6,20,63,0,'85.221.240.2',1650972042,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Hej<br/>\n<br/>\nOpcja 1 - suchy film o produkcie, moim zdaniem niezbyt pasuje<br/>\nOpcja 2 - elementy tak, ale raczej w kontekcie szczcie nurkowego, a nie oglnego <E>;)</E> Czyli, ew. zestawienie/ sparowanie nieszczliwego nurka na wakacjach ktry chce poyczy skuter, ale nigdzie nie ma i potem jest nieszczliwy- musi pywa z buta <E>;)</E>, a jego kolega przylecia ze swoim GO! i spdza swietnie czas.<br/>\nOpcja 3 - hmmm....<br/>\n<br/>\nMyl e majc na uwadze nono i przekaz, troszk musiaoby to by poczenie wszystkich skadowych. Czyli - film fabularyzowany z dodaniem elementw marketingowo/prezentacyjno/ promocyjnych.<br/>\nNiepozorny pocztek (jeszcze nie wiemy e jest to film o skuterze - ale, wypuszczany przez Seacrafta, wic zainteresuje \'o co tu dalej bdzie chodzi :&gt;\'). Para? Samotny go? (targetem s gocie 35-50, wic opcja e leci sam i tam spotyka pikne dziewczyny na pewno nie zaszkodzi <E>;)</E>)(rwnie para, oraz szczliwa ona ktra ma leciutku skuter wydaje si kuszca) - lec razem na wakacje nurkowe. (REC/ REC-TEC). Scenka szybkiego niadania w domu <E>;)</E>? Pakowanie sprztu, wliczajc w to GO!, odprawa, kontrola bezpieczestwa, (moemy zestawi obok gocia ktry prbuje przewie np. du bateri od konkurencyjnego skutera <E>:)</E>?) widok ze rodka samolotu, start, ldowanie...<br/>\n<br/>\nSzybkie zoenie sprztu i tu nastpuje cz reklamowa- pywanie pod wod, wchodzienie do wody i cay zestaw pokazujcy kluczowe cecny GO! (adowanie! otwarty skuter i trymowanie!)<br/>\n<br/>\nTu moe kadry pokazujce szczcie uytkownika?<br/>\n<br/>\nNa koniec mona da przebitki z nurkowa TECH/ Jaskiniowych/ wrakowych i innych powaniejszych- w formie demwki. Ekran kocowy, GO! Seacraft- Seacraft GO! i voila...<br/>\n<br/>\nLuna idea z mojej strony.</r>','b820f1938c9d28e137c3814e9e36894d',0,'','1mbhmn1',1,0,'',0,0,0,1,0,'',0),(179,58,21,63,0,'85.221.240.2',1650972487,0,1,1,1,1,'','Re: Projekty video o Jaskiniach Sowacja, Chorwacja, Hiszpania - propozycja wsparcia','<t>Hej<br/>\nNie pisze dokadnie e ma ju nasze skutery - ma? Pywa? <br/>\n<br/>\nMoemy zaproponowa znik na zakup, bd wypoyczenie na czas projektu. Moliwe e bdzie zainteresowany zakupem 1 i wypoyczeniem 1 dodatkowego na czas pywania.<br/>\n<br/>\nTo dobry gociu, aktywny na Sowacji. Warto napisa e jedyne co moemy zaoferowa to znika na zakup - dokadny % do ustalenia na bazie zwrotw marketingowych i jego dziaa, poniewa moliwe e oczekuje e dostanie 2 skutery za free, co moe by cikie.<br/>\n<br/>\nWarto zapa ten kontakt.</t>','02a675aa35bf43d4c7b7cfa26bc3b08d',0,'','1pxn',1,0,'',0,0,0,1,0,'',0),(180,56,29,63,0,'85.221.240.2',1650972671,0,1,1,1,1,'','Re: Cena','<t>Czy worki dedykowane do transportu uzbrojenia, nie bd podpada pod koncesj?<br/>\n<br/>\nJeden worek na bro, i worek 40l (transportowy) powinny wystarczy do prezentacji na ywo + karty katalogowe pozostaych.</t>','8424850e549b5b4508df597d1c69b232',0,'','456tr',1,0,'',0,0,0,1,0,'',0),(181,54,40,63,0,'85.221.240.2',1650974986,0,1,1,1,1,'','Re: Niezbdne zmiany w cenniku special','<t>Wgrane w trybie zmian jako V3.<br/>\n<br/>\nCaoc oparta na zaoeniu e nie chcemy w aktualnych kartach ofertowa sprztu i akcesoriw starszej generacji - ktry jest oczywicie dostpny dla aktualnych uytkownikw, ale w cenniku \'zbiorczym\', a karty katalogowe zawieraj tylko i wycznie \'latest and greatest\'.<br/>\n<br/>\n<br/>\n-Do zastanowienia, czy w typowych czciach zamiennych nie da dodatkowo poszczeglnych pozycji (jak zapasowe przyciski), bd przynajmniej rozwin co wchodzi w skad  \'spare parts set\'.<br/>\n<br/>\n-We wszystkich:<br/>\nTUM1758	Coupling connector\'s set - front and rear - 1 pieces		  150 <br/>\n<br/>\nPowinno by  \'1 piece\'</t>','d6f99394bd3203db370955cc5c5c42da',0,'','8x5ajfrj',1,0,'',0,0,0,1,0,'',0),(182,61,36,63,0,'85.221.240.2',1650976945,0,1,1,1,1,'','Warunki wsppracy- centra DEMO Seacrafta','<t>Wypada opracowa system wsppracy i zniek do zakupu sprztu, dla centrw DEMO.<br/>\nAktualne zaoenia bazowe :<br/>\n<br/>\n-centra DEMO nie sprzedaj sprztu - yj z wynajmu/ wypoyczania<br/>\n-z uwagi na to, potrzebuj wikszej zniki na zakup<br/>\n-dealerzy mog swobodnie wysya klientw do centrum DEMO (np. Niemcw na wakacje do Meksyku, czy na Malt).<br/>\n-Z definicji s to rejony ze znikomym rynkiem wasnym, oraz du iloci odwiedzajcych z rnych krajw<br/>\n<br/>\nPropozycja:<br/>\n-Seria Future/Ghost - 30% zniki<br/>\n-GO! 50% zniki <br/>\n-Minimum 1 skuter serii F/G, minimum 3 skutery cznie + ENC<br/>\n-Max - czy chcemy definiowa?<br/>\n<br/>\nSprzt nie do odsprzeday przez ...4 ? lata</t>','cf2a54e0abafdba61fbdff6ddc565503',0,'','mdblk1w',1,0,'',0,0,0,1,0,'',0),(183,62,43,63,0,'85.221.240.2',1650978355,0,1,1,1,1,'','Sesja zdjciowa Irena Stangieska- Czerwiec?','<t>Irenka planuje powoli wyjazdy. Prosi o skoordynowanie dat sesji zdjciowej z nami.<br/>\n<br/>\nU niej:<br/>\n<br/>\nIrena Stangierska<br/>\nMamy Zenobie na koniec maja i safari wrakowe ktre sama organizuje na koniec czerwca</t>','ca5cd7820eec8a672bb1c8794b65b764',0,'','6isj',1,0,'',0,0,0,1,0,'',0),(184,62,43,61,0,'94.232.216.242',1650983077,0,1,1,1,1,'','Re: Sesja zdjciowa Irena Stangieska- Czerwiec?','<r>Wtedy bdzie ju - mam nadziej - skuter GO!  <E>:D</E> <br/>\nProfesjonalna sesja bdzie bardzo potrzebna.<br/>\n<br/>\nUstal z ni warunki i kiedy musi dosta skuter, moe jeszcze co obfotografuje?</r>','6173ddc95ba1c13752153be675f0d43d',0,'','5twmegpk',1,0,'',0,0,0,1,0,'',0),(185,62,43,63,0,'85.221.240.2',1650991444,0,1,1,1,1,'','Re: Sesja zdjciowa Irena Stangieska- Czerwiec?','<t>Safari wrakowe jest w Egipcie, Zenobia- Cypr. Obie opcje to transport lotniczy, raczej w gr wchodzi tylko GO!/ poczenie GO! wraz z ENC.<br/>\n<br/>\nZobacz czy ma w ogle modeli ktrzy mogli by by fotografowani w trakcie dziaa, jeli ma to zrobi niezalenie od nas na swoim wyjedzie.</t>','72e4d52c380bdd856d8bc7b1329fc5f3',0,'','31grxp',1,0,'',0,0,0,1,0,'',0),(186,62,43,63,0,'85.221.240.2',1650993584,0,1,1,1,1,'','Re: Sesja zdjciowa Irena Stangieska- Czerwiec?','<t>Egipt- jest to safari dla fotografw podwodnych prowadzone przez Irenk. Bdzie niedobr modeli, natomiast uzyski zdjciowe jeli dostarczymy modela ze skuterem mog by spore.   No i kadry pikne...<br/>\n<br/>\nA moe Irenka niech jedzie do Chorwacji z nami? Wstpnie by jej pasowao.<br/>\nWtedy narobimy te zdj absolutnie wszystkiego. Reb tlenowy i fotki MIL rwnie bd.<br/>\n<br/>\nInna opcja jak proponuje Irenka to wyjazd na Sardyni.</t>','dbcc4e4e189baeaf7d75f83f116eeb89',0,'','v7zsgjl',1,0,'',0,0,0,1,0,'',0),(187,57,31,61,0,'185.153.39.80',1650999062,0,1,1,1,1,'','Re: Wsppraca z Cavebase','<t>Prawdopodobnie Frank bdzie si musia na event pofatygowa, bo data wyjazdu na HR na pewno si przesunie.</t>','c4314a6260044d98db349d2f5a4fdcbe',0,'','fiii',1,0,'',0,0,0,1,0,'',0),(188,62,43,61,0,'185.153.39.80',1650999716,0,1,1,1,1,'','Re: Sesja zdjciowa Irena Stangieska- Czerwiec?','<r>Fajn modelk jest Ania Pako.<br/>\nMoe jej zaproponowa?<br/>\nWiem, e jeste najlepszy  <E>:D</E>  ale pasuje mie inne osoby na zdjciach.<br/>\n<br/>\nNa Chorwacji bdzie Sawek i to wystarczy.</r>','f4d83bb7ff7d6374b638bf34ac05c10a',0,'','9dhc',1,0,'',0,0,0,1,0,'',0),(189,58,21,58,0,'192.162.175.145',1651007310,0,1,1,1,1,'','Re: Projekty video o Jaskiniach Sowacja, Chorwacja, Hiszpania - propozycja wsparcia','<r>Nie posiada, ale zna i pywa std jego ch i pewno co do uycia ich w projekcie.<br/>\n<br/>\n<URL url=\"Mo%C5%BCemy%20zaproponowa%C4%87%20zni%C5%BCk%C4%99%20na%20zakup,%20b%C4%85d%C5%BA%20wypo%C5%BCyczenie%20na%20czas%20projektu.%20Mo%C5%BCliwe%20%C5%BCe%20b%C4%99dzie%20zainteresowany%20zakupem%201%20i%20wypo%C5%BCyczeniem%201%20dodatkowego%20na%20czas%20p%C5%82ywania.\"><s>[url]</s><LINK_TEXT text=\"Moemy zaproponowa znik na zakup, b ... pywania.&#10;\">Moemy zaproponowa znik na zakup, bd wypoyczenie na czas projektu. Moliwe e bdzie zainteresowany zakupem 1 i wypoyczeniem 1 dodatkowego na czas pywania.\n</LINK_TEXT><e>[/url]</e></URL><br/>\n<br/>\nPogadam z nim/zbadam temat.</r>','c9f1ea357be329be6eb01ca0b53ebc06',0,'','hisxg',1,0,'',0,0,0,1,0,'',0),(190,18,15,58,0,'94.232.216.242',1651038770,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<r>Proponuj po ddugim weekendzie, moe czwartek 05.05.2022, jak ju si kady odkopie z maili i nasz newsletter nie zaginie w akcji <E>;)</E><br/>\n<br/>\nPropozycje tematw?<br/>\n<br/>\n1. Targi UDT<br/>\n<br/>\n2. Info o planowanym wprowadzeniu zasobnikw pod MIL (tych na bro) ? Czy czekamy dopiero jak je wprowadzimy do oferty sprzedaowej?<br/>\n<br/>\n3. ...</r>','96a61f08cd6c2a1f9fa88e001fa0d7d5',0,'','3i3s50',1,0,'',0,0,0,1,0,'',0),(191,61,36,61,0,'185.153.39.80',1651038973,0,1,1,1,1,'','Re: Warunki wsppracy- centra DEMO Seacrafta','<t>Dystrybutorzy maj mie na GO! 30% upustu? Chyba tak ustalalimy?<br/>\n<br/>\nOdnonie warunkw - przelicz i dam zna. 50% to zdecydowanie za duo na GO! Nie wiem czy bdzie na to miejsce.</t>','c8c3696d59da9639ad298bbe634ed2ca',0,'','2xkvjs',1,0,'',0,0,0,1,0,'',0),(192,7,41,58,0,'94.232.216.242',1651039115,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<r>Na wniosek pani Beaty, rozbilimy kategori targi i eventy na osobne fora (bez subkategorii), tak eby byy atwiej widoczne i uyteczne. <br/>\n\n<ATTACHMENT filename=\"obraz_2022-04-27_075827466.png\" index=\"0\"><s>[attachment=0]</s>obraz_2022-04-27_075827466.png<e>[/attachment]</e></ATTACHMENT>\n\nKady temat eventu bdziemy nazywa od daty, a nastpnie nazwy aby byo atwiej si w nich odnale.<br/>\n<br/>\nProponuj nazewnictwo tematw wg wzoru:<br/>\n<br/>\nData [REC/MIL] Nazwa eventu, miejsce.</r>','4c3521d3160f5cfa21e97f68558aa702',1,'','348wft',1,0,'',0,0,0,1,0,'',0),(193,18,15,61,0,'185.153.39.80',1651039403,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<t>Zasobniki<br/>\nNie bdzie zdj zasobnikw do 5 maja, ale to bdzie dobre info za miesic.<br/>\n<br/>\nCzekamy na ofert cenow wszystkich dostpnych zasobnikw eby mie na magazynie po 1 sztuce (do pokazania ju na targach UDT mam nadziej).<br/>\nJednak zdjcia poszczeglnych zasobnikw si rni, std trzeba mie wszystkie.<br/>\n<br/>\nMoe  informacja o nowych typach sprzgw - chyba e ju to byo ostatnio?</t>','e73b1fca064c323ed4cc16a5131978dd',0,'','s0vvt0',1,0,'',0,0,0,1,0,'',0),(194,57,31,63,0,'85.221.240.2',1651043217,0,1,1,1,1,'','Re: Wsppraca z Cavebase','<t>Chyba e HR np. 27.06-10.07?<br/>\n <br/>\nZ brakiem gotowoci DPC na lipiec, pojawia si tam okienko...</t>','c8c97a49a96984bc37110f638f0f3a46',0,'','62rsszy',1,0,'',0,0,0,1,0,'',0),(195,18,15,63,0,'85.221.240.2',1651043333,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<t>Nowy typ sprzgw <br/>\nNowy modu GPS (typ B) i jego standaryzacja<br/>\nNowy katalog MIL -zapraszamy do kontaktu po niego<br/>\nUDT<br/>\n<br/>\n...i bdzie.<br/>\n<br/>\nCo do zasobnikw na UDT. Moim zdaniem ma sens mie na stoisku 2 rne, wicej - zrobi si \'kramik\' z zasobnikami.</t>','6f24cd9cd2950dcae563fb035cc3633b',0,'','l0gu',1,0,'',0,0,0,1,0,'',0),(196,62,43,63,0,'85.221.240.2',1651043596,0,1,1,1,1,'','Re: Sesja zdjciowa Irena Stangieska- Czerwiec?','<t>Ania ma w tej chwili mae szczeniaki - Roja rodzia, wtpi e by reflektowaa, zwykle te nurkuj razem ze Sawkiem. (szczeglnie CCR)<br/>\n<br/>\nJak by to mogo kosztowo dla nich wyglda za zabranie skuterka i skupienie si na pozowaniu z nim - pewnie jak MT dopaci do wyjazdu to bdzie to bardziej motywujce. Podpytam Irenki jak wyglda cay koszt safari.</t>','0d309eb496c5149c85096f66637a9f21',0,'','6pf',1,0,'',0,0,0,1,0,'',0),(197,60,5,60,0,'91.196.8.186',1651044025,0,1,1,1,1,'','Re: Cykl Patenty','<t>Dasz rad na czerwiec/lipiec?</t>','171f8b589ba16dd0b1119ad31cac4f29',0,'','gs66kfh',1,0,'',0,0,0,1,0,'',0),(198,62,43,63,0,'85.221.240.2',1651045533,0,1,1,1,1,'','Re: Sesja zdjciowa Irena Stangieska- Czerwiec?','<t>S miejsca. Koszt safari:<br/>\n<br/>\n900e plus tipy 175e plus przelot 2050pln<br/>\n6 dni, 3-4 nurkowania dziennie, cay zesp nastawiony na fotografi podwodn. (Irena prowadzi warsztaty fotograficzne)</t>','08f53bfa7fd17655b6ce59b3390aca0e',0,'','3a96hn',1,0,'',0,0,0,1,0,'',0),(199,62,43,61,0,'185.153.39.80',1651053733,0,1,1,1,1,'','Re: Sesja zdjciowa Irena Stangieska- Czerwiec?','<t>Witek skupia si na znalezieniu modela - sfinansujemy czciowo koszt wyjazdu.<br/>\nTermin niestety nakada si z kilkoma innymi i ani Paki ani Witek nie maj moliwoci wyjazdu.<br/>\n<br/>\nTe zdjcia bd bardzo przydatne o ile nie kluczowe do naszego katalogu produktowego z GO!</t>','a4c6b243352e7786b188c55cff2e2823',0,'','6yynqmnm',1,0,'',0,0,0,1,0,'',0),(200,5,23,61,0,'185.153.39.80',1651056048,0,1,1,1,1,'','Re: 7-9.06.2022 [MIL] UDT Rotterdam, Holandia','<t>Piotr robi wizualizacj, od wczoraj niestety walczy z aktualizacj ansysa niestety.</t>','2d3d15e2f924e7cf6423b15c12e5e447',0,'','dner',1,0,'',0,0,0,1,0,'',0),(201,29,26,58,0,'94.232.216.242',1651061389,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<r>Przed wysaniem do Marcina Bramsona, najpierw wrzucam tataj, abymy mogli ustali jak to widzimy.<br/>\n<br/>\nMoja propozycja:<br/>\n<br/>\n<B><s>[b]</s>28.04.2022 - Post wrzucony na profirl organizatora eventu Nurkowe Demo days:<e>[/b]</e></B><br/>\n\n<QUOTE><s>[quote]</s>Prezentujemy kolejny brand, ktry bdziecie mogli spotka i testowa sprzt na naszych Demo Days - Seacraft (to bdzie podlinkowana na nasz page) polski producena skuterw DPV reprezentowany przez Marcina Bramsona z Deep Adventure (to bdzie podlinkowane do strony Marcina)<br/>\nSkutery Seacraft to to jedyne DPV wiecie, ktrych silnik pracuje bezporednio w wodzie.  W produkcji maszyn bazujcej na wieloletnich badaniach i rozwoju zastosowano nowatorskie rozwizania w zakresie konstrukcji skutera, ktre nie byy dotychczas stosowane w tego typu urzdzeniach takich jak: silnik pracujcy na penym zanurzeniu, brak momentu obrotowego, szybko, zwrotno, cicha praca, wyjcie na ogrzewanie i wiele innych cech. <br/>\nWybierajc produkty Seacraft otrzymujesz najbardziej innowacyjnym produkt dostpny obecnie na rynku, serwis, wsparcie i obsuga na miejscu w autryzowanych punktach sprzeday.<br/>\n<br/>\nNa Nurkowych Demo Days prezentowane i udostpniane do testw bd flagowe modele skuterw Seacraft ,a take elektoniczne konsole nawigacyjne ENC3.<br/>\n<br/>\nPrzyjd i spotkaj si z przedstawicielami Seacraft osobicie, odpowiedz na wszystkie Twoje pytania i pomog w przetestowaniu sprztu.\n<e>[/quote]</e></QUOTE>\n\nPropozycja grafiki do posta:<br/>\n\n<ATTACHMENT filename=\"demo days scooter.jpg\" index=\"2\"><s>[attachment=2]</s>demo days scooter.jpg<e>[/attachment]</e></ATTACHMENT>\n\n<br/>\n<B><s>[b]</s>04.05.2022 - Post wrzucony na nasz profil fb + stories na insta:<e>[/b]</e></B><br/>\n<br/>\nTutaj zastanawialimy si z Paulina, e pomimo e naszym oficjalnym jzykiem komunikacji jest angielski, to ze wzgldu na to, e wydarzenie jest w Polsce tekst da zarwno w jzyka polskim jak i angielskim. Tekst nie za dugi bardziej informacyjny zaczynajcy si od ikonki flagi polskiej dla tekstu po PL i od flagi brytyjskiej dla tekstu po angielsku, eby to adnie i przejrzycie wygldao.<br/>\n\n<QUOTE><s>[quote]</s>Zawsze powtarzamy, e najlepszym sposobem poznania moliwoci naszych skuterw jest ich przetestowanie samemu w wodzie. Serdecznie zapraszamy na 11 edycj Nurkowych Demo Days. Przyjd i spotkaj si z nami osobicie, odpowiemy na wszystkie pytania i pomoemy w przetestowaniu sprztu.<br/>\n14-15.05.2022, Via Sport Diving Marina \"Koparki\", Jaworzno.\n<e>[/quote]</e></QUOTE>\n\n<QUOTE><s>[quote]</s>\nWe always say that the best way to find out features about our scooters is to test them by yourself in the water. We would like invite you to the 11th edition of Diving Demo Days. Come and meet us in person, we will answer all your questions and help you test the equipment.<br/>\nMay 14-15, 2022, Via Sport Diving Marina \"Koparki\", Jaworzno.<e>[/quote]</e></QUOTE>\n\n2 propozycje grafik, oba bazujace na fotkach Ireny wanie z \"Koparki\".<br/>\n\n<ATTACHMENT filename=\"nurkowe demo days.jpg\" index=\"0\"><s>[attachment=0]</s>nurkowe demo days.jpg<e>[/attachment]</e></ATTACHMENT>\n\n<ATTACHMENT filename=\"nurkowe demo days2.jpg\" index=\"1\"><s>[attachment=1]</s>nurkowe demo days2.jpg<e>[/attachment]</e></ATTACHMENT></r>','0dd25078516a8178b66b17c21bab8a2e',1,'','6sucd',1,0,'',0,0,0,1,0,'',0),(202,29,26,60,0,'91.196.8.186',1651063218,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<t>Fajny pomys z  wykorzystaniem zdjcia Ireny z koparek- tematycznie do wydarzenia. Pytanko: czy moemy uy jej zdj? Czy powinnimy wczeniej zapyta, bo jednak bdzie to co innego ni udostpnienie na instagramie.<br/>\n<br/>\nMi bardziej podoba si ta pierwsza propozycja ze zdjciem Ireny, ale obie s ok. Teksty spoko i wersja polsko i angielskojzyczna jak najbardziej fajnie.</t>','bc9cacf29d980b70568b3123f4bc4fce',0,'','7mcj2mq',1,0,'',0,0,0,1,0,'',0),(203,29,26,63,0,'85.221.240.2',1651064061,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<r>Hej<br/>\nTroszk przeredagowana propozycja tekstu niej. Dopytaj Marcina czy bdzie bezproblemowe wypoyczanie sprztu do wody, czy np. na zapisy (trzeba by w tym pocie na dole to zaznaczy), plus np. informacja e tylko dla certyfikowanych nurkw DPV.<br/>\n\n<QUOTE><s>[quote]</s>Prezentujemy kolejn mark, ktr bdziecie mogli zobaczy i przetestowa na Nukowych Demo Days - Seacraft, polski producent skuterw podwodnych . (to bdzie podlinkowana na nasz page) <br/>\nSkutery Seacraft jako jedyna na wiecie uywaj silnika pracujcego bezporednio w wodzie. Specjalnie zaprojektowana i opatentowana konstrukcja  pozwala na cakowit eliminacj wau napdowego oraz koniecznoci stosowania zawodnych uszczelnie i przekadni.<br/>\nDodatkowe korzyci takie jak potna moc, absolutnie cicha praca jak i niezwyka wydajno pracy s efektem wieloletnich bada i rozwoju, ktre doprowadziy do wdroenia innych unikalnych rozwiza, niespotykanych wczeniej na rynku skuterowym. Kierownica strug, ktra zwiksza wydajno pracy i redukuje do zera efekt skrcania rczki, graficzny wywietlacz parametrw oraz zewntrzne gniazdo adowania - bdce jednoczenie miejscem podczenia opcjonalnego wyjcia 12V do systemw grzewczych to tylko niektre z nich.<br/>\n<br/>\nPrzyjd i spotkaj si z przedstawicielami Seacraft osobicie, by pozna wszystkie. Secraft w Polsce jest reprezentowany przez Marcina Bramsona z Deep Adventure (to bdzie podlinkowane do strony Marcina). Wybierajc produkty Seacraft otrzymujesz najbardziej innowacyjny produkt dostpny obecnie na rynku, a take serwis, wsparcie i obsug realizowan bezporednio w kraju.<br/>\n<br/>\nNa Nurkowych Demo Days prezentowane i udostpniane do testw certyfikowanym do obsugi skuterw nurkom bd flagowe modele skuterw Seacraft ,a take elektoniczne konsole nawigacyjne ENC3.<br/>\n\n<e>[/quote]</e></QUOTE>\n\nGrafika- elegancko <E>;)</E> Dabym moe \'Come and test Seacraft at Demo Days\' ew. DPV w liczbie mnogiej<br/>\n<br/>\nPierwsza chyba lepsza, dwujzyczno - najlepiej tak jak piszesz, w kocu jestemy polskim producentem. Z ikonk brytyjsk uwaga na USA... Nie wiem czy nie lepiej da skrtu jzykw: [PL] , [EN] (moe s takie w emotkach FB?)</r>','dea95238ba96f6f51cbf1b4e2c154907',0,'','6ec6q',1,0,'',0,0,0,1,0,'',0),(204,29,26,63,0,'85.221.240.2',1651064915,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<t>Podelijcie najlepiej Irence z pytaniem o publikacj z jej zdjciem. Wtpi eby miaa co przeciwko, warto j otagowa.</t>','50da99c0065307abb8ebeb497c5af16c',0,'','cxodilt',1,0,'',0,0,0,1,0,'',0),(205,29,26,58,0,'94.232.216.242',1651065163,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"203\" time=\"1651063218\" user_id=\"60\"><s>[quote=\"Witold Hoffmann\" post_id=203 time=1651063218 user_id=60]</s>\nCome and test Seacraft at Demo Days\' ew. DPV w liczbie mnogiej\n<e>[/quote]</e></QUOTE>\n\nTrafna uwaga, lepiej.<br/>\n<br/>\nDziki Witku, za wzbogacenie techniczne tekst, brzmi lepiej <E>:)</E> <br/>\n<br/>\nTe ikonki ikonki trzeba bdzie faktycznie zwrci uwag, sprawdz jak to bdzie wyglda.<br/>\n\n<QUOTE author=\"Paulina &#x15A;l&#x119;zak\" post_id=\"202\" time=\"1651063218\" user_id=\"60\"><s>[quote=\"Paulina lzak\" post_id=202 time=1651063218 user_id=60]</s>\nPytanko: czy moemy uy jej zdj? Czy powinnimy wczeniej zapyta, bo jednak bdzie to co innego ni udostpnienie na instagramie.\n<e>[/quote]</e></QUOTE>\n\nPaulina, dasz rad j zapyta? zapewne wystarczy formuka, ze wyraa zgod, jeeli obecna umowa (?) wsppracy z ni tego nie okresla.<br/>\n<br/>\n1 wersja grafiki to te by mj faworyt <E>;)</E></r>','0293bba91f2cb3472d3fb00236cc54e8',0,'','tluunl4',1,0,'',0,0,0,1,0,'',0),(206,63,36,63,0,'85.221.240.2',1651065647,0,1,1,1,1,'','Warunki wsppracy - uzupenienia 2022','<t>Na bazie napotykanych pyta/ problemw, do dodania:<br/>\n<br/>\n-Informacja o warunkach wykonywania grawerw, oraz grawerach DEMO na maszynach DEMO<br/>\n-Aktualizacja o zamwieniach - tylko i wycznie e-sklep, pierwsze zamiwienie \'rcznie\', pniej utworzenie konta w sklepie</t>','76c62c2685d06e914f469f98c9dda55d',0,'','7jfuh',1,0,'',0,0,0,1,0,'',0),(207,63,36,61,0,'185.153.39.80',1651066401,0,1,1,1,1,'','Re: Warunki wsppracy - uzupenienia 2022','<t>Nie ma sensu tego dopisywa do warunkw wsppracy, bo wymaga to aneksw.<br/>\nWystarczy pewnie wysa tak informacj w kolejnym newsletterze?</t>','f66cb233b30994b10a4e7542313d371c',0,'','2vnked',1,0,'',0,0,0,1,0,'',0),(208,63,36,63,0,'85.221.240.2',1651079018,0,1,1,1,1,'','Re: Warunki wsppracy - uzupenienia 2022','<r>Nie wymaga aneksowania - moemy jednostronnie powiadomi o aktualizacji warunkw wsppracy:\n<QUOTE><s>[quote]</s>3.	The Manufacturer reserves the right to unilaterally amend provisions of the Cooperation Conditions document, which is an integral part of the agreement. The Manufacturer will notify the Business Partner about any changes of the Cooperation Conditions documents at least 30 days in advance. In case of not accepting the changes, the Business Partner will be entitled to terminate the agreement with 14-day notice period.<e>[/quote]</e></QUOTE>\n\nW momencie wprowadzenia skutera GO! do oferty, oraz przy innym rabatowaniu na niego jakie jest planowane - plik i tak bdzie musia ulec zmianie.<br/>\nCzasem pracujc w innym miejscu co przyjdzie do gowy - std stworzyem ten temat by atwiej te informacje zebra w cao jak przyjdzie na to czas.<br/>\n<br/>\n<br/>\n---<br/>\n-Dodatkowo, usun informacj o setach E2000 (wycofane z oferty)</r>','d556dbc465b0d036b0f54140a46fe6ba',0,'','29n7bkp',1,0,'',0,0,0,1,0,'',0),(209,58,21,63,0,'85.221.240.2',1651079768,0,1,1,1,1,'','Re: Projekty video o Jaskiniach Sowacja, Chorwacja, Hiszpania - propozycja wsparcia','<r>Super <E>;)</E> To jest zawsze - z mojego dowiadczenia - kluczowe, czy jest kto kto faktycznie chce \'pywa z nami\' z uwagi na przekonanie co do sprztu (najlepsze wyniki wsppracy), czy te szuka kogo kto jak najbardziej zasponsoruje \'cokolwiek\'.</r>','63b6c96f0af50e871b89f751c58a988c',0,'','16pcwfvy',1,0,'',0,0,0,1,0,'',0),(210,64,41,63,0,'85.221.240.2',1651079856,0,1,1,1,1,'','Przenosiny na nowy serwer','<r>Hej<br/>\nRozmawiaem z Andrzejem w innym temacie i przy okazji nada koniecznoc przeniesienia forum na serwer docelowy. <br/>\nSiedzenie na rosyjskiej domenie to te mao optymalna opcja <E>;)</E><br/>\nBdzie to na pewno zwizane z przerw w dziaaniu forum.</r>','b3bbbf84ba2768a8fd48fe910b60f78b',0,'','3b6xca',1,0,'',0,0,0,1,0,'',0),(211,65,21,63,0,'85.221.240.2',1651082240,0,1,1,1,1,'','Projekty jaskiniowe- Chorwacja','<r>Temat w toku:<br/>\n<br/>\n---<br/>\n<br/>\nHello mr.Hoffmann,<br/>\nI am very happy to hear from you. My first idea is...since we do a lot of cave mapping and at the moment we use Mnemo and a small sonar is to use your ENC 3, and start mapping with it. <br/>\nBased on cave maps that we did...we developed a special methodology for population size estimation of Proteus. This methodology can be applied for any water cave animal in the future but it needs to be more tested. I am also involved in other conservation and scientific project that has to do with sea level change where we dive in anchialine caves of Croatia. Except of this expedition I will be conducting national monitoring of cave habitats with a big team for next 2 years. Plenty of things going on...<br/>\nSo...depends on what we agree, by use of your scooters and navigation systems I can test some of mapping methodology, based on mapes done by Seacraft I can do promotion and presentation of Seacraft through my conservation and scientific projects. How, when, where we can decide together. <br/>\nI am an co-author on 6 books, one being about cave diving explorations in Croatia...it is still now in graphic design...but there is a plan for at least 2 more.I am also a member of Croatian mountain rescue service-Cave rescue comission-Cave diving rescue department.<br/>\nIf you are interested we can meet on line or in person and I can present you my work...but more important,my team of crazy cavers, cave divers, biologists, videographers and photographers.<br/>\nI am looking forward hearing from you!<br/>\nGreetings<br/>\nPetra Kovac Konrad<br/>\n<br/>\n<br/>\n<br/>\n<br/>\nOn Tue, 19 Apr 2022, 16:59 Witold Hoffmann, &lt;<EMAIL email=\"witold.hoffmann@seacraft.eu\">witold.hoffmann@seacraft.eu</EMAIL>&gt; wrote:<br/>\n<br/>\n    Hello<br/>\n<br/>\n    Thank you for contact- and it seems as a very nice combination of speleology and diving <E>;)</E><br/>\n<br/>\n    I was able to access only the facebook linked content.<br/>\n<br/>\n<br/>\n    Please let us know, what are your needs regarding propulsion system - what would be the task to be done, and what are you looking for from Seacraft as possible cooperation partner.<br/>\n<br/>\n<br/>\n    Best regards<br/>\n<br/>\n    -- <br/>\n    Witold Hoffmann<br/>\n<br/>\n    Business Development Manager<br/>\n    tel.: +48 739 219 600<br/>\n<br/>\n    e-mail: <EMAIL email=\"witold.hoffmann@seacraft.eu\">witold.hoffmann@seacraft.eu</EMAIL><br/>\n    +48 000 000 000<br/>\n<br/>\n<br/>\n     <br/>\n    MARINE TECH SA<br/>\n    ul. Franciszka wirki i Stanisawa Wigury 17, 38-400 Krosno, Poland<br/>\n    <URL url=\"http://www.seacraft.eu\">www.seacraft.eu</URL>; <EMAIL email=\"office@seacraft.eu\">office@seacraft.eu</EMAIL>; phone: +48 502 741 715<br/>\n    NIP: 7811910188 | REGON: 361492147 | KRS: 0000557411 | NCAGE: 99QRH<br/>\n    BDO: 000386158<br/>\n<br/>\n<br/>\n<br/>\n<br/>\n<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     From: Petra Kova-Konrad &lt;<EMAIL email=\"petrakovkon1@gmail.com\">petrakovkon1@gmail.com</EMAIL>&gt;<br/>\n&gt;     Sent: Monday, April 18, 2022 3:43 PM<br/>\n&gt;     To: <EMAIL email=\"office@seacraft.eu\">office@seacraft.eu</EMAIL><br/>\n&gt;     Subject: Fwd: Support for expedition in Croatia<br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     Dear Seacraft  team,<br/>\n&gt;<br/>\n&gt;     I am a cave diver and also<br/>\n&gt;<br/>\n&gt;      FAL_1580487.jpg<br/>\n&gt;<br/>\n&gt;     a organizer of numerous cave-diving expeditions in Croatia. Up to now I organized over 30 expeditions. This year we plan to do exploration of a spring in National park Krka. The springs there are famous, except for its beauty, for the unique amphibian, cave predator Proteus anguinus. For this expedition we will have a french video producers and international French-Mexican-English-Swiss-Croatian team of cave-divers and we will create a short docu-film, numerous photos, and daily trailers for social media. We are looking for your support  if possible in return of lot of publicity. <br/>\n&gt;<br/>\n&gt;     I am sending you few links and attachments to get an idea of what we do. You can see also promotion that we did for Apeks and Isotta. Last year we mapped and connected one of the deepest springs in Croatia to longest regional cave system.  I am looking foward to hearing from you.<br/>\n&gt;<br/>\n&gt;     Petra Kovac Konrad, phd karstology <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     <URL url=\"https://web.facebook.com/Florianlaunettephotography/videos/168783181929832\"><LINK_TEXT text=\"https://web.facebook.com/Florianlaunett ... 3181929832\">https://web.facebook.com/Florianlaunettephotography/videos/168783181929832</LINK_TEXT></URL><br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     <URL url=\"https://web.facebook.com/Florianlaunettephotography/videos/2092919877391203\"><LINK_TEXT text=\"https://web.facebook.com/Florianlaunett ... 9877391203\">https://web.facebook.com/Florianlaunettephotography/videos/2092919877391203</LINK_TEXT></URL><br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     <URL url=\"https://web.facebook.com/Florianlaunettephotography/videos/3075759479161895\"><LINK_TEXT text=\"https://web.facebook.com/Florianlaunett ... 9479161895\">https://web.facebook.com/Florianlaunettephotography/videos/3075759479161895</LINK_TEXT></URL><br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;     <URL url=\"https://web.facebook.com/Florianlaunettephotography/videos/355392605397358\"><LINK_TEXT text=\"https://web.facebook.com/Florianlaunett ... 2605397358\">https://web.facebook.com/Florianlaunettephotography/videos/355392605397358</LINK_TEXT></URL><br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      <br/>\n&gt;<br/>\n&gt;      3.tif<br/>\n&gt;<br/>\n&gt;</r>','55add2e6047c2aa2bbcf4d85ba284bb1',0,'','4too9',1,0,'',0,0,0,1,0,'',0),(212,64,41,58,0,'94.232.216.242',1651123495,0,1,1,1,1,'','Re: Przenosiny na nowy serwer','<r>tak, szczegolnie, e szybko nam si rozrasta <E>:)</E> Bedziemy przenosi, zaplanujemy to najpewniej na pitek po 15.</r>','632be415709bbf75c6e3d8e3bf483090',0,'','14qxgx5g',1,0,'',0,0,0,1,0,'',0),(213,18,15,58,0,'94.232.216.242',1651126281,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"195\" time=\"1651043333\" user_id=\"63\"><s>[quote=\"Witold Hoffmann\" post_id=195 time=1651043333 user_id=63]</s>\nNowy typ sprzgw <br/>\nNowy modu GPS (typ B) i jego standaryzacja<br/>\nNowy katalog MIL -zapraszamy do kontaktu po niego<br/>\n<br/>\n...i bdzie.<br/>\n\n<e>[/quote]</e></QUOTE>\n\nWitku, byby w stanie przygotowa krtk notk techniczn na temat nowych sprzgw i moduu GPS (typ B)?<br/>\nKatalog w pdf jak ju bdzie wrzu prosz na seacraft cloud i tam podlinkujemy z Newslettera.</r>','0229d60f4147e28d8bce77d9b00be63c',0,'','147aqgl',1,0,'',0,0,0,1,0,'',0),(214,7,41,61,0,'94.232.216.242',1651128169,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<t>MOTOWIDO - nowy produkt do dodania</t>','b29d3632dd849fab76b636aef18dcb21',0,'','t0mt7vv',1,0,'',0,0,0,1,0,'',0),(215,6,20,58,0,'94.232.216.242',1651130256,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"178\" time=\"1650972042\" user_id=\"63\"><s>[quote=\"Witold Hoffmann\" post_id=178 time=1650972042 user_id=63]</s>\n<br/>\nOpcja 2 - elementy tak, ale raczej w kontekcie szczcie nurkowego, a nie oglnego <E>;)</E> Czyli, ew. zestawienie/ sparowanie nieszczliwego nurka na wakacjach ktry chce poyczy skuter, ale nigdzie nie ma i potem jest nieszczliwy- musi pywa z buta <E>;)</E>, a jego kolega przylecia ze swoim GO! i spdza swietnie czas.<br/>\n\n<e>[/quote]</e></QUOTE>\n\nTen pomys ze szczeliwym i nieszczeliwym nurkiem wydaje wydaje mi si bardzo ciekawy i mona byoby go poczy z naszym wstpnym planem, a dokdniej:<br/>\n<br/>\nFilm zaczyna si o tego nieszczesliwego nurka na wakacjach, ktry nei moe nigdzie wypoyczy skutera i patrzyo na szczesliwego nurka ktry przyjecha ze swoim Go!, wtedy nastpuje taki flash back do ujc jak do tego doszo czyli caly nasz wstpny plan:<br/>\n\n<QUOTE><s>[quote]</s>- na wstpie krtko chcemy pokaza, e produkcja skutera odbywa si u nas w Kronie, bez wikszych szczegw,<br/>\n- nastpnie skuter trafia do klienta,<br/>\n- przygotowanie skutera do podry,<br/>\n- zapakowanie skutera do torby podrnej, baterie osobno do podrcznego,<br/>\n- odprawa bagaowa i kontrola (x-ray baterii) ,<br/>\n- wejcie do samolotu ze skuterem, ewentualnie ujcie samolotu i innej osoby, ktra egna/macha w stron samolotu<br/>\n- uycie skutera w fajnym miejscu, moe egzotycznym,<br/>\n- uycie skutera przez kobiet - sprzt jest lekki<e>[/quote]</e></QUOTE>\n\nWszystko to w formie takiego flashbacka, sekwencja szybkich ujc fajnie zmontowanych, po ktorych nastepuje ponownie powrot do naszego szczesliwego i nieszczesliwego nurka, szczesliwy pywa w fajnych miejscach z GO! Wtedy narracja techniczna na temat GO, zakoczenie.<br/>\n<br/>\nCo sdzicie?</r>','792282cebf0475414f810ac62e8eb4ae',0,'','3xj9op8w',1,0,'',0,0,0,1,0,'',0),(216,6,20,63,0,'85.221.240.2',1651131344,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>...A nieszczliwy nurek, prbuje nurkowa w hotelowym basenie z emerytkami... (tylko tam dopynie bez skutera), bd ora pla (niska widoczno, goe dno) obok leakw... <E>;)</E><br/>\n<br/>\nMyl e trzeba wysa do Adama tak wizj - zobaczymy czy j poczuje / zaproponuje co bdcego skadem z z pomysw.</r>','facd6ff0eab600ffa7279f3101d5ea53',0,'','yzpti',1,0,'',0,0,0,1,0,'',0),(217,29,26,60,0,'94.232.216.242',1651131960,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<t>Irenka nie ma nic przeciwko, zgodzia si na wykorzystanie fotek. Pamitajcie tylko prosz o jakim oznaczeniu jej nazwiska nawet na kocu posta, bo jednak nie ma tu znaku wodnego.</t>','c458b57a8c6a24b0cf9c2e634757aae6',0,'','138f7vd',1,0,'',0,0,0,1,0,'',0),(218,29,26,58,0,'94.232.216.242',1651132538,0,1,1,1,1,'','Re: 14-15.05.22 Nurkowe Demo Days Jaworzno, Koparki','<t>wietnie, czekam ju tylko jak Marcin potwierdzi czy wypoyczanie sprzetu bedzie bezproblemowe czy z zapisami i wyl mu nasz wersj tego posta.</t>','468f8c7ec25c92c2b367f625dbc7e543',0,'','su9',1,0,'',0,0,0,1,0,'',0),(219,6,20,58,0,'94.232.216.242',1651132688,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><QUOTE author=\"Witold Hoffmann\" post_id=\"216\" time=\"1651131344\" user_id=\"63\"><s>[quote=\"Witold Hoffmann\" post_id=216 time=1651131344 user_id=63]</s>\n...A nieszczliwy nurek, prbuje nurkowa w hotelowym basenie z emerytkami... (tylko tam dopynie bez skutera), bd ora pla (niska widoczno, goe dno) obok leakw... <E>;)</E><br/>\n\n<e>[/quote]</e></QUOTE>\n\ni tak o powstanie kolektywna historia, ktra powinna zainteresowa ogldajcych do samego koca filmu  <E>:D</E></r>','452a167881abfb1aa29c89523398655f',0,'','3km11',1,0,'',0,0,0,1,0,'',0),(220,66,23,63,0,'85.221.240.2',1651149871,0,1,1,1,1,'','Bahrajn - targi wojskowe','<r><URL url=\"https://www.bahraindefence.com\">https://www.bahraindefence.com</URL><br/>\nDostaem namiar e jest to godna uwagi impreza.</r>','0409ace5386e74ef7b20dfeef58601a2',0,'','68s1j',1,0,'',0,0,0,1,0,'',0),(221,67,23,63,0,'85.221.240.2',1651149912,0,1,1,1,1,'','USA - targi si specjalnych','<r>Jedna z gwnych imprez - warto rozway na 2023: <URL url=\"https://www.sofic.org/\">https://www.sofic.org/</URL></r>','6defbf8a2b3ed6d5f52258bc7e838572',0,'','13ya935',1,0,'',0,0,0,1,0,'',0),(222,67,23,61,0,'185.153.39.80',1651209937,0,1,1,1,1,'','Re: USA - targi si specjalnych','<t>Damianie,<br/>\ndodaj do naszego spisu w excelu.<br/>\nSzkoda, ze w tym roku o tym nie wiedzielimy i jest ju za pno.</t>','ca40fcc674bcf1dcf076df5d9b511e90',0,'','g2t8pb',1,0,'',0,0,0,1,0,'',0),(223,66,23,61,0,'185.153.39.80',1651210251,0,1,1,1,1,'','Re: Bahrajn - targi wojskowe','<t>Do dopisania do tabelki - to oczywiste.<br/>\nTrzeba si zastanowi jak tam si wystawi. Czy osobicie czy poszuka tam jakiego przedstawiciela seacrafta.<br/>\nNie wiadomo kiedy te targi bd?</t>','f545087c4dc62902d18668ca475dd612',0,'','l26nn6u',1,0,'',0,0,0,1,0,'',0),(224,66,23,58,0,'94.232.216.242',1651210841,0,1,1,1,1,'','Re: Bahrajn - targi wojskowe','<r><QUOTE><s>[quote]</s>Details of the rescheduled dates for BIDEC will be available soon.<e>[/quote]</e></QUOTE>\n\nNa chwil obecn to jedyny komunikat to, e event z 2021 zosta przeoony, a nowa data bdzie dostpna wkrtce, napisze tam czy ju co wiadomo.</r>','88fb105116058ae968d24ae98e6d7dbc',0,'','fjddf4u',1,0,'',0,0,0,1,0,'',0),(225,7,41,58,0,'94.232.216.242',1651212965,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<r>Nawizujc do wczorajszego zapytania Witka o moliwoci oznaczania postw i tematw, na forum jest w kadym wtku opcja Bookmark, mona kady interesujacy temat do ktrego chcemy wrci lub zapmieta, doda do \"ulubionych\", wtedy wskazane wtki bd w naszym profilu przypite.<br/>\n<br/>\nNa dole kadego wtku:\n<ATTACHMENT filename=\"1.jpg\" index=\"0\"><s>[attachment=0]</s>1.jpg<e>[/attachment]</e></ATTACHMENT>\n\nNastpnie oznaczone jako ulubione wtki laduj w naszym profilu:\n<ATTACHMENT filename=\"2.jpg\" index=\"1\"><s>[attachment=1]</s>2.jpg<e>[/attachment]</e></ATTACHMENT>\n\nW zakadce, tak jak na screenshocie moemy nimi zarzdza.\n<ATTACHMENT filename=\"3.jpg\" index=\"2\"><s>[attachment=2]</s>3.jpg<e>[/attachment]</e></ATTACHMENT></r>','b8ffa1255039ee410ed7ec65fd40c545',1,'','m0zk',1,0,'',0,0,0,1,0,'',0),(226,22,18,60,0,'91.196.8.186',1651217469,0,1,1,1,1,'','Re: Karty katalogowe','<r><B><s>[b]</s>Zdjcia do kart katalogowych: <e>[/b]</e></B><br/>\n<br/>\n1. Nasz fotograf ma mobilne studio i czsto robi zdjcia u klientw na miejscu. Prosi jedynie o: <br/>\n- list produktw do sfotografowania, <br/>\n- wymiary wikszych i najmniejszych przedmiotw - mniej wicej, eby wiedzia jaki sprzt ze sob zabra<br/>\n- jeli si da to kilka fotek z telefonu, eby widzia rodzaj sprztu, pozwoli mu to lepiej dobra ta i cay ekwipunek studia mobilnego<br/>\n<br/>\n2. Lista produktw do sfotografowania: <br/>\nDobrze by byo pewnie do koca przyszego tygodnia przygotowa tak list. Ustalimy co fotografujemy, a co ewentualnie bdzie w renderach. Wtedy umwimy fotografa i/lub damy zna Pawowi, eby co przygotowa.</r>','055a44fa6b5c75d902ce9e1e0dfc5755',0,'','8p1sk',1,0,'',0,0,0,1,0,'',0),(227,68,28,60,0,'91.196.8.186',1651217718,0,1,1,1,1,'','Premiera skutera GO!','<r><B><s>[b]</s>Podsumowanie dotychczasowych pomysw i ustale dot. premiery skutera GO!:<e>[/b]</e></B><br/>\n<br/>\n1. Ustalono minimum 50 sztuk skutera do 15.08.2022<br/>\n2. Oprcz filmu promocyjnego musimy przygotowa treci na stron www, ulotk, specyfikacj. <U><s>[u]</s>Zastanwmy si co jeszcze musimy przygotowa<e>[/u]</e></U>. <br/>\n3. Event promocyjny: <br/>\n- Seacraft organizuje swoje gwne wydarzenie, <br/>\n- w tym czasie lub pniej nasi partnerzy organizuj mniejsze wydarzenia,<br/>\n- do ustalenia miejsce eventu Seacraft, <br/>\n- do ustalenia lista zaproszonych partnerw na event Seacraft,<br/>\n- do ustalenia jakich partnerw poprosimy o eventy lokalne + jak moemy im pomc,<br/>\n- kontakt z Lannym z Cavecamp, eby 10.09.2022 zrobi event dedykowany skuterowi GO! podczas obozu</r>','0ceb887d6dec81e56266dfba66eedc36',0,'','30oi',1,0,'',0,0,0,1,0,'',0),(228,6,20,60,0,'91.196.8.186',1651217898,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><B><s>[b]</s>Ustalenia po wczorajszym spotkaniu: <e>[/b]</e></B><br/>\n1. Nowy pomys na film: 3 nurkw wylatuje z jednego lotniska w 3 rne destynacje; 1 osoba typowo turystycznie np. kobieta w Egipcie, 2 freediver np. na jachcie, 3. nurek jaskiniowy. czy ich produkt. Na koniec filmu opis skutera, innowacje itp. <br/>\n2. Przel i omwi nasze pomysy z Adamem. By moe to on wybierze miejsce gdzie bdzie krci film.</r>','b2306062148694d3286818399006920b',0,'','c6gjl9gi',1,0,'',0,0,0,1,0,'',0),(229,69,54,60,0,'91.196.8.186',1651218014,0,1,1,1,1,'','Internacjonalizacja DPC','<r><B><s>[b]</s>Zgodnie z wczorajszymi ustaleniami:<e>[/b]</e></B><br/>\nBdziemy przygotowywa nowy projekt na Internacjonalizacj DPC. Zgodzilimy si na wybr 2 destynacji: Indie i Indonezja.<br/>\nW najbliszym czasie sprawdz now dokumentacj konkursow pod ktem progw na koszty marketingowe i ewentualnych zapisw militarnych. <br/>\nJeli macie inne propozycje na nowe destynacje to dajcie zna.</r>','838b3ee85b7e7dff1abbfc32d5e4e721',0,'','3eapfm',1,0,'',0,0,0,1,0,'',0),(230,48,25,60,0,'91.196.8.186',1651218083,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Czy musimy co przygotowa na event Cavebase?</t>','a61045a6f2caa16be68424cec30290bb',0,'','9ntte',1,0,'',0,0,0,1,0,'',0),(231,69,54,61,0,'185.153.39.80',1651219312,0,1,1,1,1,'','Re: Internacjonalizacja DPC','<t>Prosz o jakie inne sensowne propozycje:<br/>\n<br/>\nIndie w trakcie - dzi WH ma wysa wzory umw dla nich<br/>\nIndonezja - te jest otwarta karta kontaktu i chyba chc kupi demo.<br/>\n<br/>\nKraje idealne, ale nie wiem czy damy rad przesun ich na sierpie...</t>','f4a8435810a124bf4fd20d07cbebda08',0,'','11eo',1,0,'',0,0,0,1,0,'',0),(232,5,23,61,0,'185.153.39.80',1651219493,0,1,1,1,1,'','Re: 7-9.06.2022 [MIL] UDT Rotterdam, Holandia','<t>Niezbdny do stoiska stojak do DPC jeszcze w fazie projektowania!<br/>\nPoganiam wszystkich ale wykonanie w terminie moe by poza naszymi moliwociami.<br/>\nIza wie o terminie i robi co w jej mocy by zamwi profile.</t>','ff8d4f15e31f8238273b8969d74b9c87',0,'','80nr2',1,0,'',0,0,0,1,0,'',0),(233,48,25,63,0,'85.221.240.2',1651220297,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Fajnie bdzie zabra flagi do wrzucenia w tle.<br/>\n-Komunikacja z Frankiem, czy si pojawi? Czy wyle Michaela z Upstream? <br/>\n-Komunikacja z Olivierem Steinle - jako dealerem<br/>\n<br/>\nWyl dzisiaj update do Cavebasu z DW do Pauliny i Damiana.</t>','947e4e668ca6730d727c903c2734ecc7',0,'','3lar',1,0,'',0,0,0,1,0,'',0),(234,48,25,61,0,'185.153.39.80',1651220589,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Na razie nic nie pisz! - Paulina ustali szczegy z Frankiem.<br/>\nDopiero pniej ich poinformujemy, bo jeszcze nie wiemy jak sytuacja si rozwinie.<br/>\nMusz dosta od razu konkrety.</t>','2afad93823691290e19c098ee4849b9d',0,'','he3otrjj',1,0,'',0,0,0,1,0,'',0),(235,48,25,60,0,'91.196.8.186',1651224317,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Witek daj prosz zna o wszystkich szczegach jakie ustalae z Cavebase: <br/>\n- event ma trwa 1 czy 2 dni?<br/>\n- czy planowane byo nurkowanie?<br/>\n- gdzie ma si odby przekazanie?<br/>\n- czy Cavebase bdzie mie fotografa, ktry zrobi zdjcia z przekazania?</t>','ec0ae56f80aba8769ceaec6f86d92b80',0,'','4dnrzk',1,0,'',0,0,0,1,0,'',0),(236,68,28,61,0,'185.153.39.80',1651227030,0,1,1,1,1,'','Re: Premiera skutera GO!','<t>Proponuj:<br/>\n<br/>\nMeksyk<br/>\nSardynia<br/>\nHonoratka - ustalone z Marcinem Bramsonem<br/>\nimpreza tematyczna dla freediverw - chyba na deepspocie - tam ju mamy nasze skutery<br/>\n<br/>\nChyba w niedugim czasie trzeba ustala terminy - do lipca pewnie max.</t>','ae7987ab3aa4cf83937da9a11a37098b',0,'','27jq',1,0,'',0,0,0,1,0,'',0),(237,62,43,61,0,'185.153.39.80',1651229339,0,1,1,1,1,'','Re: Sesja zdjciowa Irena Stangieska- Czerwiec?','<t>Trzeba znale inny sposb na dobre zdjcia.<br/>\nZapomnijmy o tym, e skuter uda si dostarczy do Egiptu. Nie sdz, eby Ahmed Gabr nam w tym pomg. Ostatnio jestemy w niezbyt przyjaznych stosunkach z kilku powodw.<br/>\n<br/>\nW kadym razie nie moemy liczy na t imprez.</t>','70b61782d637d25dfeaa6908afad193e',0,'','q0df2c',1,0,'',0,0,0,1,0,'',0),(238,7,41,63,0,'85.221.240.2',1651237291,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<r>O! Co mi witao <E>;)</E> Dziki, dokadnie o to chodzio. (czyli np. jeli jest wtek gdzie chc odpowiedzie, a nie mam czasu na moment czytania --&gt; wrzuc sobie w bookmarki)</r>','2056ac28f1c0c114305920c27e4423a7',0,'','cyv2aylh',1,0,'',0,0,0,1,0,'',0),(239,66,23,63,0,'85.221.240.2',1651260819,0,1,1,1,1,'','Re: Bahrajn - targi wojskowe','<t>Z aktualnymi cenami ropy naftowej, warto przejrze podobne imprezy w innych krajach \'ropononych\'.<br/>\nKiedy bylimy w Dubaju sporo o tym byo mowy (wtedy trafilimy na okres niskich cen ropy).</t>','9c3e041f698d0f0b526d973ba9f49b29',0,'','jlpmqkm',1,0,'',0,0,0,1,0,'',0),(240,67,23,63,0,'85.221.240.2',1651260875,0,1,1,1,1,'','Re: USA - targi si specjalnych','<t>Z informacji od wizeprezesa Waterproofa- bywa ciko z miejscem, trzeba bookowa z duym wyprzedzeniem.</t>','b25f7c646e04c62025371fbc1b650a8b',0,'','4o7g',1,0,'',0,0,0,1,0,'',0),(241,48,25,63,0,'85.221.240.2',1651261097,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<r>Kontakt: <EMAIL email=\"steffen.burger@cavebase.de\">steffen.burger@cavebase.de</EMAIL><br/>\n<br/>\nNa chwil obecn udao si ustali dat. Na miejscu ma by wikszo teamu - nie jest w 100% ustalone to o co pytasz. Oczywicie planowane jest nurkowanie, oraz maj by osoby do robienia zdj pod wod. Warto doprecyzowa te zdjcia na sucho i generalnie plan dziaa - sugeruj zdjcia grupowe pod wod jako plan dla nich. (wiele skuterw na jednym zdjciu). <br/>\n<br/>\nOstatnia komunikacja:<br/>\n\n <QUOTE><s>[quote]</s>\nWe will discuss about 25/26.6. We reached first goal to have a date <EMOJI seq=\"1f609\" tseq=\"1f609\">&#128521;</EMOJI><br/>\n<br/>\nMaybe Nordhausen could fit, as it is allowed to drive DPV there. I will ask in our team about a favorite. Nordhausen is also very middle for each guy.<e>[/quote]</e></QUOTE>\n\nNie pisaem o aktualizacji tematu na chwil obecn.</r>','54ca5e6f7668f034d8a04c27ab70dae6',0,'','g67',1,0,'',0,0,0,1,0,'',0),(242,18,15,63,0,'85.221.240.2',1651263212,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<r>-Super e udao si zaadowa zdjcie ta w konwencji MIL <E>;)</E> <br/>\n<br/>\n-Do kompilacji jest lista wysykowa... Jak moesz, dodaj wszystkich partnerw MIL. Ja sprbuj przebi si przez mojego maila i doda wszystkie osoby ktre warto tam doda. Tag wysykowy : \'Military newsletter\'.<br/>\nUwaam e warto i mona go puci rwnie wszystkim kontrahentom REC (czyli 2 listy Reseller i Distributor).  Zeby pniej jak koki z Tajwanu nie pytali czy w ogle mamy ofert militarn.<br/>\n<br/>\n-zmodyfikowaem nieco opis UDT. Czy przypadkiem logotyp nie ma niewielkiego paska na dole?<br/>\n<br/>\n-podpity link do katalogu<br/>\n<br/>\n-Opisy:<br/>\n<br/>\na) Nowy system sprzgajcy. Zdjcie mona da z newslettera styczniowego. Podlinkowabym te do: <URL url=\"https://seacraft.eu/products/accessories-and-spares/scooters-coupling-platform/\"><LINK_TEXT text=\"https://seacraft.eu/products/accessorie ... -platform/\">https://seacraft.eu/products/accessories-and-spares/scooters-coupling-platform/</LINK_TEXT></URL><br/>\n\n<QUOTE><s>[quote]</s>We are happy to introduce a new type of coupling system. It allows connecting scooters faster and easier. Modular construction allows for quick and simple conversions, as well as part replacements. In addition to this - there are two compatible connecting platforms available:<br/>\n- TUM1000 Scooters coupling platform  wide, for cargo bags or ENC3M platform (dedicated to TAC1000 and TAC2000 scooters) with<br/>\nadjustable buoyancy floats  gen. II<br/>\n- TUM1100 Scooters coupling platform  narrow (dedicated to TAC1000 and TAC2000 scooters) with adjustable buoyancy floats  gen. II<br/>\n<br/>\nDual DPV systems can be built using a chosen platform, and based on both TAC1000 and TAC2000.<br/>\n\n<e>[/quote]</e></QUOTE>\n\n-Informacja o workach transportowych moe zasadniczo ic w podobnym ksztacie (zdjcie - chyba e s ju lepsze?)<br/>\n<br/>\nTekst:\n<QUOTE><s>[quote]</s>Dry-Bag for equipment transport<br/>\nWe are happy to add a series of Dry-Bags for equipment underwater transport. It has been designed to use with DPV scooters for underwater transportation of equipment.<br/>\nThe kit includes external backpack and internal dry-chamber.  Backpack straps can be packed into dedicated pockets, for underwater carriage - to reduce entangelemnts risk.<br/>\nThe external backpack which has drainage system allowing for quick water escaping and molle system which enables to attach and carry out additional equipment. The internal dry-chamber has molle plate placed on bottom for attaching equipment. The dry-chamber has also inflation system powered by 0,5l tank, which includes corrugated inflator type \"K\" ended by valve and additional separate exhaust valve.<br/>\n<br/>\nDry-bags are available in various sizes: 40l, 60l, 80l, 120l (regular cargo packs), as well in shapes dedicated for firearms transport.<br/>\n\n<e>[/quote]</e></QUOTE>\n\n<br/>\n<br/>\nKorekta si przyda, pisane w miar na szybko.</r>','7e149ac16ccfa67ae64b9710e6210481',0,'','3xof',1,0,'',0,0,0,1,0,'',0),(243,70,26,61,0,'185.153.39.80',1651487841,0,1,1,1,1,'','18 - 21 padziernik 2022; Euronaval','<r>Temat powicony targom militarnym we Francji.<br/>\n<br/>\n<URL url=\"https://www.euronaval.fr/21/exhibitors-2022\">https://www.euronaval.fr/21/exhibitors-2022</URL><br/>\n<br/>\nBardzo dua impreza, musimy znale kogo powanego kto wystawi nasz produkt.<br/>\n\n<QUOTE><s>[quote]</s>\nI will exhibit to Eurosatory, Euronaval and Fireman congress this year. <br/>\nDo you think its possible to get from you military demo units ?<br/>\nDo you think its possible to schedule a phone/video call with you to have an update on the products to be good in front of the military ?\n<e>[/quote]</e></QUOTE>\n\nChcia to zrobi Arnaud, ale to jest zy pomys. Zwaszcza po ostatnim jego wystpie na targach.</r>','eeb92282bb46d8a3caa3185eae6406c9',0,'','5ydshbo',1,0,'',0,0,0,1,0,'',0),(244,16,9,58,0,'94.232.216.242',1651644530,0,1,1,1,1,'','Re: Aktualizacja zakadki MIL','<r>Dopisuj, aby nam nie ucieko.<br/>\n\n<QUOTE><s>[quote]</s><URL url=\"https://www.csgroup.eu/fr/technologies-innovation/projets-rd/\"><LINK_TEXT text=\"https://www.csgroup.eu/fr/technologies- ... rojets-rd/\">https://www.csgroup.eu/fr/technologies-innovation/projets-rd/</LINK_TEXT></URL><br/>\n<br/>\n<URL url=\"https://www.csgroup.eu/fr/technologies-innovation/\">https://www.csgroup.eu/fr/technologies-innovation/</URL><br/>\n<br/>\n<URL url=\"https://rtsys.eu/\">https://rtsys.eu/</URL>#<br/>\n<br/>\nMusimy rozbudowa cze MIL seacraft.eu o troch opisw w zakresie prowadzonych prac B+R. <br/>\nTakie SOCOM i inni przegldaj to i musimy si wykaza e takie projekty morskie prowadzimy i z AMW i innymi wsppracujemy, bo moe uda si kiedy pozyska zagranicznych partnerw. <br/>\n \n<e>[/quote]</e></QUOTE></r>','6d46b5342412190131ea19faf9ec9636',0,'','3a1o2',1,0,'',0,0,0,1,0,'',0),(245,12,31,58,0,'94.232.216.242',1651644893,0,1,1,1,1,'','Re: Godne uwagi tematy','<r><QUOTE><s>[quote]</s>Hi Witold, <br/>\n<br/>\nI am finally happy to share with you the project I had once mentioned to you which we have been working on for years. <br/>\n<br/>\nIn 2017, an iconic natural arch in Gozo (Malta) known as the Azure Window, collapsed. By mounting cameras and lights atop Seacraft scooters, we undertook photogrammetry of the remains, which span around 8000 square meters, and were able to reconstruct the collapse event.<br/>\n<br/>\nIt\'s in the news today, e.g. here:<br/>\n<URL url=\"https://timesofmalta.com/articles/view/this-is-how-the-azure-window-collapsed.951730\"><LINK_TEXT text=\"https://timesofmalta.com/articles/view/ ... sed.951730\">https://timesofmalta.com/articles/view/this-is-how-the-azure-window-collapsed.951730</LINK_TEXT></URL><br/>\n<br/>\nA website dedicated to the project is available at <URL url=\"http://www.dwejra.net\">http://www.dwejra.net</URL><br/>\n<br/>\nWe have also produced a video documentary which showcases the Seacraft scooters in use; this is available here: <URL url=\"https://youtu.be/39tbP-F-iSc\">https://youtu.be/39tbP-F-iSc</URL><br/>\n<br/>\nWe have a dedicated website for the project (<URL url=\"http://www.dwejra.net/azure-window/\">www.dwejra.net/azure-window/</URL>) and I have put some images for you in this Google Drive:<br/>\n<URL url=\"https://drive.google.com/drive/folders/1RqIIjcMHnz87oMotQ-_e7O60APrybmLj?usp=sharing\"><LINK_TEXT text=\"https://drive.google.com/drive/folders/ ... sp=sharing\">https://drive.google.com/drive/folders/1RqIIjcMHnz87oMotQ-_e7O60APrybmLj?usp=sharing</LINK_TEXT></URL><br/>\n<br/>\nI hope you find some of this useful, Witold! <E>:)</E><br/>\n<br/>\nBest wishes,<br/>\n<br/>\nJoseph<br/>\n\n<e>[/quote]</e></QUOTE></r>','9e82175a8e84d42469781c21639d828d',0,'','2vgqnu',1,0,'',0,0,0,1,0,'',0),(246,18,15,58,0,'94.232.216.242',1651645208,0,1,1,1,1,'','Re: Tematy na Business Update MIL','<r>Dziki z opis do sprzgw i podlinkownaie katalgou w pdf.<br/>\n<br/>\nO workach napiszemy ju w nastpnym jak bdziemy mie pozostae opcje.<br/>\n\n<QUOTE><s>[quote]</s>-Do kompilacji jest lista wysykowa... Jak moesz, dodaj wszystkich partnerw MIL. Ja sprbuj przebi si przez mojego maila i doda wszystkie osoby ktre warto tam doda. Tag wysykowy : \'Military newsletter\'.<br/>\nUwaam e warto i mona go puci rwnie wszystkim kontrahentom REC (czyli 2 listy Reseller i Distributor). Zeby pniej jak koki z Tajwanu nie pytali czy w ogle mamy ofert militarn.<e>[/quote]</e></QUOTE>\n\nZaktualizuj maile obecnych partnerw MIL;<br/>\nMoe warto ten Newsletter MIL zawsze puszcza te dla partnerw REC ?<br/>\n\n<QUOTE><s>[quote]</s>Czy przypadkiem logotyp nie ma niewielkiego paska na dole?<e>[/quote]</e></QUOTE>\n\nLogoty jest ok, ale atrybut ALT zosta pusty i wywietlao ramk podwietlenia tekstu, ju poprawione.</r>','f71200468f2d00ffd5499ee33f279998',0,'','czv42lz1',1,0,'',0,0,0,1,0,'',0),(247,24,28,58,0,'94.232.216.242',1651649813,0,1,1,1,1,'','Re: Zdjcia i materiay','<r><QUOTE><s>[quote]</s>Andrea -  <URL url=\"https://www.digitalmovie.it/\">https://www.digitalmovie.it/</URL> - jest w stanie zrobi dla nas zarwno zdjcia jak i video wysokiej jakoci GO!, zarwno studyjnie, jak i w akcji.<br/>\nW zamian za to - znika na zakup nowego skutera (jeden ma <E>;)</E>) , moliwe e 2 dla pozostaych czonkw zespou (np. Andrea Bada).<br/>\nBd wdziczny za skoordynowanie tematu na pocztku przyszego tygodnia. Mail kontaktowy: Andrea &lt;<EMAIL email=\"andrea@digitalmovie.it\">andrea@digitalmovie.it</EMAIL>&gt;\n<e>[/quote]</e></QUOTE>\n\nJeden z tematw do skoordynowania od Witka, <br/>\n<br/>\nNie mamy jeszcze fizycznie gotowych skuterw, wic moe dobrze byoby ustali kto je dostanie jako pierwszy, aby nie byo pniej niedomwie, e kto nie dosta.<br/>\n<br/>\nAndrea - 1 skuter (wyl mail z informacj, e dostanie go zgodnie z ustaleniami w tym miesiacu, poinformujemy dokadnie jak bdziemy mie gotowy skuter do wysyki) - akceptujemy jego warunki? <br/>\n<br/>\nCave Base - 1 skuter - poinformujemy ich, e wylemy zgodnei z ustaleniami na wskazany przez nich addres jak skuter bdzie gotowy.<br/>\n<br/>\nTrzeci skuter dla Ireny?</r>','e51ec4d45710b40c54b460692e010739',0,'','bpp',1,0,'',0,0,0,1,0,'',0),(248,71,34,58,0,'94.232.216.242',1651728588,0,1,1,1,1,'','Level 0+1 lista kontrahentw','<r>Lista naszych Resellerw i ProResellerw do szekolenia level 0+1<br/>\n<br/>\nEU - ProReseller - Black Duck Diving (Finlandia)<br/>\nEU - ProReseller - Multi Safety Support System - M3S (Francja)<br/>\nEU - ProReseller - Silent Explorers (Grecja)<br/>\nEU - ProReseller - Extreme Diving School (Holandia)<br/>\nEU - ProReseller - South West Technical Diving (Irlandia)<br/>\nEU - ProReseller - Duo Training Sp. z o.o (Polska)<br/>\nEU - Reseller - Oloturia sub DC (Wochy)<br/>\nOVERSEAS - ProReseller - Indigo-blue Technology Co.,LTD (Tajwan)<br/>\nOVERSEAS - ProReseller - Xtreme Deep Asia Limited (Hong Kong, Chiny)<br/>\nEU - ProReseller - Ren Melichrek s.r.o. (Czechy)<br/>\nEU - Reseller - ESSENTIAL DIVING (Francja)<br/>\nEU - Reseller - Groborz-Tauch-Technik (Niemcy)<br/>\nEU - ProReseller - TecServe UG (Niemcy)<br/>\nEU - ProReseller - Tauchshop regler-service.at Helmut Hubalek (Austria)<br/>\nEU - ProReseller - Die Tauchschule Oliver Perschke (Niemcy)<br/>\nEU - ProReseller - TecXpedition GmbH (Niemcy)<br/>\nEU - ProReseller - Sidemount explorer UG (Niemcy)<br/>\nEXPORT - ProReseller - TekForce(Ukraina)<br/>\nEU - ProReseller - Tauchshop Kwella Thomas Kwella (Niemcy)<br/>\nEU - ProReseller - SmartDive LTA (Portugalia)<br/>\nEU - ProReseller - Dykeriet AB  (Szwecja)<br/>\nEU - ProReseller - BLUE DEEP Scuba Shop (Wochy)<br/>\nEU - ProReseller - MALAGA DIVE S.L.U. (Portugalia)<br/>\n<B><s>[b]</s>EU - ProReseller - Dragor Lux (Chorawacja) umowa przygotowana do wyslania<br/>\nEXPORT - ProReseller - Nammu Tech (Wielka Brytania) - wkrtce powinni speni warunk<br/>\nEU - ProReseller - CENTRUL DE SCUFUNDRI TRANSILVANIA (Rumunia) wkrtce powinni speni warunki <e>[/b]</e></B></r>','9afe0c7f8df16aa13a1d3c4254b00b47',0,'','44yaco',1,0,'',0,0,0,1,0,'',0),(249,72,34,58,0,'94.232.216.242',1651728825,0,1,1,1,1,'','Level 2 lista kontrahentow','<t>Lista naszych dystrybutorw<br/>\n<br/>\nEU - Dystrybutor - Upstream UG (Niemcy)<br/>\nEXPORT - Dystrybutor - Safenor AS (Norwegia)<br/>\nEXPORT - Dystrybutor - Decostop GmbH (Szwajcaria)<br/>\nEXPORT - Dystrybutor - KNS Trading PTY LTD (Snorkel and Dive Safari Altona Beach) (Australia)<br/>\nEXPORT - DYSTRYBUTOR - B.M.Z Or ltd Palamida Dive Center (Izrael)<br/>\nEXPORT - DYSTRYBUTOR - Mares SSI Korea co., ltd. (Korea)<br/>\n<br/>\nMIL<br/>\nEU - Electron Progress (Bugaria)<br/>\nOVERSEAS - Aqualung Group (Tajlandia)<br/>\nOVERSEAS - Apollo Military (Vietnam)<br/>\nEXPORT - Oztekin Technical Service Equipment and Defense Industry Commerce Ltd. Comp. (Turcja)<br/>\nOVERSEAS - XR Hub (Emiraty)</t>','07b398454fb5eaeabb7f83935e85b528',0,'','e76',1,0,'',0,0,0,1,0,'',0),(250,73,55,61,0,'94.232.216.242',1651743959,0,1,1,1,1,'','Bateria lotnicza','<t>Nowy produkt:<br/>\n<br/>\nBateria Lotnicza:<br/>\nwersja 600Wh, 700Wh, 800Wh<br/>\n<br/>\nPrawdopodobnie bdzie wyceniona osobno obudowa i jeden pakiet - kady kupi sobie ile chce<br/>\n<br/>\nPlanowana seria produkcyjna - pocztek czerwca, do zdjcia bdzie za jakie dwa tygodnie<br/>\n<br/>\nTemat transportu lotniczego:<br/>\nmusi by zalepka z wtrysku - Pawe dosta zlecenie narysowania (zalepka jest planowana z wtrysku)<br/>\nwalizeczka transportowa - Iza szuka<br/>\n<br/>\nBardzo wana informacja, ktra musi znale si w instrukcji - uywane pakiety musz mie ten sam poziom naadowania. Inaczej caa bateria bdzie miaa moc tak jak ma najsabsze ogniwo.</t>','65f533f5f52fa0b8f604e6f31b4cd8cb',0,'','l2osykp',1,0,'',0,0,0,1,0,'',0),(251,74,34,63,0,'85.221.240.2',1651840163,0,1,1,1,1,'','E-learning - zasady oglne + prototyp level 0','<r>Hej<br/>\n<br/>\nSiadem nad tematami szkole kontrahentw.<br/>\nW naszej brany bdziemy si nieustannie mierzy z potrzeb edukowania, oraz egzekowania/ weryfikacji wiedzy uytkownikw. Chc zaprosi kadego osobicie na szkolenie- niestety, padniemy, a oni zapomn poow po tygodniu.<br/>\n<br/>\n Zdecydowana wikszo tematw, z uwagi na relatywn rzadko stosowania bdzie rwnie wymaga dostpnoci materiaw online/ drukowanych - by dana osoba moga np. pracowa serwisowo opierajac si 1:1 na manualu.<br/>\n<br/>\nManuale - jak wszystko - ulegaj zmianom, korektom, oraz wymylamy lepsze metody.<br/>\n<br/>\nW zwiku z tym przygotowaem oraz proponuj natpujc struktur szkole naszych kontrahentw. Na chwil obecn - opieram si tylko na szkoleniach REC, ale do MIL widz podobn struktur. <br/>\n<br/>\n1. Ukoczenie szkole i zdanie testw obowizkowe jest dla wszystkich kontrahentw:<br/>\na) szkolenie techniczne poziom 0 <br/>\nb) szkolenie marketingowe - odpowiedzialny Frank. (jest zalek/ stare szkolenie na edu)<br/>\nc) (od 2023) - coroczny update informacji technicznych i marketingowych (jeli byy zmiany) <br/>\n<br/>\n<br/>\n2. Wymagane od PRO Resellerow<br/>\na) szkolenie techniczne poziom 1  (dostpne po zdaniu poziomu 0)<br/>\nb) (od 2023) - coroczny update informacji technicznych i marketingowych (jeli byy zmiany) <br/>\n<br/>\n3. Wymagane od Dystrybutorw<br/>\na) szkolenie techniczne poziom 2 - tylko osobicie w fabryce (po zdaniu poziomu 1 online)<br/>\n<br/>\n<br/>\nDocelowo- do dodania bd moduy o ENC...<br/>\n<br/>\nTroche mylaem nad struktur moduw w Moodle i finalnie zdecydowaem si na umieszczanie treci jako \'book\' (ksika), z wanymi danymi/ linkowaniem do moduw zewntrznych (support), tak by nie zachodzia potrzeba aktualizacji np. procedury serwisowej w 2 miejsach. (a tylko na supporcie).<br/>\n<br/>\nNa: <URL url=\"https://edu.seacraft.eu\">https://edu.seacraft.eu</URL> jest ju dostpny kurs techniczny level 0. Dopinam jeszcze kilka ustawie i bd zaprasza:<br/>\n<br/>\n-Franka<br/>\n-Damiana<br/>\n-Office<br/>\n<br/>\n<br/>\nJeli nie bdzie problemw technicznych, dodamy kolejne osoby z \'wszego grona\', a nastpnie --&gt; wszyscy sprzedawcy w okrelonym terminie powinni to zaliczy. Optymalnie by zaliczali zarwno szkolenie marketingowe i techniczne w jednej komunikacji.<br/>\n<br/>\nProsz o przejrzenie caoci i uwagi, a nastpnie podejcie do egzaminw i zada.<br/>\nZdjcia moecie wgra dowolne- chc sprawdzi jak zadziaa modu oceniania i koczenia aktywnoci.</r>','3c91edc659814811313d5b2e780f1555',0,'','1816b',1,0,'',0,0,0,1,0,'',0),(252,12,31,63,0,'85.221.240.2',1651848878,0,1,1,1,1,'','Re: Godne uwagi tematy','<t>Film wyglda dobrze. Nadaje si na wikszy post tematyczny, a nawet na newsletter.<br/>\nRwnie - do sekcji \'rodowisko\' na stronie WWW.</t>','e6c880a93ba7fbe6f60a3bcf128081fd',0,'','cafj',1,0,'',0,0,0,1,0,'',0),(253,75,42,63,0,'85.221.240.2',1651849208,0,1,1,1,1,'','Dodanie kodw do naklejek na produkty','<t>Hej<br/>\nJest sugestia (uwaam e suszna) by np. na adowarkach umieszcza rwnie ich kody produktowe zgodne z naszym cennikiem. Podobnie z innymi produktami - pozwoli to na atw identyfikacj np. na cle, czy przy dostawach.<br/>\nNiepilne, ale wane.</t>','7c684e8422a6443fdd69bf7027876016',0,'','1hxgj',1,0,'',0,0,0,1,0,'',0),(254,12,31,58,0,'176.111.23.110',1651948513,0,1,1,1,1,'','Re: Godne uwagi tematy','<t>Zdecyddowanie tak, materia na 3 platformy, fb, newstletter i artykul na strone.</t>','0adb9e3f7cdd504fd5fee848713b336e',0,'','9k0ax',1,0,'',0,0,0,1,0,'',0),(255,76,37,61,0,'91.196.8.186',1652079958,0,1,1,1,1,'','Umowy','<t>Przeniosam folder MT_UMOWY do folderu MARKETING<br/>\nDokumenty do przejrzenia i umieszczenia we waciwym miejscu.</t>','566d4487999cf94e7458a1775138d1e4',0,'','3buqe',1,0,'',0,0,0,1,0,'',0),(256,75,42,61,0,'91.196.8.186',1652080110,0,1,1,1,1,'','Re: Dodanie kodw do naklejek na produkty','<t>Od kogo taka sugestia wysza?<br/>\nCzy oznaczane powinny by wszystkie produkty?<br/>\nTo bdzie kopotliwe i doda sporo pracy.</t>','221accc9474a4b194fafb1704d812fad',0,'','dusmvgz9',1,0,'',0,0,0,1,0,'',0),(257,74,34,61,0,'91.196.8.186',1652080725,0,1,1,1,1,'','Re: E-learning - zasady oglne + prototyp level 0','<t>Czy Frank wie, e ma przygotowa szkolenie marketingowe?<br/>\nJestecie w kontakcie?</t>','6e5691361c982ae197458a3fabe37ccf',0,'','srzcpa2x',1,0,'',0,0,0,1,0,'',0),(258,76,37,58,0,'94.232.216.242',1652082575,0,1,1,1,1,'','Re: Umowy','<t>Uporzdkuj je w naszej strukturze folderw.</t>','93b88c6467530275a9874fbe32807516',0,'','5c00g',1,0,'',0,0,0,1,0,'',0),(259,75,42,63,0,'85.221.240.2',1652096123,0,1,1,1,1,'','Re: Dodanie kodw do naklejek na produkty','<t>Chorwacki dealer. Mia problem z identyfikacj adowarki tylko po nazwie, cho mona je okreli po mocy to ju np. z dwoma standardami zcz adowania robi si ju 6 kombinacji.<br/>\nNa pewno nie trzeba tego robi na zamanie karku, natomiast z czasem trzeba przymyle etykietowanie produktw....</t>','0cdbadcc9000f556a12d1386ab9ff332',0,'','2fd4hz',1,0,'',0,0,0,1,0,'',0),(260,48,25,63,0,'85.221.240.2',1652096147,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Czy kontaktowalicie si ju z nimi w tej kwestii?<br/>\nWypadaoby...</t>','5e94331d9083a93b1eaffee2ec1f1389',0,'','aplw',1,0,'',0,0,0,1,0,'',0),(261,74,34,63,0,'85.221.240.2',1652096188,0,1,1,1,1,'','Re: E-learning - zasady oglne + prototyp level 0','<t>Mwi e zrobi. Dzisiaj spytaem na kiedy i wklej co odpisze.</t>','47667bc43194f4d67add7f46e9da61fd',0,'','1gsadiq',1,0,'',0,0,0,1,0,'',0),(262,48,25,60,0,'91.196.8.186',1652097052,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Sytuacja wyglda tak: <br/>\nPrzedyskutowalimy ostatnio form tego wydarzenia i wsplnie z Zarzdem ustalilimy, e nie bdziemy organizowa eventu. Nie potrzebujemy takiej formy promocji. Zaley nam tylko na fotkach od nich. Take nasza propozycja jest taka, eby wyznaczy im dat, np. do koca czerwca i niech oni si spotkaj, zrobi sobie zdjcia i ogosz przejcie na Seacrafta w mediach. <br/>\nPytaam te Franka czy ewentualnie on jako nasz niemiecki dealer chciaby uczestniczy w wydarzeniu, ale nie chcia. <br/>\nJeli chodzi o szkolenie serwisowe, to najlepiej bdzie si z nimi dogada, albo przyjad do Krosna, albo po prostu w innym terminie. <br/>\nNa ten moment uznalimy, e nie czujemy potrzeby odbycia z nimi takiego eventu i nasza obecno jest zbdna. W najbliszych dniach przygotuj im jak mi odpowied i sprbuj ustali szczegy, np. jakich zdj potrzebujemy itp.</t>','03b91e2a80c8a389a66bb0c8ca82d107',0,'','c1iqun5t',1,0,'',0,0,0,1,0,'',0),(264,6,20,60,0,'91.196.8.186',1652097828,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><B><s>[b]</s>Ostateczne ustalenia dot. filmu: <e>[/b]</e></B><br/>\n<br/>\nTemat przewodni: <B><s>[b]</s>wyprawa po skarb<e>[/b]</e></B><br/>\nl. Zajawienie historii<br/>\nEkipa (mczyzna i kobieta lub wicej osb )  przygotowuje wypraw.<br/>\nLogistyka i przygotowanie.<br/>\n<br/>\nll. Rozwinicie<br/>\nTransport odzi  gdzie dowiadujemy si, e jest to wyprawa nurkowa.<br/>\nRozpoczcie nurkowania<br/>\nPoszukiwania  detektorem po piaszczystym dnie, w jaskini i we wraku<br/>\n<br/>\nOdnalezienie starej skrzyni we wraku, a w niej skarb - nowy skuter.<br/>\n<br/>\nllL. Zakoczenie <br/>\nCzas na przedstawienie skutera od strony technicznej<br/>\nWydobycie skutera na d<br/>\nPrezentacja znaleziska. ( tu moemy zademonstrowa poszczeglne elementy i skuter z tekstem lektora + infografik)<br/>\nWieczr, zachodzce soce, ognisko na play odkrywcy miej si i wznosz toast, Obok nich stoi nowy Seacraft.</r>','b705f91b63b70287b04e9568dc76bb7e',0,'','d6g5at5',1,0,'',0,0,0,1,0,'',0),(265,6,20,60,0,'91.196.8.186',1652097936,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>W nawizaniu do powyszego pomysu na scenariusz, wielka proba od Adama: <br/>\n<br/>\nPoprosz o informacje co ma si znale w <U><s>[u]</s>czci informacyjnej o produkcie<e>[/u]</e></U>. Jakie <U><s>[u]</s>informacje techniczne<e>[/u]</e></U>?<br/>\nBo musz wiedzie ile czasu bdzie trwa tekst lektorski  i to jest pilne.<br/>\nProsz to <U><s>[u]</s>wypunktowa<e>[/u]</e></U>.<br/>\n<br/>\nNa ten moment na pewno pokaemy podr samolotem ze skuterem.</r>','9e4c7f770c01e7e300c9580f401b818b',0,'','9d93x8rm',1,0,'',0,0,0,1,0,'',0),(266,6,20,63,0,'85.221.240.2',1652100687,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Pomys z poszukiwaniami - fajny! Nada si!<br/>\nCzy bdziemy ujmowa transport lotniczy? Moga by to by np. droga powrotna... <E>;)</E><br/>\n<br/>\n-Informacje techniczne --&gt; powinny si pojawi rwnie jako plansza.<br/>\n<br/>\n-Max. cig statyczny (do weryfikacji jaki jest finalny)<br/>\n-Masa cakowita<br/>\n-Czas pracy z prdkoci 45m/min (do weryfikacji jaki jest finalny)<br/>\n-bateria dozwolona do transportu lotniczego (z pokazaniem moduw)<br/>\n-adowanie zewntrzne bez adnego korka adowania - bezporednio do pinw<br/>\n-ilo biegw + wsteczny<br/>\n-wywietlacz paskowy<br/>\n-Tryb sterowania Seacraft (piezo + 2 manetki i uchwyt dwurczny)<br/>\n-3 tryby pracy  (do weryfikacji, moliwe e bed 2-standard i Freediving)<br/>\n-atwe trymowanie (prezentacja/ rendery/ wizualizacja?)<br/>\n-plansza z akcesoriami --&gt; uchwyt transportowy, monta ENC, monta latarek bateryjnych (opcja)<br/>\n<br/>\nTyle bym da na pewno. Moliwe e co maego dojdzie, mona te ew. obci akcesoria i trymowanie.</r>','cba4f98a6ce3b6c60933a7ddbe20ad32',0,'','16ptgkb',1,0,'',0,0,0,1,0,'',0),(267,48,25,63,0,'85.221.240.2',1652100797,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Porozmawia z Olivierem czy nie chciaby si pojawi jako nasz przedstawiciel?<br/>\n<br/>\nUwaam e wypada, by kto si pojawi. Moe szybki lot na miejsce eby nie jedzi?</t>','d5ab755ff139b58206342192bc1fbdaa',0,'','jlqf',1,0,'',0,0,0,1,0,'',0),(268,75,42,61,0,'185.153.39.80',1652118994,0,1,1,1,1,'','Re: Dodanie kodw do naklejek na produkty','<t>Pewnie kody kreskowe trzeba bdzie wprowadzi docelowo.</t>','049ee749629a3bc80de86433acbbae81',0,'','chlv',1,0,'',0,0,0,1,0,'',0),(269,48,25,61,0,'185.153.39.80',1652120076,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Olivier to nie jest nasz przedstawiciel, nie wiem za bardzo co to zmieni w tej sytuacji.</t>','a2109e45506cf2edb5ed1f6b67444608',0,'','1kfsp1q',1,0,'',0,0,0,1,0,'',0),(270,77,18,58,0,'94.232.216.242',1652162949,0,1,1,1,1,'','[MIL] Brakujce zdjcia produktowe','<t>Lista brakujcych zdj produktowych Military:<br/>\n<br/>\nGM1765 - Stand TAC2000 - zarwno dla TAC1000 i TAC2000 / Future i Ghost uywamy tego samego zdjcia<br/>\nTFM1_1742 Dual scooter Tac1000 wide platform<br/>\nTGM1_1744 Dual scooter Tac2000 wide platform<br/>\nTFM2_1742 Dual scooter Tac1000 narrow platform<br/>\nTGM2_1744 Dual scooter Tac2000 narrow platform<br/>\nTFM1800 Coupling set II gen. wide platform wide platform for Tac1000<br/>\nTGM1800 Coupling set II gen. wide platform wide platform for Tac2000<br/>\nTUM1000 platform wide - jest jedno zdjecie, ale sabej jakoci<br/>\nTFM1723 Transport bracket twin front fi 160<br/>\nTFM1724 Transport bracket twin rear fi 160<br/>\nEM1824 ENC3M neutral bouyancy float<br/>\nEM1815 Foldable rigid mast with gps<br/>\nEM1734 Transport case for navigation platform (mamy, ale z pokazan zawartocia, majc fotografa na miejscu mona zrobi jeszcze pust na wzr enc3m case maej)<br/>\n<br/>\nNa bazie kart produktowych MIL takich fotek si nie doszukaem, cz brakujcych bdzie pokrywa si z REC.<br/>\nBy moe macie jeszcze gdzie zachomikowane u siebie (Witek?), to bd wdziczny za podesane lub ewentualnie sugesti ktre trzeba zrobi nowe fotki, ktre ju s nieaktualne. Na mega i synoglogy chyba wszystko przewertowaem.<br/>\n<br/>\nWszystkie coupling sets i platformy do weryfikacji.</t>','33a419ade2a53b4c03121a9fe8deebd5',0,'','9bkbt',1,0,'',0,0,0,1,0,'',0),(271,58,21,58,0,'94.232.216.242',1652163289,0,1,1,1,1,'','Re: Projekty video o Jaskiniach Sowacja, Chorwacja, Hiszpania - propozycja wsparcia','<r><QUOTE><s>[quote]</s>I appreciate your persisting interests and therefor I feel that I can be completely honest with you.<br/>\n<br/>\nI truly believe your dpvs are the best on the market. I like working with the top notch equipment and so you are the first producer I got in touch with. In fact, we could place any dpv in the videos and possibly get a sponsorship, but I, myself, wanted Seacraft for the most important reason - non of other dpvs I have tried, provides me with such capabilities in terms of shooting videos. Non of them maneuvers so smoothly and precisely to get the footage I want. This is critically important. <br/>\n  <br/>\nLike I said before, I also believe my tec/cave diving production is of the highest quality and generates a strong impact to attracts quality brands.<br/>\n<br/>\nI also understand your side in terms of costs and know that giving out 2 expensive pieces of gear may be too much too ask for.<br/>\n<br/>\nMy idea would be having your dpvs on a long/short term use free of charge, initially for 1-2 projects. After completing these projects you can decide if such an exposure brings enough benefits to continue or we give the products back. <br/>\nAs I mentioned before, the footage would be available for you to use and even if we quit our cooperation, the visual material will remain properly licenced to Seacraft for future.\n<e>[/quote]</e></QUOTE>\n\nSzuka sponsora, nie jest skonny zapaci. Interesuje i opaca nam si wypoyczenie mu 2 skuterw do 2 projektw?</r>','c5e4576d4f95484a07d041cf2562cddd',0,'','7oyhk',1,0,'',0,0,0,1,0,'',0),(272,78,28,58,0,'94.232.216.242',1652164849,0,1,1,1,1,'','Reklamy GO! na FB','<r>Warto mie na uwadze przygotowanie reklam graficznych do \"rolki\" na FB, oprcz samego filmu, ktry bdziemy promowa, reklama statyczna te bdzie potrzebna, dotychczasowa za niewielki koszt daje cakiem fajne efekty.<br/>\n<br/>\nPoniej wycite screenshoty z obecnej rolki z Future.<br/>\n\n<ATTACHMENT filename=\"fb rolka.jpg\" index=\"0\"><s>[attachment=0]</s>fb rolka.jpg<e>[/attachment]</e></ATTACHMENT>\n\nSzablony mamy, gdy pojawi si fotki z Go! w akcji, moemy kombinowa <E>:)</E></r>','71045046229a285cd745bd515643176d',1,'','16zviag',1,0,'',0,0,0,1,0,'',0),(273,6,20,60,0,'91.196.8.186',1652165335,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Podpytaam te Franka co on by pokaza i poniej jego propozycje: <br/>\n<br/>\n-	Magnetic drive / Silence / Very little maintenance requirements<br/>\n-	Compact, simple, and clear design  easy handling<br/>\n-	Battery suitable for flying  the ideal travel scooter (not many other brands currently offer this)<br/>\n-	Low weight of the unit  perfect for recreational divers (not sure if we should target women especially?)<br/>\n-	Variable operation modes (please clarify with Tomasz): If there will be a free diving mode, we MUST market this <EMOJI seq=\"1f609\" tseq=\"1f609\">&#128521;</EMOJI><br/>\n-	Possible use of the GO! As backup scooter for Tec divers</r>','693a1e9521284d6925bf30bfff095d60',0,'','fcdwvm7',1,0,'',0,0,0,1,0,'',0),(274,6,20,58,0,'94.232.216.242',1652165614,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>W midzyczasie dotara do nas nasza skrzynia od Adama.<br/>\n\n<ATTACHMENT filename=\"280092293_3130145203914328_1972688013633357119_n (1).jpg\" index=\"0\"><s>[attachment=0]</s>280092293_3130145203914328_1972688013633357119_n (1).jpg<e>[/attachment]</e></ATTACHMENT>\n\nWyglda wietnie. <br/>\n<br/>\nMusimy pomylc czym j w rodku wyoy, aby osignc ten odbijajacy si efekt wiata niczym zota. <br/>\n<br/>\nPomysy? <E>:)</E></r>','4a67dc0823227d54e9a9bffb54294f58',1,'','5z7sar86',1,0,'',0,0,0,1,0,'',0),(275,6,20,61,0,'94.232.216.242',1652165829,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r>Skrzynia przyjechaa do Krosna i jest rodem Piratw z Karaibw  <E>:D</E> <br/>\nPaulino, zapytaj Adama czy ta tkanina bdzie ok.<br/>\nMoim zdaniem nadaje si idealnie.<br/>\n<br/>\n<URL url=\"https://www.tkaniny.net/63-06508-011_aksamit-elastyczny-zloto.html?gclid=CjwKCAjw9-KTBhBcEiwAr19ig_0uUpQjeTbFjYCvuASTa0BsfvUj5ge888gStJdRUbO7WiIvCMIY2hoC8mQQAvD_BwE\"><LINK_TEXT text=\"https://www.tkaniny.net/63-06508-011_ak ... mQQAvD_BwE\">https://www.tkaniny.net/63-06508-011_aksamit-elastyczny-zloto.html?gclid=CjwKCAjw9-KTBhBcEiwAr19ig_0uUpQjeTbFjYCvuASTa0BsfvUj5ge888gStJdRUbO7WiIvCMIY2hoC8mQQAvD_BwE</LINK_TEXT></URL></r>','cc43e1e7a16060529aeb49715a89245f',0,'','1ak3',1,0,'',0,0,0,1,0,'',0),(276,6,20,61,0,'94.232.216.242',1652165938,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><URL url=\"https://kucmar.pl/product-pol-13600-Organza-brokatowa-zlota-36cm-rolka-9m-ORG-019.html?utm_source=iai_ads&amp;utm_medium=google_shopping\"><LINK_TEXT text=\"https://kucmar.pl/product-pol-13600-Org ... e_shopping\">https://kucmar.pl/product-pol-13600-Organza-brokatowa-zlota-36cm-rolka-9m-ORG-019.html?utm_source=iai_ads&amp;utm_medium=google_shopping</LINK_TEXT></URL><br/>\n<br/>\ni troch tego moe</r>','da7972a59f6b3a610f69bc087d838e4c',0,'','17h92b',1,0,'',0,0,0,1,0,'',0),(277,48,25,63,0,'85.221.240.2',1652171275,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>Jako Reseller - rwnie jest lokalnym przedstawicielem Seacrafta.<br/>\n<br/>\nPaulino - czy chcesz do nich napisa, czy ja mam to zrobi? Wypadaoby da zna dzisiaj/ jutro...</t>','bb73b6f78cc35fc02434b116e31285b0',0,'','3m0r1m',1,0,'',0,0,0,1,0,'',0),(278,6,20,63,0,'85.221.240.2',1652171718,0,1,1,1,1,'','Re: GO! - scenariusz filmu','<r><URL url=\"https://allegro.pl/oferta/zlote-monety-do-gier-i-zabaw-zetony-144-szt-poker-12114721168\"><LINK_TEXT text=\"https://allegro.pl/oferta/zlote-monety- ... 2114721168\">https://allegro.pl/oferta/zlote-monety-do-gier-i-zabaw-zetony-144-szt-poker-12114721168</LINK_TEXT></URL><br/>\nNie wiem jak z pywalnoci, mona troch dorzuci (dowaone np: <URL url=\"https://allegro.pl/oferta/pasta-wolframowa-downforce-prologic-3-x-10-g-11674758909?bi_s=ads&amp;bi_m=listing%3Adesktop%3Aquery&amp;bi_c=NjNjMTk2YzQtM2VlMy00OTU0LWIxYmUtMjcxNmZiNTVlN2M1AA&amp;bi_t=ape&amp;referrer=proxy&amp;emission_unit_id=03c19f21-9f78-4aff-9841-21856fee456e\"><LINK_TEXT text=\"https://allegro.pl/oferta/pasta-wolfram ... 856fee456e\">https://allegro.pl/oferta/pasta-wolframowa-downforce-prologic-3-x-10-g-11674758909?bi_s=ads&amp;bi_m=listing%3Adesktop%3Aquery&amp;bi_c=NjNjMTk2YzQtM2VlMy00OTU0LWIxYmUtMjcxNmZiNTVlN2M1AA&amp;bi_t=ape&amp;referrer=proxy&amp;emission_unit_id=03c19f21-9f78-4aff-9841-21856fee456e</LINK_TEXT></URL> )</r>','2705848d5e3e14af2ab19fceebb94671',0,'','7mjwv',1,0,'',0,0,0,1,0,'',0),(279,58,21,63,0,'85.221.240.2',1652171873,0,1,1,1,1,'','Re: Projekty video o Jaskiniach Sowacja, Chorwacja, Hiszpania - propozycja wsparcia','<t>Myl e wypoyczenie 2 skuterw do projektw jest rozsdne (w zamian za pene prawa licencyjne). <br/>\nMimo tego, po okresie wypoyczenia, na pewno nie bdzie mg ich zatrzyma. (chyba e zdziaa cuda), natomiast trzeba by lojalnie o tym powiedzie.<br/>\n<br/>\nMamy braki w maszynach testowych, natomiast zblia si czas \'oddania\' skuterw z Deepspotu ( w zamian za 3 GO!). Czy ma lini czasu kiedy by ich potrzebowa?</t>','68b1fe8dd46fe5e3b73636d758c2872b',0,'','iwg37v8y',1,0,'',0,0,0,1,0,'',0),(280,48,25,58,0,'94.232.216.242',1652173372,0,1,1,1,1,'','Re: 25-26.06.2022 [REC] Handover event Cavebase','<t>W mailu do nich warto byoby te okreli jakie zdjcia bdziemy chcieli aby dla nas zrobili i je publikowali odnonie samego ogoszenia tego. (oni ju tam co dodaj jak docieraj do nich paczki).<br/>\n<br/>\nJednym z pomysw by post informujcy przez nich e przechodz na nasz sprzt i takie zbiorcze zdjcie gdzie wszyscy s w wodzie z naszymi skuterami na 1 ujciu.<br/>\n<br/>\nPniej kady z nich (jest ich 10) mgby publikowa w odstpach czasu jak realcj/galeri zdj w akcji ze skuterami.<br/>\n<br/>\nCo sdzicie?</t>','ae410cc814e683a31344b3382c3741e0',0,'','24gl9k',1,0,'',0,0,0,1,0,'',0),(281,7,41,58,0,'94.232.216.242',1652175159,0,1,1,1,1,'','Re: Sugestie, pomysy, zgoszenia','<t>Dzi po 17 zaplanowalimu przeniesienie Forum i jego zawartoci na nasz server. Prosz o nie dodawanie wpisw po 17.00. <br/>\n<br/>\nPodel link do przeniesionego forum, jak wszystko pjdzie zgodnie z planem.</t>','1660041736cbbc471ab9e2367c97fbc5',0,'','648aj',1,0,'',0,0,0,1,0,'',0),(282,53,39,61,0,'94.232.216.242',1652345887,0,1,1,1,1,'','Re: Zmiany w kolejnej wersji cennika rec','<t>Dodaam do cennika bateri lotnicz.<br/>\n<br/>\nWitek, zerknij i przetumacz. Dodaj rwnie kartownik - Izabela wycenia.</t>','de019b4b5a96058a554d14335a77b020',0,'','903tf',1,0,'',0,0,0,1,0,'',0),(283,54,40,61,0,'91.196.8.186',1652686721,0,1,1,1,1,'','Re: Niezbdne zmiany w cenniku special','<r>Dooy do oferty tablet lub raczej laptop do ENC.<br/>\nPropozycja<br/>\nLatitude 7220<br/>\n<br/>\n<URL url=\"https://kuplaptopa.pl/product/785389/dell-rugged-7220-i7-11.6-fhd-dotyk-1000nits-16gb-512gb-ssd-gps-wifi-bt-win10pro-ip-65-mil-810-3y-nbd?gclid=CjwKCAjw7IeUBhBbEiwADhiEMb3sceCvrx9WLWyLJnzs0jZbFWI4_XDUK-_0qaRbgah92aVfiRl4YBoC5iUQAvD_BwE\"><LINK_TEXT text=\"https://kuplaptopa.pl/product/785389/de ... iUQAvD_BwE\">https://kuplaptopa.pl/product/785389/dell-rugged-7220-i7-11.6-fhd-dotyk-1000nits-16gb-512gb-ssd-gps-wifi-bt-win10pro-ip-65-mil-810-3y-nbd?gclid=CjwKCAjw7IeUBhBbEiwADhiEMb3sceCvrx9WLWyLJnzs0jZbFWI4_XDUK-_0qaRbgah92aVfiRl4YBoC5iUQAvD_BwE</LINK_TEXT></URL><br/>\n<br/>\n<br/>\nSugerowana cena kocowa:<br/>\n3780 E<br/>\n<br/>\n10% narzutu<br/>\nz czego 5% dla dystrybutora i 5% zostaje dla nas na koszty operacyjne.<br/>\n<br/>\nZauwayam, e we wzorze umowy zacznik nr 1 nie zawiera cen po ktrych sprzedajemy tylko sugerowane ceny kocowe. Chyba bdziemy musieli wszystkim wysa ten zacznik.</r>','c7a735e857d60ef076df00d788ce2a1d',0,'','76jnv',1,0,'',0,0,0,1,0,'',0);
